(1, 'https://cdn.tgdd.vn/Products/Images/8781/319229/bhx/nac-dam-heo-nhap-khau-500g-hat-nem-nam-huong-maggi-450g-dong-lanh-500g-202311201507328081.jpg', 'Nạc dăm heo nhập khẩu 500g & hạt nêm nấm hương Maggi 450g', 105500.00, 10, 94950.00, 60, 42200.00, 69, 'gói', NULL, 5.0, 'Nạc dăm là phần nạc dăm mềm, có lớp mỡ mỏng, chứa nhiều axit amin cần thiết cho cơ thể, dùng làm nguyên liệu chế biến các món ăn hấp dẫn. Nạc dăm heo nhập khẩu 500g & hạt nêm nấm hương Maggi 450g chất lượng, giàu dinh dưỡng, mang đến những món ăn ngon cho gia đình.', NULL, 1, 1, '2023-11-28 02:46:58', '2024-01-01 05:41:08', NULL, 1, 1),
(2, 'https://cdn.tgdd.vn/Products/Images/8781/319228/bhx/ba-roi-heo-nhap-khau-dong-lanh-500g-hat-nem-maggi-400g-202311201604013696.jpg', 'Ba rọi heo nhập khẩu 500g & hạt nêm Maggi 400g', 111500.00, 13, 97005.00, 15, 94775.00, 76, 'gói', '', 4.3, NULL, NULL, 1, 1, '2023-11-28 02:46:58', '2023-12-29 21:42:03', NULL, 1, 1),
(3, 'https://cdn.tgdd.vn/Products/Images/8781/297349/bhx/-202306211448544376.jpg', 'Ba rọi heo nhập khẩu 500g', 65000.00, 0, 65000.00, NULL, NULL, 69, 'túi', '500g', 5.0, 'Ba rọi heo nhập khẩu có da với tỉ lệ nạc mỡ tuyệt vời, thịt heo săn chắc ngọt nên luôn được các bà nội trợ ưa chuộng và tin dùng. Ba rọi heo nhập khẩu đông lạnh với phương pháp cấp đông hiện đại, giúp lưu giữ hương vị tự nhiên, mang đến những món ăn ngon cho gia đình.', NULL, 0, 0, '2023-11-28 02:46:58', '2024-01-01 04:12:27', NULL, 1, 1),
(4, 'https://cdn.tgdd.vn/Products/Images/8781/314535/bhx/ba-roi-heo-nhap-khau-dong-lanh-300g-202309072143306697.jpg', 'Ba rọi heo nhập khẩu đông lạnh 300g', 40000.00, 0, 40000.00, NULL, NULL, 16, 'túi', '300g', 5.0, 'Ba rọi là phần thịt heo có tỉ lệ nạc mỡ cân đối, săn chắc, mềm ngọt nên được nhiều chị em nội trợ ưa chuộng lựa chọn cho bữa ăn gia đình. Ba rọi heo nhập khẩu đông lạnh được cấp đông theo phương pháp hiện đại giúp thịt vẫn giữ được hương vị vốn có.', NULL, 1, 1, '2023-11-28 02:46:58', '2023-12-29 21:32:47', NULL, 1, 1),
(5, 'https://cdn.tgdd.vn/Products/Images/8781/298878/bhx/nac-dam-heo-nhap-khau-dong-lanh-tui-200g-202212060825395663.jpg', 'Nạc dăm heo nhập khẩu 200g', 29000.00, 0, 29000.00, NULL, NULL, 71, 'túi', '200g', 5.0, 'Nạc dăm là phần nạc dăm mềm, có lớp mỡ mỏng, chứa nhiều axit amin cần thiết cho cơ thể, dùng làm nguyên liệu chế biến các món ăn hấp dẫn. Nạc dăm heo nhập khẩu đông lạnh với phương pháp cấp đông hiện đại, giúp lưu giữ hương vị tự nhiên, mang đến những món ăn ngon cho gia đình.', NULL, 0, 1, '2023-11-28 02:46:58', '2023-12-23 08:23:54', NULL, 1, 1),
(6, 'https://cdn.tgdd.vn/Products/Images/8781/297350/bhx/nac-dam-heo-nhap-khau-dong-lanh-tui-500g-202211111014371522.jpg', 'Nạc dăm heo nhập khẩu 500g', 52000.00, 0, 52000.00, NULL, NULL, 5, 'túi', '500g', 5.0, 'Nạc dăm là phần nạc dăm mềm, có lớp mỡ mỏng, chứa nhiều axit amin cần thiết cho cơ thể, dùng làm nguyên liệu chế biến các món ăn hấp dẫn. Nạc dăm heo nhập khẩu đông lạnh với phương pháp cấp đông hiện đại, giúp lưu giữ hương vị tự nhiên, mang đến những món ăn ngon cho gia đình.', NULL, 0, 1, '2023-11-28 02:46:58', '2023-12-23 08:23:54', NULL, 1, 1),
(7, 'https://cdn.tgdd.vn/Products/Images/8781/307864/bhx/thit-vai-heo-nhap-khau-dong-lanh-200g-202306090845057118.jpg', 'Thịt vai heo nhập khẩu 200g', 25000.00, 0, 25000.00, NULL, NULL, 14, 'túi', '200g', 5.0, 'Thịt heo với tỉ lệ nạc mỡ hoàn hảo đảm bảo được độ ngon thịt, các món ăn như thịt luộc, thịt kho hoặc thịt xào với các loại rau, củ. Thịt vai heo nhập khẩu tại Bách hoá XANH có nguồn gốc rõ ràng, đảm bảo an toàn vệ sinh thực phẩm.', NULL, 0, 1, '2023-11-28 02:46:58', '2023-12-23 08:23:54', NULL, 1, 1),
(8, 'https://cdn.tgdd.vn/Products/Images/8781/297351/bhx/thit-vai-heo-nhap-khau-dong-lanh-500gr-202306090843334771.jpg', 'Thịt vai heo nhập khẩu 500g', 75500.00, 0, 75500.00, NULL, NULL, 51, 'túi', '500g', 5.0, 'Thịt heo với tỉ lệ nạc mỡ hoàn hảo đảm bảo được độ ngon thịt, các món ăn như thịt luộc, thịt kho hoặc thịt xào với các loại rau, củ. Thịt vai heo nhập khẩu tại Bách hoá XANH có nguồn gốc rõ ràng, đảm bảo an toàn vệ sinh thực phẩm.', NULL, 0, 1, '2023-11-28 02:46:58', '2023-12-23 08:23:54', NULL, 1, 1),
(9, 'https://cdn.tgdd.vn/Products/Images/8781/312808/bhx/thit-nac-heo-nhap-khau-dong-lanh-200g-202311131505049353.jpg', 'Thịt nạc heo đông lạnh 200g', 25000.00, 0, 25000.00, NULL, NULL, 13, 'túi', '200g', 5.0, 'Thịt heo với tỉ lệ nạc mỡ hoàn hảo đảm bảo được độ ngon thịt, các món ăn như thịt luộc, thịt kho hoặc thịt xào với các loại rau, củ. Thịt nạc heo nhập khẩu đông lạnh tại Bách hoá XANH có nguồn gốc rõ ràng, đảm bảo an toàn vệ sinh thực phẩm.', NULL, 0, 1, '2023-11-28 02:46:58', '2023-12-23 08:23:54', NULL, 1, 1),
(10, 'https://cdn.tgdd.vn/Products/Images/8781/312803/bhx/thit-nac-heo-nhap-khau-dong-lanh-500g-202308090936560456.jpg', 'Thịt nạc heo đông lạnh 500g', 59000.00, 0, 59000.00, NULL, NULL, 13, 'túi', '500g', 5.0, 'Thịt nạc heo nhập khẩu đông lạnh 500g chứa nhiều protein và ít chất béo là nguyên liệu thông dụng để tạo nên những món ăn ngon cho mọi gia đình. Thịt heo đông lạnh tại Bách hoá XANH được đảm bảo nguồn gốc xuất xứ rõ ràng, đảm bảo an toàn vệ sinh thực phẩm và dễ dàng bảo quản.', NULL, 0, 1, '2023-11-28 02:46:58', '2023-12-23 08:23:54', NULL, 1, 1),
(11, 'https://cdn.tgdd.vn/Products/Images/8781/314539/bhx/suon-non-heo-nhap-khau-dong-lanh-300g-202311131512332166.jpg', 'Sườn non heo nhập khẩu đông lạnh 300g', 46000.00, 0, 46000.00, NULL, NULL, 23, 'túi', '300g', 5.0, 'Sườn non heo nhập khẩu được cấp đông theo phương pháp hiện đại, giúp lưu giữ hương vị tự nhiên, đảm bảo chất lượng và an toàn cho sức khỏe người tiêu dùng. Sườn non có thể chế biến thành nhiều món ăn ngon như sườn nướng, sườn sốt me,...\r\n', NULL, 0, 1, '2023-11-28 02:46:58', '2023-12-23 08:23:54', NULL, 1, 1),
(13, 'https://cdn.tgdd.vn/Products/Images/8781/310663/bhx/thit-heo-xay-200g-202310201709376275.jpg', 'Thịt heo xay 200g', 20000.00, 0, 20000.00, NULL, NULL, 15, 'túi', '200g', 5.0, 'Thịt heo xay đông lạnh xuất xứ từ Brazil, được đóng gói và bảo quản theo những tiêu chuẩn nghiêm ngặt về vệ sinh và an toàn thực phẩm, đảm bảo về chất lượng, độ tươi và ngon của thực phẩm. Được sơ chế kĩ càng và xay nhuyễn, thịt heo xay luôn được lựa chọn để nấu canh, làm các món chả,..', NULL, 0, 1, '2023-11-28 02:46:58', '2023-12-23 08:23:54', NULL, 1, 1),
(15, 'https://cdn.tgdd.vn/Products/Images/8781/309992/bhx/-202311061348346522.jpg', '2 túi xương que heo đông lạnh 500g', 78000.00, 0, 78000.00, NULL, NULL, 59, 'túi', '1kg', 5.0, 'Xương que là một nguyên liệu phổ biến trong mâm cơm gia đình vì dễ dàng chế biến thành nhiều món ngon dinh dưỡng tuyệt vời. Xương que heo nhập khẩu đông lạnh với phương pháp cấp đông hiện đại, giúp lưu giữ hương vị tự nhiên, mang đến những món ăn ngon cho gia đình.', NULL, 0, 1, '2023-11-28 02:46:58', '2023-12-23 08:23:54', NULL, 1, 1),
(17, 'https://cdn.tgdd.vn/Products/Images/8781/297346/bhx/chan-gio-heo-nhap-khau-dong-lanh-500g-3-5-mieng-202306090841143145.jpg', 'Chân giò heo nhập khẩu 500g', 35000.00, 29, 24850.00, NULL, NULL, 70, 'túi', '500g', 5.0, 'Chân giò heo nhập khẩu là phần thịt heo giòn giòn, dai dai, cực kỳ bổ dưỡng mà các bà nội trợ ưa chuộng. Chân giò heo nhập khẩu đông lạnh với phương pháp cấp đông hiện đại, giúp lưu giữ hương vị tự nhiên, mang đến những món ăn ngon cho gia đình.', NULL, 1, 1, '2023-11-28 02:46:58', '2024-01-01 05:40:07', NULL, 1, 1),
(18, 'https://cdn.tgdd.vn/Products/Images/8781/310966/bhx/thit-ba-roi-heo-rung-lai-250g-202308051537117960.jpg', 'Thịt ba rọi heo rừng lai 250g', 95000.00, 10, 85500.00, NULL, NULL, 74, 'khay', '250g', 5.0, 'Thịt ba rọi heo rừng lai tươi ngon, thịt dai, ngon, ngọt, chất lượng. Thịt ba rọi thích hợp chế biến các món như ba rọi chiên sả ớt, ba rọi heo rừng lai nướng,... vô cùng hấp dẫn và chứa nhiều dưỡng chất.', NULL, 1, 1, '2023-11-28 02:46:58', '2024-01-01 05:40:10', NULL, 1, 1),
(19, 'https://cdn.tgdd.vn/Products/Images/12718/308126/bhx/thit-kho-trung-cut-300g-202308281045510922.jpg', 'Thịt kho trứng cút 300g', 49000.00, 0, 49000.00, NULL, NULL, 59, 'khay', '300g', 5.0, 'Thịt kho trứng cút 300g là thực phẩm sơ chế sẵn vô cùng tiện dụng, đến từ thương hiệu uy tín có tiếng. Thịt heo chất lượng tẩm ướp gia vị đậm đà, trứng cút mềm bùi, béo hòa quyền hoàn hảo bạn có ngay bữa cơm ngon chuẩn vị gia đình.', NULL, 1, 1, '2023-11-28 02:46:58', '2024-01-01 05:40:32', NULL, 1, 1),
(20, 'https://cdn.tgdd.vn/Products/Images/12718/308119/bhx/dau-hu-don-thit-400g-202306220823306033.jpg', 'Đậu hũ dồn thịt 400g', 47000.00, 0, 47000.00, 30, 32900.00, 73, 'khay', '400g', 5.0, 'Đậu hũ dồn thịt 400g tiện lợi, thơm ngon, tiết kiệm thời gian cho những chị em nội trợ bận rộn. Sản phẩm được đóng gói cẩn thận, vệ sinh, có thể chế biến ngay mà vẫn giữ trọn hương vị thơm ngon, đậm đà', NULL, 0, 1, '2023-11-28 02:46:58', '2023-12-29 21:45:52', NULL, 1, 1),
(21, 'https://cdn.tgdd.vn/Products/Images/12718/304914/bhx/sellingpoint.jpg', 'Mắm chưng hộp 100g', 26500.00, 0, 26500.00, NULL, NULL, 85, 'chén', '', 5.0, 'Đây là loại thực phẩm làm sẵn, ăn liền vô cùng tiện lợi được rất nhiều người yêu thích. Mắm chưng hộp 100g chính hãng thực phẩm làm sẵn Ngọc Tú được chế biến từ những nguyên liệu tươi ngon, an toàn, hương vị hài hòa ngon như mắm chưng tại nhà, được làm chín sẵn tiện lợi sử dụng', NULL, 0, 1, '2023-11-28 02:46:58', '2023-12-23 08:23:54', NULL, 1, 1),
(22, 'https://cdn.tgdd.vn/Products/Images/12718/308120/bhx/kho-qua-don-thit-400g-202306031510296686.jpg', 'Khổ qua dồn thịt 400g', 46000.00, 0, 46000.00, NULL, NULL, 5, 'khay', '400g', 5.0, 'Khổ qua dồn thịt 400g được sơ chế sẵn, nêm nếm vệ sinh sạch sẽ, bạn có thể nấu trực tiếp, tiết kiệm thời gian chế biến. Khổ qua dồn thịt khi nấu lên vẫn giữ được hương vị đậm đà, hấp dẫn và thơm ngon.', NULL, 0, 1, '2023-11-28 02:46:58', '2023-12-23 08:23:54', NULL, 1, 1),
(23, 'https://cdn.tgdd.vn/Products/Images/12718/308122/bhx/sellingpoint.jpg', 'Nầm heo (Vú heo) nướng chao 300g', 75000.00, 0, 75000.00, NULL, NULL, 70, 'khay', '', 5.0, 'Nầm heo nướng chao 300g là thực phẩm sơ chế sẵn vô cùng tiện dụng, đến từ thương hiệu uy tín có tiếng. Nầm heo ngon cùng sốt chao mặn mà tròn vị, bạn có ngay món ăn ngon dinh dưỡng tại nhà.', NULL, 0, 1, '2023-11-28 02:46:58', '2023-12-23 08:23:54', NULL, 1, 1),
(24, 'https://cdn.tgdd.vn/Products/Images/8790/318604/bhx/chan-ga-cp-500g-10-12-cai-202311111026220419.jpg', 'Nầm heo (Vú heo) nướng sa tế 300g', 75000.00, 0, 75000.00, NULL, NULL, 32, 'khay', '300g', 5.0, '2 hộp Chân gà C.P đạt các tiêu chuẩn về an toàn thực phẩm, đảm bảo về chất lượng, độ tươi và ngon, xuất xứ rõ ràng. Chân gà thích hợp để nấu món chân gà ngâm sả tắc, chân gà nướng sa tế, chân gà sốt cay Hàn Quốc,... Có thể dùng điện thoại quét code QR trên sản phẩm để kiểm tra nguồn góc.', NULL, 0, 1, '2023-11-28 02:46:58', '2023-12-23 08:23:54', NULL, 1, 1),
(25, 'https://cdn.tgdd.vn/Products/Images/12718/310992/bhx/combo-nuong-da-ngoai-khay-650g-202307281019290466.jpg', 'Combo nướng dã ngoại 650g', 214500.00, 10, 193050.00, NULL, NULL, 49, 'khay', '650g', 5.0, 'Combo nướng dã ngoại khay 650g bao gồm ba rọi heo (20%), chân gà (20%), sườn non heo (30%), tim heo (15%), đậu bắp (15%) được sơ chế và cắt sẵn tiện lợi, giúp rút ngắn thời gian chế biến, phù hợp cho những buổi dã ngoại ngoài trời. Sản phẩm đảm bảo nguồn gốc xuất xứ, chất lượng, an toàn cho sức khỏe người tiêu dùng.', NULL, 0, 1, '2023-11-28 02:46:58', '2023-12-23 08:23:54', NULL, 1, 1),
(26, 'https://cdn.tgdd.vn/Products/Images/12718/311002/bhx/combo-nuong-hoang-gia-khay-1kg-202307281019547012.jpg', 'Combo nướng hoàng gia 1kg', 305000.00, 9, 277550.00, NULL, NULL, 48, 'khay', '1kg', 5.0, 'Combo nướng hoàng gia khay 1kg tươi ngon, chất lượng, sử dụng tiện lợi, thích hợp cho các bữa tiệc nướng, dã ngoại ngoài trời. Sản phẩm bao gồm: Ba rọi bò, ba rọi heo, sườn non heo, gà nòi, tim heo, bắp mỹ,... đảm bảo nguồn gốc xuất xứ, an toàn cho sức khỏe người tiêu dùng.', NULL, 0, 1, '2023-11-28 02:46:58', '2023-12-23 08:23:54', NULL, 1, 1),
(27, 'https://cdn.tgdd.vn/Products/Images/12718/311006/bhx/gia-cay-heo-khay-1kg-202307281020490591.jpg', 'Giả cầy heo 1kg', 114000.00, 10, 102600.00, NULL, NULL, 90, 'khay', '1kg', 5.0, 'Giả cầy heo khay 1kg chất lượng, đảm bảo nguồn gốc xuất xứ. Sản phẩm bao gồm các nguyên liệu như: Dựng heo, sườn non heo, ba rọi heo, củ riềng, sả, lá mơ,... giàu dinh dưỡng và đảm bảo an toàn, có thể chế biến thành nhiều món ăn thơm ngon.', NULL, 0, 1, '2023-11-28 02:46:58', '2023-12-23 08:23:54', NULL, 1, 1),
