(81, 'https://cdn.tgdd.vn/Products/Images/8139/306156/bhx/suon-bo-my-co-xuong-fohla-dong-lanh-250g-202309121547264016.jpg', 'Sườn bò Mỹ có xương Fohla 250g', 115000.00, 0, 115000.00, NULL, NULL, 64, 'khay', '250g', 5.0, 'Sườn bò Mỹ có xương Fohla 250g chất lượng, tươi ngon, được đảm bảo nguồn gốc xuất xứ rõ ràng. Sườn bò Mỹ có thịt mềm, ngọt, ngon, hương vị khi ăn đậm đà khó quên. Sườn bò Mỹ có thể nấu nhiều món ngon như sườn bò nướng, canh sườn bò,...', NULL, 0, 1, '2023-11-28 05:48:52', '2023-12-23 08:23:54', NULL, 2, 5),
(82, 'https://cdn.tgdd.vn/Products/Images/8139/306149/bhx/dau-than-ngoai-bo-hokubee-fohla-dong-lanh-250g-202309121546129849.jpg', 'Đầu thăn ngoại bò Hokubee Fohla 250g', 229000.00, 0, 229000.00, NULL, NULL, 71, 'khay', '250g', 5.0, 'Đầu thăn ngoại bò Úc Fohla 250g gồm nạc và vân mỡ tạo nên độ mềm, ngọt tự nhiên của thịt bò, cũng như độ giòn và béo đặc trưng. Thịt bò có nguồn gốc rõ ràng, chất lượng, được nhiều người chọn mua.', NULL, 0, 1, '2023-11-28 05:48:52', '2023-12-23 08:23:54', NULL, 2, 5),
(83, 'https://cdn.tgdd.vn/Products/Images/8139/306149/bhx/dau-than-ngoai-bo-hokubee-fohla-dong-lanh-250g-202309121546129849.jpg', 'Thăn ngoại bò Hokubee Fohla 250g', 209000.00, 0, 209000.00, NULL, NULL, 63, 'khay', '250g', 5.0, 'Đầu thăn ngoại bò Úc Fohla 250g gồm nạc và vân mỡ tạo nên độ mềm, ngọt tự nhiên của thịt bò, cũng như độ giòn và béo đặc trưng. Thịt bò có nguồn gốc rõ ràng, chất lượng, được nhiều người chọn mua.', NULL, 0, 1, '2023-11-28 05:48:52', '2023-12-23 08:23:54', NULL, 2, 5),
(84, 'https://cdn.tgdd.vn/Products/Images/8139/306912/bhx/combo-thit-bo-bo-vien-ca-hoi-nau-lau-fohla-1kg-202305131530561312.jpg', 'Combo Thịt bò + Bò viên + Cá hồi nấu lẩu Fohla 1kg', 380000.00, 10, 342000.00, NULL, NULL, 98, 'túi', '1kg', 5.0, 'Combo thịt lẩu Fohla tươi ngon, chất lượng, được tặng kèm nước cốt lẩu giúp tiết kiệm thời gian sơ chế và nấu lẩu. Combo thịt lẩu gồm ba chỉ bò Mỹ, sườn bò Mỹ, bò viên Úc, cá hồi Nauy vô cùng dinh dưỡng, thơm ngon và hấp dẫn.', NULL, 0, 1, '2023-11-28 05:48:52', '2023-12-23 08:23:54', NULL, 2, 5),
(85, 'https://cdn.tgdd.vn/Products/Images/8139/306913/bhx/combo-thit-heo-thit-bo-nuong-fohla-1kg-202305131541219149.jpg', 'Combo Thịt heo + Thịt bò nướng Fohla 1kg', 394000.00, 10, 354600.00, NULL, NULL, 100, 'túi', '1kg', 5.0, 'Combo thịt nướng Fohla tươi ngon, chất lượng, được kèm bịch nước xốt ướp nướng, đóng gói cẩn thận. Combo thịt nướng bao gồm ba chỉ heo Mỹ, nạc dăm heo, lõi nạc vai Mỹ, đầu thăn ngoại bò Úc vô cùng tiện lợi, và tiết kiệm thời gian chế biến nhưng vẫn hấp dẫn, dinh dưỡng.', NULL, 0, 1, '2023-11-28 05:48:53', '2023-12-23 08:23:54', NULL, 2, 5),
(86, 'https://cdn.tgdd.vn/Products/Images/8139/223389/bhx/bit-tet-dui-bo-uc-pacow-250g-202303300951508215.jpg', 'Bít tết đùi bò Úc mát Pacow 250g', 134000.00, 0, 134000.00, NULL, NULL, 8, 'vỉ', '250g', 5.0, 'Là thịt bò nạc nguyên quả nằm ngay phía trên bắp chân sau của con bò. Miếng thịt rất nạc và hơi khô phù hợp với chiên hoặc nướng theo tảng. Đặc biệt với món beefsteak. Bít tết đùi bò Úc Pacow khay 250g được sản xuất ở Úc bởi Pacow, đã được kiểm duyệt chặc chẽ nên đảm bảo an toàn.', NULL, 0, 1, '2023-11-28 05:52:46', '2023-12-23 08:23:54', NULL, 2, 6),
(87, 'https://cdn.tgdd.vn/Products/Images/8139/223384/bhx/thit-ba-chi-bo-uc-pacow-250g-202303300933398057.jpg', 'Thịt ba chỉ bò Úc Pacow 250g', 113000.00, 0, 113000.00, NULL, NULL, 36, 'vỉ', '250g', 5.0, 'Ba chỉ Bò là phần thịt tại cơ hoành của con bò, ngay dưới phần xương sườn. Thịt ba bò chỉ thường có nhiều mỡ có những dải mỡ và nạc giúp cho các món nướng lẩu mềm, thơm, ăn không ngán. Thịt ba chỉ bò Úc Pacow khay 250g được sản xuất ở Úc bởi Pacow, đã được kiểm duyệt chặc chẽ nên đảm bảo an toàn.', NULL, 0, 1, '2023-11-28 05:52:46', '2023-12-23 08:23:54', NULL, 2, 6),
(88, 'https://cdn.tgdd.vn/Products/Images/8139/223386/bhx/thit-bo-tai-uc-pacow-250g-202303300937536156.jpg', 'Thịt bò tái Úc Pacow 250g', 129000.00, 0, 129000.00, NULL, NULL, 57, 'vỉ', '250g', 5.0, 'Loại thịt bò với sự kết hợp hoàn hảo giữa mỡ, nạc và gân. Thịt có độ mềm vừa phải, rất ngọt và thơm tự nhiên, thích hợp nhất là dùng để ăn lẩu, phở bò tái, bún bò tái. Thịt bò tái Pacow khay 250g tươi ngon, là giống bò ở Úc bởi Pacow, đã được kiểm duyệt chặc chẽ nên đảm bảo an toàn.', NULL, 0, 1, '2023-11-28 05:52:46', '2023-12-23 08:23:54', NULL, 2, 6),
(89, 'https://cdn.tgdd.vn/Products/Images/8139/239159/bhx/thit-bo-uc-mat-cat-khoi-luc-lac-pacow-khay-250g-202202111454198796.jpg', 'Thịt bò Úc cắt khối lúc lắc Pacow 250g', 122000.00, 0, 122000.00, NULL, NULL, 73, 'vỉ', '250g', 5.0, 'Đây phần thịt bò mềm, ở trên cùng có một lớp mỡ dày, chắc nhưng không gây ngậy, không nồng khi chế biến thích hợp với món bò hầm hoặc ò lúc lắc. Bò Úc cắt khối lúc lắc khay 250g tươi ngon được sản xuất ở Úc bởi Pacow, đã được kiểm duyệt chặc chẽ nên đảm bảo an toàn.', NULL, 0, 1, '2023-11-28 05:52:46', '2023-12-23 08:23:54', NULL, 2, 6),
(90, 'https://cdn.tgdd.vn/Products/Images/8139/239162/bhx/bo-uc-mat-xao-pacow-khay-250g-202202111447535457.jpg', 'Thịt bò Úc xào Pacow 250g', 117000.00, 0, 117000.00, NULL, NULL, 96, 'vỉ', '250g', 5.0, 'Là nguyên liệu phổ biến trong việc bếp núc hàng ngày, thịt bò là loại thịt giàu protein, thích hợp để bổ sung máu và tái tạo tế bào mô thích hợp với các món như bò xào rau muống. Bò Úc xào Pacow khay 250g tươi ngon được sản xuất ở Úc bởi Pacow, đã được kiểm duyệt chặc chẽ nên đảm bảo an toàn.', NULL, 0, 1, '2023-11-28 05:52:46', '2023-12-23 08:23:54', NULL, 2, 6),
(91, 'https://cdn.tgdd.vn/Products/Images/8139/239160/bhx/thit-bo-uc-mat-xay-pacow-khay-250g-202202111441414170.jpg', 'Thịt bò Úc xay Pacow 250g', 86000.00, 0, 86000.00, NULL, NULL, 60, 'vỉ', '250g', 5.0, 'Rất thuận tiện chế biến nhiều món ngon. Thịt bò xay có cả nạc và mỡ xen lẫn cho hương vị béo ngậy tăng thêm phần hấp dẫn cho các món ăn. thích hợp để làm các món như hamburger, cháo, súp, bò viên. Thịt bò Úc xay khay 250g tươi ngon được sản xuất ở Úc bởi Pacow, đã được kiểm duyệt chặt chẽ.', NULL, 0, 1, '2023-11-28 05:52:46', '2023-12-23 08:23:54', NULL, 2, 6),
(92, 'https://cdn.tgdd.vn/Products/Images/8790/319235/bhx/dui-toi-ga-nhap-khau-550g-650g-hat-nem-nam-huong-maggi-800g-202311201537143219.jpg', 'Đùi tỏi gà nhập khẩu 550g - 650g & hạt nêm nấm hương 800g', 138700.00, 16, 116508.00, NULL, NULL, 11, 'gói', '', 5.0, 'Đùi tỏi gà nhập khẩu từ Mỹ được đóng gói và bảo quản theo những tiêu chuẩn nghiêm ngặt về vệ sinh và an toàn thực phẩm, đảm bảo về chất lượng. Đùi tỏi gà nhập khẩu 550g - 650g & hạt nêm cao cấp nấm hương 800g chất lượng, mang đến những món ăn giàu dinh dưỡng và an toàn cho sức khỏe người sử dụng.', NULL, 0, 1, '2023-11-28 05:59:35', '2023-12-23 08:23:54', NULL, 3, 1),
(93, 'https://cdn.tgdd.vn/Products/Images/8790/319239/bhx/canh-ga-nhap-khau-dong-lanh-500g-3-5-canh-dau-hao-maggi-dam-dac-350g-202311201553084826.jpg', 'Cánh gà nhập khẩu 500g & dầu hào Maggi đậm đặc 350g', 82500.00, 7, 76725.00, NULL, NULL, 72, 'chai', '', 5.0, 'Cánh gà nhập khẩu tươi ngon, thịt chắc, nhiều dinh dưỡng thường dùng để chiên với nước mắm hoặc hấp hành. Cánh gà nhập khẩu đông lạnh 500g (3 -5 cánh) & dầu hào Maggi đậm đặc 350g chất lượng, mang đến những món ăn giàu dinh dưỡng và an toàn cho sức khỏe người sử dụng.', NULL, 0, 1, '2023-11-28 05:59:35', '2023-12-23 08:23:54', NULL, 3, 1),
(94, 'https://cdn.tgdd.vn/Products/Images/8790/297341/bhx/-202309071523383004.jpg', 'Cánh gà nhập khẩu đông lạnh 500g (3 -5 cánh)', 55500.00, 0, 55500.00, NULL, NULL, 28, 'túi', '500g', 5.0, 'Cánh gà nhập khẩu tươi ngon, thịt chắc, nhiều dinh dưỡng thường dùng để chiên với nước mắm hoặc hấp hành. Cánh gà nhập khẩu đông lạnh với phương pháp cấp đông hiện đại, giúp lưu giữ hương vị tự nhiên, mang đến những món ăn ngon cho gia đình.', NULL, 0, 1, '2023-11-28 05:59:35', '2023-12-23 08:23:54', NULL, 3, 1),
(95, 'https://cdn.tgdd.vn/Products/Images/8790/297338/bhx/canh-toi-ga-nhap-khau-dong-lanh-500g-4-6-canh-202306130905182179.jpg', 'Cánh tỏi gà nhập khẩu 500g', 56000.00, 0, 56000.00, NULL, NULL, 21, 'túi', '500g', 5.0, 'Cánh tỏi gà nhập khẩu thích hợp để nấu món cánh gà chiên nước mắm, gà rán, cánh gà chiên tiêu,... Cánh tỏi gà nhập khẩu đông lạnh với phương pháp cấp đông hiện đại, giúp lưu giữ hương vị tự nhiên, mang đến những món ăn ngon cho gia đình.', NULL, 0, 1, '2023-11-28 05:59:35', '2023-12-23 08:23:54', NULL, 3, 1),
(96, 'https://cdn.tgdd.vn/Products/Images/8790/297315/bhx/dui-toi-ga-nhap-khau-dong-lanh-550g-650g-2-4-cai-202306130911518568.jpg', 'Đùi tỏi gà nhập khẩu 550g - 650g', 49500.00, 10, 44550.00, NULL, NULL, 23, 'túi', '550-650g', 5.0, 'Đùi tỏi gà nhập khẩu từ Mỹ được đóng gói và bảo quản theo những tiêu chuẩn nghiêm ngặt về vệ sinh và an toàn thực phẩm, đảm bảo về chất lượng. Đùi tỏi gà nhập khẩu đông lạnh với phương pháp cấp đông hiện đại, giúp lưu giữ hương vị tự nhiên, mang đến những món ăn ngon cho gia đình.', NULL, 0, 1, '2023-11-28 05:59:35', '2023-12-23 08:23:54', NULL, 3, 1),
(97, 'https://cdn.tgdd.vn/Products/Images/8790/313892/bhx/long-ga-cp-250gr-202311030713485463.jpg', 'Lòng gà 250g', 25900.00, 21, 20461.00, NULL, NULL, 49, 'khay', '250g', 5.0, 'Lòng gà được sản xuất trên dây chuyền khép kín, an toàn vệ sinh thực phẩm. Lòng gà tươi sạch khay 250g gồm gan, tim, mề là bộ phận ngon và nhiều chất dinh dưỡng của con gà. Sản phẩm có 2 mã QR để khách hàng có thể truy xuất nguồn gốc thịt, vô cùng an tâm', NULL, 0, 1, '2023-11-28 05:59:36', '2023-12-23 08:23:54', NULL, 3, 1),
(100, 'https://cdn.tgdd.vn/Products/Images/8790/297314/bhx/ga-dai-han-quoc-nhap-khau-dong-lanh-nguyen-con-tu-11kg-13kg-202310170851319187.jpg', 'Gà cúng kim kê nguyên con 1.2kg', 163000.00, 9, 148330.00, NULL, NULL, 20, 'khay', '1.2kg', 5.0, 'Gà dai nhập khẩu được đóng gói và bảo quản theo những tiêu chuẩn nghiêm ngặt về vệ sinh và an toàn thực phẩm. Gà dai nguyên con nhập khẩu đông lạnh với chân gà sẫm màu do gà vận động nhiều, vẫn giữ được phần thịt gà dai, thơm, ngọt nên thường dùng để hầm nấu canh, súp hoặc cháo, giúp người dùng bảo quản lâu hơn.', NULL, 0, 1, '2023-11-28 05:59:36', '2023-12-23 08:23:54', NULL, 3, 1);
