(101, 'https://cdn.tgdd.vn/Products/Images/8790/314820/bhx/ga-ac-nguyen-con-135g-202309091638315302.jpg', 'Gà ác nguyên con 135g', 38000.00, 5, 36100.00, NULL, NULL, 9, 'con', '135g', 5.0, 'Gà ác nguyên con được làm sạch và đóng gói vệ sinh sạch sẽ, tiện lợi cho người dùng. Khi mua về, bạn chỉ cần làm sạch và mang đi chế biến như gà ác hầm, gà ác nướng,... Đây là thực phẩm chứa nhiều dinh dưỡng.', NULL, 0, 1, '2023-11-28 05:59:36', '2023-12-23 08:23:54', NULL, 3, 1),
(102, 'https://cdn.tgdd.vn/Products/Images/8790/310968/bhx/chim-cut-395g-3-4-con-202308051606186198.jpg', 'Chim cút 395g (3-4 con)', 46000.00, 5, 43700.00, NULL, NULL, 85, 'túi', '395g', 5.0, 'Chim cút túi 395g (3-4 con) tươi mới, đã được làm sạch hết nội tạng, đóng gói tiện lợi sạch sẽ. Chim cút có thể chế biến thành nhiều món ăn ngon, hấp dẫn và dinh dưỡng như chim cút nướng, chim cút hầm,...', NULL, 0, 1, '2023-11-28 05:59:36', '2023-12-23 08:23:54', NULL, 3, 1),
(103, 'https://cdn.tgdd.vn/Products/Images/8790/314819/bhx/bo-cau-nguyen-con-235g-202309091633201427.jpg', 'Bồ câu nguyên con 235g', 99000.00, 10, 89100.00, NULL, NULL, 96, 'con', '235g', 5.0, 'Bồ câu nguyên con được làm sạch sẵn, khi mua về chỉ cần rửa sạch và mang đi chế biến thành nhiều món ăn ngon. Bồ câu là một trong những thực phẩm vô cùng dinh dưỡng, tốt cho sức khỏe,...', NULL, 0, 1, '2023-11-28 05:59:36', '2023-12-23 08:23:54', NULL, 3, 1),
(104, 'https://cdn.tgdd.vn/Products/Images/8790/297340/bhx/-202306211455505675.jpg', 'Cánh gà giữa nhập khẩu 500g', 74500.00, 0, 74500.00, NULL, NULL, 23, 'túi', '500g', 5.0, 'Cánh giữa gà nhập khẩu tươi ngon, nhiều thịt, giàu dinh dưỡng thường dùng để chiên với nước mắm hoặc hấp hành. Cánh gà giữa nhập khẩu đông lạnh với phương pháp cấp đông hiện đại, giúp lưu giữ hương vị tự nhiên, mang đến những món ăn ngon cho gia đình.', NULL, 0, 1, '2023-11-28 05:59:36', '2023-12-23 08:23:54', NULL, 3, 1),
