(133, 'https://cdn.tgdd.vn/Products/Images/8782/315961/bhx/cha-tom-200g-202310201713438814.jpg', 'Chả tôm 200g', 74000.00, 10, 66600.00, NULL, NULL, 5, 'gói', '200g', 5.0, 'Chả tôm 200g được chế biến từ tôm tươi, giàu dinh dưỡng. Chả tôm có mùi thơm, ngọt tự nhiên từ thịt tôm và cung cấp nhiều chất dinh dưỡng như protein, vitamin, canxi… Thích hợp dùng để chiên, hấp, lẩu, bún, hoặc chế biến các món ăn tùy thích.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(134, 'https://cdn.tgdd.vn/Products/Images/8782/309843/bhx/cua-com-cua-2-da-09kg-11kg-4-6-con-202309121540572452.jpg', 'Cua cốm (cua 2 da) 1kg (4 - 6 con)', 700000.00, 5, 665000.00, NULL, NULL, 20, 'túi', '1kg', 5.0, 'Cua cốm hay còn gọi là cua lột hay cua 2 da chắc thịt, có gạch bên trong. Cua thơm ngon, béo, ngọt và chứa nhiều dưỡng chất thiết yếu cho cơ thể. Cua cốm tươi ngon, là sự lựa chọn tuyệt vời dành cho gia đình.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(135, 'https://cdn.tgdd.vn/Products/Images/8782/313772/bhx/hau-sashimi-09kg-11kg-8-12-con-202309121542155799.jpg', 'Hàu sashimi 0.9kg - 1.1kg (8 - 12 con)', 220000.00, 0, 220000.00, NULL, NULL, 84, 'túi', '0.9-1.1kg', 5.0, 'Hàu sashimi có vỏ cứng bên ngoài, thịt mềm, ngon, ngọt và chứa nhiều sữa béo ngậy, 0.9kg - 1.1kg có khoảng 8 - 12 con hàu. Hàu là hải sản chứa nhiều chất dinh dưỡng tốt cho cơ thể như chất đạm, chất béo, vitamin A, vitamin D,...', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(136, 'https://cdn.tgdd.vn/Products/Images/8782/313771/bhx/cua-hoang-de-con-17kg-22kg-202309121541240221.jpg', 'Cua hoàng đế con 2.2kg', 4400000.00, 0, 4400000.00, NULL, NULL, 56, 'con', '2.2kg', 5.0, 'Cua hoàng đế là loại hải sản cao cấp với phần thịt chắc, dai, thơm thoảng hương biển và đặc biệt giàu giá trị dinh dưỡng. Cua hoàng đế đảm bảo còn tươi sống, mỗi con trọng lượng từ 1.7 - 2.2kg, có thể chế biến bằng cách hấp, luộc, nướng,...', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(137, 'https://cdn.tgdd.vn/Products/Images/8782/319259/bhx/ca-basa-cat-khuc-dong-lanh-450-550g-nuoc-mam-maggi-hao-hang-18-do-dam-chai-490ml-202311210810001600.jpg', 'Cá basa cắt khúc đông lạnh 450-550g & Nước mắm Maggi chai 490ml', 110500.00, 27, 80665.00, NULL, NULL, 30, 'chai', '', 5.0, NULL, NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(138, 'https://cdn.tgdd.vn/Products/Images/8782/249433/bhx/tom-cang-khay-500g-5-10-con-202207221127390424.jpg', 'Tôm càng xanh 500g (8 - 15 con)', 150000.00, 0, 150000.00, NULL, NULL, 81, 'túi', '500g', 5.0, 'Tôm là nguồn dinh dưỡng dồi dào, cung cấp hàm lượng canxi và sắt rất cao cho chế độ ăn hằng ngày. Khi thưởng thức, bạn sẽ cảm nhận phần thịt ngọt nước và hơi dai. Ngoài ra, tôm càng với kích thước to nên thường được dùng để trang trí các món ăn trong bữa tiệc hoặc bữa cơm gia đình.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(139, 'https://cdn.tgdd.vn/Products/Images/8782/305739/bhx/tep-rong-500g-202304220917086719.jpg', 'Tép rong 500g', 93000.00, 5, 88350.00, NULL, NULL, 13, 'túi', '500g', 5.0, 'Tép rong có nguồn gốc ở đồng bằng sông Cửu Long. Tép có kích thước khá nhỏ hơn nhiều so với tôm nên có thể ăn tép rong nguyên con, không cần lột vỏ như các con tôm lớn. Vị của chúng của khá ngọt, thích hợp để chế biến thành nhiều món ăn đơn giản trong các bữa cơm gia đình.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(140, 'https://cdn.tgdd.vn/Products/Images/8782/285416/bhx/tom-su-nguyen-con-khay-500g-12-15-con-202208040850312165.jpg', 'Tôm sú nguyên con 500g (10 - 13 con)', 163000.00, 10, 146700.00, NULL, NULL, 19, 'khay', '500g', 5.0, 'Tôm sú là loại thực phẩm quen thuộc, có thể chế biến thành nhiều món ăn ngon như luộc, hấp, nướng, các món lẩu,.... Thịt tôm sú dai dai, có vị ngọt rất hấp dẫn. Tôm sú tại Bách hoá XANH rất tươi ngon và được nhiều bà nội trợ chọn mua.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(141, 'https://cdn.tgdd.vn/Products/Images/8782/281942/bhx/tom-the-nguyen-con-250g-6-9-con-202308031037597565.jpg', 'Tôm thẻ nguyên con 250g (8 - 12 con)', 50000.00, 0, 50000.00, NULL, NULL, 58, 'túi', '250g', 5.0, 'Tôm thẻ khay tại Bách hoá XANH tươi ngon vô cùng, tôm to, thịt ngọt và cầm rất chắc tay, dùng làm nguyên liệu chính cho nhiều món ăn. Tôm thẻ chứa nhiều năng lượng và protein tốt cho cơ thể, từ trẻ em cho đến người già ai cũng có thể ăn tôm thẻ.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(142, 'https://cdn.tgdd.vn/Products/Images/8782/304051/bhx/ca-bong-tuong-500g-3-6-con-202304220850526937.jpg', 'Cá bống tượng 500g-550g (3-6 con)', 99000.00, 5, 94050.00, NULL, NULL, 29, 'túi', '500-550g', 5.0, 'Cá bống tượng là loại cá có nhiều nhớt, màu lưng hơi xám, da bóng, rất thích hợp cho các món cá bống tượng kho tiêu, cá bống tượng kho thơm. Thịt cá bống tượng ngọt, ngon, được các bà nội trợ rất yêu thích.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(143, 'https://cdn.tgdd.vn/Products/Images/8782/305885/bhx/ca-chim-nuoc-ngot-nguyen-con-lam-sach-800g-1kg-202304131309539784.jpg', 'Cá chim nước ngọt làm sạch 450g - 550g', 37000.00, 0, 37000.00, NULL, NULL, 72, 'con', '450-550g', 5.0, 'Cá chim ở nước ngọt cho thịt ngon, thịt cá dai, có vị ngọt thanh tự nhiên và chứa nhiều dưỡng chất tốt cho sức khỏe. Cá chim được sơ chế, sạch sẽ, an toàn vệ sinh thực phẩm. Chế biến nhiều món ngon như chiên giòn, kho, nướng, hấp nước tương,...', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(144, 'https://cdn.tgdd.vn/Products/Images/8782/307907/bhx/ca-basa-cat-khuc-500gr-202305261653480656.jpg', 'Cá basa cắt khúc đông lạnh 450g - 550g', 36000.00, 19, 29160.00, NULL, NULL, 71, 'túi', '450-550g', 5.0, 'Cá basa tiêu chuẩn xuất khẩu EU, thịt cá ngọt, bổ dưỡng và ai cũng có thể ăn được. Các món ngon không thể bỏ qua với cá basa như cá basa chiên giòn, cá basa nhúng giấm, ăn cùng với lẩu,... Cá được sơ chế và đóng gói tiện lợi, tiết kiệm thời gian đi chợ.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(145, 'https://cdn.tgdd.vn/Products/Images/8782/305738/bhx/ca-me-dinh-lam-sach-500g-2-7-con-202305050823214616.jpg', 'Cá mè dinh làm sạch 450g - 550g (2-7 con)', 55000.00, 5, 52250.00, NULL, NULL, 37, 'túi', '450-550g', 5.0, 'Cá mè dinh là loại cá, đa dạng cách chế biến mà cũng rất dồi dào dinh dưỡng cho cơ thể chúng ta. Thịt cá mè dinh là nguồn cung cấp đạm dồi dào nhưng lại ít chất béo, phù hợp cho những ai muốn bổ sung đạm, dinh dưỡng hoặc giữ cân, tăng cơ.\r\n', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(146, 'https://cdn.tgdd.vn/Products/Images/8782/305747/bhx/ca-chach-que-500g-4-9-con-202304260835225588.jpg', 'Cá chạch quế 500g (4-9 con)', 49000.00, 5, 46550.00, NULL, NULL, 73, 'túi', '500g', 5.0, 'Cá chạch quế thân tròn, dẹt bên, nhất là gần đuôi, da trơn, mỏng. Cá có màu vàng, nâu hoặc xám đen, màu lưng xẫm hơn bụng. Trên thân có nhiều chấm, mỗi chấm do rất nhiều chấm nhỏ hợp thành. Cá chạch quế nấu món ngon như cá chạch kho tiêu, cá chạch quế chiên giòn,...\r\n', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(147, 'https://cdn.tgdd.vn/Products/Images/8782/300034/bhx/ca-dieu-hong-lam-sach-300g-450g-con-202303311331287166.jpg', 'Cá diêu hồng làm sạch (300g - 450g /con)', 45000.00, 5, 42750.00, NULL, NULL, 50, 'con', '300-450g', 5.0, 'Cá diêu hồng loại cá phổ biến có thịt nhiều, ít xương, thịt trắng, ngọt và lành tính, cá diêu hồng chế biến thành rất nhiều món ngon trong bữa cơm gia đình như cá diêu hồng kho, cá diêu hồng nấu canh chua, cá diêu hồng chiên giòn, cá diêu hồng sốt cà chua,...', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(148, 'https://cdn.tgdd.vn/Products/Images/8782/290278/bhx/ca-hu-nguyen-con-lam-sach-08kg-11kg-202303311335513576.jpg', 'Cá hú làm sạch 1.2kg', 135000.00, 5, 128250.00, NULL, NULL, 33, 'con', '1.2kg', 5.0, 'Với đặc điểm chắc thịt và ít xương, cá hú là một trong những loại cá da trơn được nhiều người yêu thích và lựa chọn. Cá hú tại Bách hoá XANH luôn tươi ngon mỗi ngày, thích hợp chế biến nhiều món ăn ngon cho gia đình, với các món chiên, kho, nấu canh đậm đà.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(149, 'https://cdn.tgdd.vn/Products/Images/8782/300033/bhx/ca-loc-lam-sach-300g-450g-con-202304130844318679.jpg', 'Cá lóc làm sạch (300g - 450g/con)', 47000.00, 0, 47000.00, NULL, NULL, 13, 'con', '300-450g', 5.0, 'Cá lóc hay còn được gọi là cá quả, là một nguyên liệu quen thuộc thường xuất hiện trên bàn ăn của mỗi gia đình. Cá lóc có thịt ngọt, rất ngon, thích hợp làm nhiều món ăn hấp dẫn như bánh canh cá lóc, canh chua cá lóc, cá lóc kho tộ,... đảm bảo sẽ khiến cả nhà mê tít', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(150, 'https://cdn.tgdd.vn/Products/Images/8782/223037/bhx/ca-keo-500g-20-23-con-202304220901421340.jpg', 'Cá kèo 450g - 550g', 155000.00, 5, 147250.00, NULL, NULL, 64, 'túi', '450-550g', 5.0, 'Từng con cá kèo tươi rói, nhìn ngon mắt vô cùng. Cá kèo đã được làm sạch, chỉ cần mua về rửa sạch lại rồi đem đi chế biến các món ăn ngon như lẩu cá kèo, cá kèo kho tiêu. Cá kèo Bách hoá XANH ít béo, giàu protein, đảm bảo là nguyên liệu tuyệt vời cho bữa cơm của bạn', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(151, 'https://cdn.tgdd.vn/Products/Images/8782/305746/bhx/ca-long-tong-500g-202304220904169029.jpg', 'Cá lòng tong 500g', 94000.00, 5, 89300.00, NULL, NULL, 83, 'túi', '500g', 5.0, 'Cá lòng tong là loại cá khá nhỏ, là món ăn quen thuộc trong các gia đình tại miền Tây. Dù được chế biến thành món ăn gì, cá lòng tong vẫn là món ăn hấp dẫn nhờ thịt cá mềm, ăn không thấy ngán. Một số món ăn từ cá lòng tong như kho tiêu, chiên giòn,...', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(152, 'https://cdn.tgdd.vn/Products/Images/8782/304052/bhx/ca-ro-dong-500g-2-4-con-202304220910235887.jpg', 'Cá rô đồng 450g - 550g (2-4 con)', 38000.00, 5, 36100.00, NULL, NULL, 19, 'túi', '450-550g', 5.0, 'Đảm bảo tươi ngon, thịt ngọt và dai. Cá rô đồng thường dùng để chế biến những món ăn thơm ngon trong các bữa ăn gia đình như cá kho, canh chua,... Cá rô đồng Bách hoá XANH tươi ngon, được các bà nội trợ chọn mua mỗi ngày', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(153, 'https://cdn.tgdd.vn/Products/Images/8782/311245/bhx/ca-basa-phi-le-250g-202307251437206845.jpg', 'Cá basa phi lê 250g', 27000.00, 0, 27000.00, NULL, NULL, 47, 'túi', '250g', 5.0, 'Cá basa phi lê được rút hết xương, thịt cá ngọt, bổ dưỡng và ai cũng có thể ăn được. Các món ngon không thể bỏ qua với cá basa phi lê như cá basa chiên giòn, cá basa nhúng giấm, ăn cùng với lẩu,... Cá được sơ chế và đóng gói tiện lợi, tiết kiệm thời gian đi chợ.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(154, 'https://cdn.tgdd.vn/Products/Images/8782/304073/bhx/ca-sac-ran-500g-3-5-con-202304220912230927.jpg', 'Cá sặc rằn 500g - 550g (3 - 5 con)', 55000.00, 5, 52250.00, NULL, NULL, 76, 'túi', '500-550g', 5.0, 'Cá sặc rằn là loại cá nước ngọt, thịt ngọt, thân mình dẹt, ít xương. Cá sặc rằn thích hợp cho các món như chiên nước mắm, chiên giòn hoặc các sặc rằn kho. Cá sặc rằn tươi ngon, chất lượng, được nhiều người chọn mua.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(155, 'https://cdn.tgdd.vn/Products/Images/8782/279491/bhx/ca-lang-nguyen-con-lam-sach-1kg-12kg-202309121540105565.jpg', 'Cá lăng làm sạch 1.2kg', 159000.00, 9, 144690.00, NULL, NULL, 37, 'con', '1.2kg', 5.0, 'Cá lăng là một trong những loại thực phẩm tốt cho sức khoẻ, có thể chế biến thành nhiều món ngon dân dã. Cá lăng tại Bách hoá XANH luôn được chế biến hằng ngày từ những con cá tươi ngon với giá thành phải chăng, thích hợp với các món ăn ngon và điều kiện gia đình.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(156, 'https://cdn.tgdd.vn/Products/Images/8782/314793/bhx/ca-linh-non-lam-sach-500g-60-70-con-202309200933333737.jpg', 'Cá linh non làm sạch 500g (60 - 70 con)', 90000.00, 0, 90000.00, NULL, NULL, 55, 'túi', '500g', 5.0, 'Cá linh non là loại cá linh đầu mùa, thịt cá tươi, ngọt ngon, lành tính và xương mềm. Cá linh là loại cá nước ngọt được đánh bắt tại An Giang, 500g cá từ 60 - 70 con. Cá được làm sạch sẵn, giúp chế biến món ăn nhanh chóng, tiện lợi.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(157, 'https://cdn.tgdd.vn/Products/Images/8782/305737/bhx/ca-he-lam-sach-500g-3-7-con-202304260837238852.jpg', 'Cá he làm sạch 450g - 550g (3 - 7 con)', 59000.00, 5, 56050.00, NULL, NULL, 63, 'túi', '450-550g', 5.0, 'Cá he là loại cá có màu đỏ hoặc màu vàng nghệ, vẩy trắng có ánh kim, thịt cá mềm mịn. Cá he không chỉ là một món ăn ngon mà còn là một loại thực phẩm đầy dưỡng chất. Thịt cá he chứa rất nhiều chất dinh dưỡng thiết yếu cho cơ thể chúng ta như protein, chất béo, chất sắt,...', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(158, 'https://cdn.tgdd.vn/Products/Images/8782/305741/bhx/ca-bong-duc-lam-sach-500g-202304220853333138.jpg', 'Cá bống đục làm sạch 500g', 59000.00, 5, 56050.00, NULL, NULL, 50, 'túi', '500g', 5.0, 'Cá bống đục là loại cá có lớp vảy ánh lên màu bạc, sáng lấp lánh thì cá mới tươi ngon. Cá làm sạch, để ráo rồi chiên với dầu phộng. Khi cá chín, lớp vảy chuyển sang màu vàng rộm, dậy lên hương thơm ngào ngạt. Cá đục chiên có vị giòn, thơm, béo ăn kèm với nước mắm chanh, tỏi, ớt rất “hao” cơm.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(159, 'https://cdn.tgdd.vn/Products/Images/8782/273883/bhx/ca-mo-lam-sach-500g-5-7-con-202205260937520006.jpg', 'Cá mó 500g-550g', 69000.00, 5, 65550.00, NULL, NULL, 60, 'túi', '500-550g', 5.0, 'Cá mó có thân màu trắng hồng, có vảy bạc, mình dẹp, có nhiều thịt, ít xương, thơm ngon hơn cá lưỡi trâu nên được các bà nội trợ ưa thích. Cá mó thường được cá bà nội trợ tẩm ướp và chiên. Một số món cá mó chiên như cá mó chiên giòn, cá mó chiên sả ớt,....', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(160, 'https://cdn.tgdd.vn/Products/Images/8782/285420/bhx/ca-ngu-bo-nguyen-con-lam-sach-08kg-12kg-202303311341458270.jpg', 'Cá ngừ bò làm sạch 1.1kg', 138000.00, 5, 131100.00, NULL, NULL, 51, 'con', '1.1kg', 5.0, 'Cá ngừ bò là loại cá biển có thịt chắc, dai, ngon, chất lượng. Cá ngừ bò được làm sẵn, tiện lợi, giúp khách hàng tiết kiệm thời gian. Cá ngừ bò có thể chế biến thành nhiều món ăn ngon, dinh dưỡng và hấp dẫn\r\n', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(161, 'https://cdn.tgdd.vn/Products/Images/8782/248996/bhx/ca-trac-500g-5-6-con-202304211102469195.jpg', 'Cá trác 450g - 550g', 49000.00, 5, 46550.00, NULL, NULL, 72, 'túi', '450-550g', 5.0, 'Cá trác có tính lành, thơm ngon nên thích hợp cho gia đình nào đang có mẹ bầu hay người thân cần bổ sung omega 3 & các chất dinh dưỡng cần thiết. Cá trác tươi ngon, giữ được độ săn chắc của cá biển, giúp bảo quản lâu hơn, mang đến vị đậm đà cho món ăn', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(162, 'https://cdn.tgdd.vn/Products/Images/8782/274570/bhx/ca-tai-tuong-nguyen-con-1kg-13kg-1-2-con-202303311345262387.jpg', 'Cá tai tượng 1kg - 1.2kg (1-2 con)', 124000.00, 0, 124000.00, NULL, NULL, 5, 'con', '1-1.2kg', 5.0, 'Cá tai tượng là dòng cá nước ngọt, nhiều người còn gọi nó là cá phát tài. Cá tai tượng được chế biến thành rất nhiều món ăn ngon và tốt cho sức khoẻ. Cá tai tượng có thể đem hấp hành ngon ngọt hay đem chiên xù giòn rụm ngon vô cùng.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(163, 'https://cdn.tgdd.vn/Products/Images/8782/303285/bhx/ca-luoi-trau-500g-550g-5-7-con-202304270842130988.jpg', 'Cá lưỡi trâu 500g-550g (5-7 con)', 69000.00, 6, 64860.00, NULL, NULL, 8, 'túi', '500-550g', 5.0, 'Cá lưới trâu đảm bảo tươi ngon, đóng gói kín đáo sạch sẽ là loài cá nhỏ và thân dẹt có hình oval, chứ nhiều dinh dưỡng. Có thể chế biến được thành nhiều món ăn ngon cho gia đình như cá chiên xả, cá kho tiêu đường, Cá chiên tươi,…', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(164, 'https://cdn.tgdd.vn/Products/Images/8782/303289/bhx/ca-nau-500g-550g-3-6-con-202304260845472475.jpg', 'Cá nâu 500g-550g (3 - 6 con)', 105000.00, 5, 99750.00, NULL, NULL, 26, 'túi', '500-550g', 5.0, 'Cá nâu túi 500g là loại cá thịt săn chắc, thơm ngon, nhiều thịt, ít xương. Cá nâu hay còn gọi là dĩa thái hay cá hói sống được trong cả môi trường nước mặn và lợ. Cá nâu nhiều dinh dưỡng, phù hợp nấu các món kho, nấu canh chua, chiên sả, nướng…', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(165, 'https://cdn.tgdd.vn/Products/Images/8782/285415/bhx/muc-nut-nguyen-con-khay-500g-12-15-con-202208040848158018.jpg', 'Mực nút nguyên con 500g', 115000.00, 5, 109250.00, NULL, NULL, 2, 'túi', '500g', 5.0, 'Mực nút tươi ngon, dai ngọt chất lượng. Các món ăn ngon với đầu mực là xào sa tế, đầu mực xào chua ngọt, có thể ăn kèm lẩu,... Mực nút còn là thực phẩm chứa nhiều dưỡng chất cần thiết cho sức khỏe.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(166, 'https://cdn.tgdd.vn/Products/Images/8782/285413/bhx/muc-nang-nguyen-con-khay-1kg-2-3-con-202208160807066513.jpg', 'Mực nang nguyên con 1kg', 275000.00, 0, 275000.00, NULL, NULL, 34, 'túi', '1kg', 5.0, 'Mực nang có thân to, thớ thịt dày, có vị ngọt và giòn hơn các loại mực khác. Vì thế mực nang là nguyên liệu chế biến nhiều món ăn ngon, một số món đặc biệt trong gia đình là mực xào chua ngọt, mực xào sa tế, mực chiên giòn,.... Mua về chế biến cho cả nhà ăn thử ngay nhé.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(167, 'https://cdn.tgdd.vn/Products/Images/8782/273937/bhx/muc-ong-nguyen-con-khay-500g-15-20cm-con-202207221123344313.jpg', 'Mực ống 500g', 120000.00, 0, 120000.00, NULL, NULL, 62, 'khay', '500g', 5.0, 'Mực ống tại Bách hoá XANH tươi ngon vô cùng, mực ống to, cầm chắc tay, có thể mua về làm nguyên liệu chính cho nhiều món ăn trong mâm cơm gia đình như mực xào cần, mực xào sa tế, lẩu mực và hải sản,... thơm ngon vô cùng, thịt mực tươi nên mang lại vị ngọt thanh cho món ăn của bạn.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(168, 'https://cdn.tgdd.vn/Products/Images/8782/286030/bhx/muc-la-nguyen-con-khay-1kg-2-3-con-202208081937106760.jpg', 'Mực lá nguyên con 1kg', 429000.00, 8, 394680.00, NULL, NULL, 7, 'túi', '1kg', 5.0, 'Mực lá là loại hải sản có vị ngọt, giòn, dễ ăn và dinh dưỡng vô cùng. Mực lá thường được chế biến thành rất nhiều món ăn khác nhau như cháo mực, mực nướng, mực xào sa tế,... Mực lá Bách hoá XANH tươi ngon, hàng nhập mới mỗi ngày', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(169, 'https://cdn.tgdd.vn/Products/Images/8782/304602/bhx/-202309251041572994.jpg', 'Râu mực nhập khẩu đông lạnh 450-550g', 78000.00, 0, 78000.00, NULL, NULL, 47, 'túi', '450-550g', 5.0, 'Râu mực tươi ngon, có vị dai giòn, sật sật ăn đã miệng vô cùng. Râu mực là hải sản tạo nên nhiều món ăn thơm ngon vô cùng, được các bà nội trợ ưa chuộng và tin dùng, dùng làm nguyên liệu cho bữa ăn của cả nhà', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(170, 'https://cdn.tgdd.vn/Products/Images/8782/273934/bhx/bach-tuoc-khay-500g-7-10-con-202207221114005590.jpg', 'Bạch tuộc 450g - 550g (10-13 con)', 88000.00, 10, 79200.00, NULL, NULL, 14, 'khay', '450-550g', 5.0, 'Là loại hải sản vô cùng giàu dinh dưỡng. Bạch tuộc Bách hoá XANH giàu vitamin thiết yếu, được các bà nội trợ ưa thích chọn làm nguyên liệu cho các món ăn của gia đình. Bạch tuộc có thể chế biến thành nhiều món ăn khác nhau như bạch tuộc hấp, bạch tuộc xào thập cẩm với vị giòn dai tuyệt vời', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(171, 'https://cdn.tgdd.vn/Products/Images/8782/312721/bhx/bao-ngu-han-quoc-400g-500g-tui-5-con-202309121540368679.jpg', 'Bào ngư Hàn Quốc 400g-500g (5 con)', 375000.00, 0, 375000.00, NULL, NULL, 29, 'túi', '400-500g', 5.0, 'Bào ngư là loại hải sản có phần thịt dai giòn, ngọt béo, giàu giá trị dinh dưỡng, được dùng để chế biến các món ăn ngon như súp, cháo,... Bào ngư Hàn Quốc túi 5 con tại Bách hóa XANH là loại bào ngư tươi sống, vỏ xanh, viền chấm đen, bên trong có màu vàng nhạt.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(172, 'https://cdn.tgdd.vn/Products/Images/8782/313735/bhx/ghe-song-10-con-202308291005276047.jpg', 'Ghẹ tươi 10 con (100 - 130g/con)', 590000.00, 0, 590000.00, NULL, NULL, 101, 'túi', '', 5.0, 'Ghẹ là loài hải sản được nhiều người yêu thích. Ghẹ có thân mỏng và mềm hơn cua, tươi ngon, thịt dai, ngọt và giòn, mỗi con từ 100g - 130g. Ngoài hấp, nướng thì ghẹ thường được các bà nội trợ chọn làm nguyên liệu nấu ăn giúp làm ngọt nước dùng.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(173, 'https://cdn.tgdd.vn/Products/Images/8782/258463/bhx/ngheu-song-khay-1kg-25-30-con-202211160836300349.jpg', 'Nghêu sống 1kg (40 - 50 con)', 65000.00, 5, 61750.00, NULL, NULL, 16, 'túi', '1kg', 5.0, 'Nghêu là một trong những loại hải sản tươi ngon, giàu dinh dưỡng và khi chế biến sẽ cho ra vị ngọt tự nhiên rất đặc trưng. Nghêu sống tại Bách hoá XANH được thu hoạch từ nhiều nguồn cung đảm bảo, an toàn và tươi ngon, mang đến bữa ăn gia đình của các bà nội trợ thêm phần trọn vẹn.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(174, 'https://cdn.tgdd.vn/Products/Images/8782/305370/bhx/so-huyet-500g-60-70-con-202304270856099031.jpg', 'Sò huyết 500g (60-70 con)', 112000.00, 4, 107520.00, NULL, NULL, 75, 'túi', '500g', 5.0, 'Sò huyết là loại hải sản giàu dưỡng chất, thịt sò huyết có vị ngọt, mặn, rất hấp dẫn khi ăn. Sò huyết còn là thực phẩm được sử dụng nhiều trong việc bổ máu, chữa bệnh tăng huyết áp,...', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(175, 'https://cdn.tgdd.vn/Products/Images/8782/311246/bhx/thit-oc-buou-lam-sach-250g-202307251442121913.jpg', 'Thịt ốc bươu làm sạch 250g', 17000.00, 5, 16150.00, NULL, NULL, 28, 'túi', '250g', 5.0, 'Thịt ốc bươu làm sạch là một món ngon quen thuộc với người dân Việt Nam. Thịt ốc bươu mát, ngon, khi hấp lên có vị giòn giòn ăn không ngán. Thịt ốc bươu khay được làm sạch sẽ vô cùng, chỉ cần mua về rửa sạch là có thể chế biến tuỳ thích', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(176, 'https://cdn.tgdd.vn/Products/Images/8782/313732/bhx/oc-bulot-09kg-11kg-20-30-con-202309121542386162.jpg', 'Ốc bulot 0.9kg - 1.1kg (20 - 30 con)', 220000.00, 0, 220000.00, NULL, NULL, 12, 'túi', '0.9-1.1kg', 5.0, 'Ốc Bulot là loại hải sản giàu dinh dưỡng, chứa nhiều khoáng chất tốt cho xương, da, mắt và hệ thần kinh. Ốc Bulot đảm bảo tươi sống, chắc thịt, 0.9 - 1.1kg ốc có khoảng 20 - 30 con. Có thể chế biến thành nhiều món ăn ngon như: Ốc Bulot xào bơ tỏi, ốc Bulot hấp sả gừng,...', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(177, 'https://cdn.tgdd.vn/Products/Images/8782/309920/bhx/nhong-tam-500g-202307060839106619.jpg', 'Nhộng tằm 500g', 55000.00, 9, 50050.00, NULL, NULL, 78, 'túi', '500g', 5.0, 'Nhộng tằm có xuất xứ Thái Bình, là loại thức ăn dân dã, ngày càng phổ biến trong đời sống của người dân. Nhộng tằm béo, thơm ngon và chứa nhiều dưỡng chất dinh dưỡng. Nhộng tằm chưa được làm sạch. Nhộng tằm có thể chế biến nhiều món ăn ngon như nhộng tằm xào bơ tỏi, nhộng tằm xào chua ngọt,...', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(178, 'https://cdn.tgdd.vn/Products/Images/8782/311242/bhx/thit-hen-lam-sach-250g-202307251423522842.jpg', 'Thịt hến làm sạch 250g', 25000.00, 0, 25000.00, NULL, NULL, 52, 'túi', '250g', 5.0, 'Hến là thực phẩm dồi dào các chất dinh dưỡng như mangan, phốt pho, canxi,... cực kỳ tốt cho cơ thể. Thịt hến dễ dàng chế biến thành các món ngon gây nghiện như hến xúc bánh đa, canh hến,... thích hợp từ trẻ nhỏ cho tới người lớn tuổi. Thịt hến Bách hoá XANH được làm sạch, tươi ngon mỗi ngày.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(179, 'https://cdn.tgdd.vn/Products/Images/8782/311243/bhx/bao-tu-ca-basa-200g-clone-202307251429176677.jpg', 'Bao tử cá basa 250g', 28000.00, 5, 26600.00, NULL, NULL, 24, 'túi', '250g', 5.0, 'Bao tử cá basa chất lượng, tiện lợi, sạch sẽ. Bao tử cá có thể chế biến thành nhiều món ăn ngon, hấp dẫn như bao tử cá basa xào tỏi ớt, bao tử cá basa xào chua ngọt,... rất hấp dẫn và đơn giản', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(180, 'https://cdn.tgdd.vn/Products/Images/8782/303078/bhx/luon-lam-sach-nguyen-con-tu-200g-202303311320492412.jpg', 'Lươn làm sạch cắt khúc 200g trở lên', 54000.00, 5, 51300.00, NULL, NULL, 62, 'con', '200g trở lên', 5.0, 'Lươn có phần thịt ngọt và săn chắc, được làm sạch sẵn, vệ sinh. Những món ăn có thể được chế biến từ lươn không chỉ mang đến hương vị thơm ngon mà còn rất giàu dinh dưỡng như cháo, kho, nướng,...', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(181, 'https://cdn.tgdd.vn/Products/Images/8782/297366/bhx/ca-hoi-dong-lanh-cat-khuc-tui-300g-202212121337574018.jpg', 'Cá hồi đông lạnh cắt khúc 300g', 99000.00, 10, 89100.00, NULL, NULL, 40, 'túi', '300g', 5.0, 'Cá hồi cắt khúc đông lạnh vẫn giữ được độ tươi ngon, màu sắc bắt mắt, được sơ chế sạch sẽ an toàn, đặt mua giao hàng trong ngày tại Bách hoá XANH. Cá hồi xuất xứ Chi Lê, Na Uy chứa nhiều chất dinh dưỡng, được nhiều chọn mua cung cấp cho bữa ăn gia đình', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(182, 'https://cdn.tgdd.vn/Products/Images/8782/303110/bhx/ca-hoi-nguyen-con-dong-lanh-47kg-202311151526226203.jpg', 'Cá hồi nguyên con đông lạnh 4.7kg', 1641000.00, 0, 1641000.00, NULL, NULL, 11, 'con', '4.7kg', 5.0, 'Cá hồi nguyên con (không có đầu) được sơ chế sạch sẽ an toàn, thịt cá hồi dai ngon, béo, màu sắc bắt mắt. Cá hồi đông lạnh xuất xứ Chi Lê và Na Uy, chứa nhiều chất dinh dưỡng, được nhiều chọn mua cung cấp cho bữa ăn gia đình.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(183, 'https://cdn.tgdd.vn/Products/Images/8782/317020/bhx/dau-ca-hoi-dong-lanh-nhap-khau-450g-550g-1-2-dau-202310201715394869.jpg', 'Đầu cá hồi đông lạnh nhập khẩu 450g - 550g (1 - 2 đầu)', 36000.00, 31, 24840.00, NULL, NULL, 35, 'túi', '450-550g', 5.0, 'Đầu cá hồi có xương mềm, béo có thể nấu canh chua, nấu lẩu,... đầu cá mua về có thể dùng muối và chanh để khử mùi tanh. Đầu cá hồi tươi đông lạnh có thể kéo dài thời gian bảo quản, thích hợp cho nhu cầu gia đình trong việc chế biến và mang đến những món ăn bổ dưỡng.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(184, 'https://cdn.tgdd.vn/Products/Images/8782/318603/bhx/dau-ca-hoi-dong-lanh-nhap-khau-450-550g-1-2-dau-202311111024187963.jpg', '3 túi Đầu cá hồi đông lạnh nhập khẩu 450g - 550g (1 - 2 đầu)', 108000.00, 45, 59400.00, NULL, NULL, 40, 'túi', '', 5.0, 'Đầu cá hồi có xương mềm, béo có thể nấu canh chua, nấu lẩu,... đầu cá mua về có thể dùng muối và chanh để khử mùi tanh. Đầu cá hồi tươi đông lạnh có thể kéo dài thời gian bảo quản, thích hợp cho nhu cầu gia đình trong việc chế biến và mang đến những món ăn bổ dưỡng.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(185, 'https://cdn.tgdd.vn/Products/Images/8782/317172/bhx/-202310181649125075.jpg', '2 túi đầu cá hồi đông lạnh nhập khẩu 500g', 72000.00, 39, 43920.00, NULL, NULL, 96, 'túi', '1kg', 5.0, 'Đầu cá hồi có thịt mềm và giàu dưỡng chất, rất thích hợp để nấu canh chua, lẩu hoặc các món hấp dẫn khác. Trước khi sử dụng, bạn nên rửa đầu cá bằng muối và chanh để loại bỏ mùi tanh. 2 túi đầu cá hồi đông lạnh nhập khẩu 500g mang đến sự tiện lợi, phù hợp cho mỗi lần nấu', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(186, 'https://cdn.tgdd.vn/Products/Images/8782/298813/bhx/ca-cam-nguyen-con-dong-lanh-700g-900g-202304011238299494.jpg', 'Cá cam đông lạnh 700g', 69000.00, 0, 69000.00, NULL, NULL, 60, 'túi', '700g', 5.0, 'Là loại cá biển bổ dưỡng, được nhiều người yêu thích, chứa nhiều chất dinh dưỡng tốt cho sức khoẻ như omega-3, protein, vitamin E, A... Cá cam tươi đông lạnh giúp bảo quản lâu hơn mà thịt cá vẫn chắc, không bở mà vẫn giữ nguyên vị đậm đà.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(187, 'https://cdn.tgdd.vn/Products/Images/8782/313391/bhx/ca-cam-nguyen-con-dong-lanh-1kg-12kg-202308240858249784.jpg', 'Cá cam nguyên con đông lạnh 1-1.2kg (1-2con)', 109000.00, 0, 109000.00, NULL, NULL, 9, 'túi', '1.1kg', 5.0, 'Là loại cá biển bổ dưỡng, được nhiều người yêu thích, chứa nhiều chất dinh dưỡng tốt cho sức khoẻ như omega-3, protein, vitamin E, A... Cá cam tươi đông lạnh giúp bảo quản lâu hơn mà thịt cá vẫn chắc, không bở mà vẫn giữ nguyên vị đậm đà.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(188, 'https://cdn.tgdd.vn/Products/Images/8782/287695/bhx/ca-huong-nguyen-con-lam-sach-500g-550g-3-5-con-202305050821216598.jpg', 'Cá hường làm sạch 500g-550g (3-5 con)', 51000.00, 5, 48450.00, NULL, NULL, 66, 'túi', '500-550g', 5.0, 'Cá hường hay còn gọi là cá mùi, cá có thịt chắc ngọt, ít xương, cũng là loại cá phổ biến được nhiều bà nội trợ chọn mua. Cá hường giữ được độ tươi ngon từ cá tươi, giúp bảo quản lâu hơn mà thịt cá vẫn chắc, không bở mà vẫn giữ nguyên vị đậm đà.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(189, 'https://cdn.tgdd.vn/Products/Images/8782/304898/bhx/ca-song-dong-lanh-1kg-3-6-con-202303311353291007.jpg', 'Cá sòng đông lạnh 0.9kg - 1.1kg (3-6 con)', 59000.00, 17, 48970.00, NULL, NULL, 99, 'túi', '0.9-1.1kg', 5.0, 'Cá sòng cá loài cá biển phổ biến ở vùng duyên hải Nam Trung Bộ. Thịt cá thơm ngon, thịt ngọt béo và ít tanh, là loài cá chứa nhiều dinh dưỡng như đạm, béo, chất xơ, vitamin, khoáng chất,... Cá sòng đông lạnh túi 1kg tại Bách hóa XANH được làm sạch, đóng gói tiện lợi, dễ bảo quản', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(190, 'https://cdn.tgdd.vn/Products/Images/8782/309729/bhx/ca-song-dong-lanh-500g-1-con-202306241525462921.jpg', 'Cá sòng đông lạnh 500g', 32000.00, 0, 32000.00, NULL, NULL, 97, 'túi', '500g', 5.0, 'Cá sòng cá loài cá biển phổ biến ở vùng duyên hải Nam Trung Bộ. Thịt cá thơm ngon, thịt ngọt béo và ít tanh, là loài cá chứa nhiều dinh dưỡng như đạm, béo, chất xơ, vitamin, khoáng chất,... Cá sòng đông lạnh túi 500g tại Bách hóa XANH được làm sạch, đóng gói tiện lợi, dễ bảo quản', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(191, 'https://cdn.tgdd.vn/Products/Images/8782/248995/bhx/ca-song-500g-1-2-con-202303311349533979.jpg', 'Cá sòng 500g-550g (1 - 2 con)', 36000.00, 5, 34200.00, NULL, NULL, 87, 'túi', '500-550g', 5.0, 'Là loại cá thơm ngon từ thịt tới ruột cá, phần béo ngon nhất là ruột và lườn cá. Cá sòng giữ được độ tươi ngon từ cá biển tươi, giúp bảo quản lâu hơn mà thịt cá vẫn chắc, không bở mà vẫn giữ nguyên vị đậm đà cho việc chế biến món ăn', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(192, 'https://cdn.tgdd.vn/Products/Images/8782/305744/bhx/ca-chem-lam-sach-1kg-1kg1-con-202304101117434294.jpg', 'Cá chẽm làm sạch 1.2kg/con', 141000.00, 5, 133950.00, NULL, NULL, 43, 'con', '1.2kg', 5.0, 'Cá chẽm là loại cá có thịt ngọt, chắc và chứa nhiều dưỡng chất cần thiết. Trong thịt cá có chứa rất nhiều vitamin A, đây được xem là chất chống oxy hóa tác động lên mắt và các vấn đề thị lực như duy trì thị lực và bảo vệ mắt, giúp mắt sáng khỏe.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(193, 'https://cdn.tgdd.vn/Products/Images/8782/248994/bhx/ca-nuc-lam-sach-500g-550g-5-7-con-202305050826104449.jpg', 'Cá nục làm sạch 500g-550g', 49000.00, 5, 46550.00, NULL, NULL, 51, 'túi', '500-550g', 5.0, 'Là loại cá mang đến nhiều dưỡng chất có lợi và công dụng tuyệt vời cho sức khoẻ. Cá nục vẫn giữ được độ tươi ngon từ cá biển tươi, giúp bảo quản lâu hơn mà thịt cá vẫn chắc, không bở mà vẫn giữ nguyên vị đậm đà cho việc chế biến món ăn', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(194, 'https://cdn.tgdd.vn/Products/Images/8782/282851/bhx/ca-nuc-bong-hap-vi-300g-202206090823428022.jpg', 'Cá nục bông hấp 300g (1 - 3 con)', 42000.00, 0, 42000.00, NULL, NULL, 27, 'vỉ', '300g', 5.0, 'Cá nục bông hấp là món ăn được chế biến hoàn toàn từ những con cá nục tươi ngon, qua quá trình hấp chín, đảm bảo chất lượng sản phẩm. Cá nục bông hấp tại Bách hoá XANH hoàn toàn an toàn cho sức khoẻ, giúp các bà nội trợ có thể chế biến nhanh chóng thành các món ăn khác.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(195, 'https://cdn.tgdd.vn/Products/Images/8782/301614/bhx/ca-nuc-dong-lanh-500g-4-7-con-202306271326280764.jpg', 'Cá nục đông lạnh 450g - 550g (4-7 con)', 39000.00, 10, 35100.00, NULL, NULL, 82, 'túi', '450-550g', 5.0, 'Là loại cá mang đến nhiều dưỡng chất có lợi và công dụng tuyệt vời cho sức khoẻ. Cá nục đông lạnh vẫn giữ được độ tươi ngon từ cá biển tươi, giúp bảo quản lâu hơn mà thịt cá vẫn chắc, không bở mà vẫn giữ nguyên vị đậm đà cho việc chế biến món ăn', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(196, 'https://cdn.tgdd.vn/Products/Images/8782/274403/bhx/ca-thu-cat-khuc-270-330g-giao-khuc-giua-202309121539253905.jpg', 'Cá thu cắt khúc 270g - 330g (giao khúc giữa)', 135000.00, 5, 128250.00, NULL, NULL, 26, 'vỉ', '270-330g', 5.0, 'Là một loại cá biển thơm ngon với thịt thơm và đầy bổ dưỡng. Cá thu giàu chất béo, chất đạm, giàu vitamin và khoáng chất cần thiết cho cơ thể. Cá thu được dùng nấu nhiều món ăn ngon như cá thu kho thơm, cá thu kho tiêu, cá thu kho nước dừa hấp dẫn. Cá thu Bách hoá XANH tươi ngon, nhập mới mỗi ngày.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(197, 'https://cdn.tgdd.vn/Products/Images/8782/302538/bhx/ca-ngan-lam-sach-500g-4-6-con-202304220907072055.jpg', 'Cá ngân làm sạch 500g-550g (4-6 con)', 69000.00, 5, 65550.00, NULL, NULL, 82, 'túi', '500-550g', 5.0, 'Cá ngân có thịt mềm, ăn ngọt và dễ chế biến thành nhiều món ăn ngon khác nhau đặc biệt là phù hợp với bữa cơm gia đình như chiên, ấu canh, kho tiêu, sốt cà,.. Cá ngân được làm sẵn, an toàn vệ sinh thực phẩm, đóng gói sạch sẽ', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1);
INSERT INTO `product` (`id`, `thumbnail`, `name`, `reg_price`, `discount_percent`, `discount_price`, `event_percent`, `event_price`, `quantity`, `unit`, `canonical`, `rating`, `description`, `article`, `is_featured`, `is_visible`, `created_at`, `updated_at`, `deleted_at`, `category_id`, `brand_id`) VALUES
(198, 'https://cdn.tgdd.vn/Products/Images/8782/291428/bhx/ca-chim-trang-bien-nguyen-con-lam-sach-400g-600g-202303311328141823.jpg', 'Cá chim trắng biển làm sạch 600g', 169000.00, 5, 160550.00, NULL, NULL, 32, 'con', '600g', 5.0, 'Thịt cá chim trắng biển dai ngon, hàng tươi ngon, được làm sẵn là nguyên liệu thích hợp cho bữa ăn trong gia đình với các món ăn như: cá chim chiên, cá chim nướng,... Cá chim trắng Bách hoá XANH tươi ngon, hàng mới về mỗi ngày', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(199, 'https://cdn.tgdd.vn/Products/Images/8782/286029/bhx/ca-bop-cat-khuc-450-550g-4-5-mieng-202309121533498848.jpg', 'Cá bớp làm sạch 450g - 550g', 263000.00, 4, 252480.00, NULL, NULL, 11, 'túi', '450-550g', 5.0, 'Là món cá không thể thiếu trong bữa ăn, dễ dàng chế biến các món ăn bổ dưỡng cho các thành viên gia đình như canh chua cá bớp, cá bớp nấu măng,... Cá bớp đông lạnh vẫn giữ được độ săn chắc của cá biển, giúp bảo quản lâu hơn, mang đến vị đậm đà cho món ăn.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(200, 'https://cdn.tgdd.vn/Products/Images/8782/248988/bhx/ca-bac-ma-500g-550g-3-5-con-202304260832055385.jpg', 'Cá bạc má 500g-550g', 51000.00, 5, 48450.00, NULL, NULL, 61, 'túi', '500-550g', 5.0, 'Cá bạc má có thịt trắng và chắc ngọt, dễ chế biến thành nhiều món ăn ngon, đây là một trong những loại cá biển quen thuộc với bà nội trợ. Cá bạc má vẫn giữ được độ tươi ngon từ cá tươi, giúp bảo quản lâu hơn mà thịt cá vẫn chắc, không bở mà vẫn giữ nguyên vị đậm đà.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(201, 'https://cdn.tgdd.vn/Products/Images/8782/313773/bhx/ca-bop-2kg-25kg-202309191457368002.jpg', 'Cá bớp 2.3kg', 485000.00, 0, 485000.00, NULL, NULL, 69, 'túi', '2.3kg', 5.0, 'Cá bớp hay cá bóp là loại cá biển có kích thước lớn, thịt béo ngọt và thường được dùng để chế biến thành nhiều món ăn ngon như: món chiên, món lẩu, món canh,.... Mỗi túi 2.3kg sẽ có khoảng 2 - 3 con cá bớp nguyên con.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(202, 'https://cdn.tgdd.vn/Products/Images/8782/279685/bhx/ca-ngu-o-nuong-300g-202305150813079766.jpg', 'Cá ngừ ồ nướng 300g', 55000.00, 0, 55000.00, NULL, NULL, 61, 'vỉ', '300g', 5.0, 'Cá ngừ ồ hay còn được gọi là cá ồ, là loại cá nước mặn, có lớp da ngoài trơn, màu đen và trắng bạc. Thịt cá được nướng chín tới bên trong nhiều, thơm ngon, chứa ít chất béo và calo nhưng rất giàu protein, tốt cho sức khỏe. Cá ngừ nướng có hương thơm đặc trưng, ăn thịt tươi và thấm vị', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(203, 'https://cdn.tgdd.vn/Products/Images/8782/279674/bhx/ca-ngu-nuong-vi-300g-202205251333023532.jpg', 'Cá ngừ nướng 300g', 60000.00, 0, 60000.00, NULL, NULL, 96, 'vỉ', '300g', 5.0, 'Cá ngừ có phần nạc nhiều, ít béo, giàu chất dinh dưỡng và các muối khoáng cần thiết cho sức khỏe nên được nhiều người lựa chọn. Cá ngừ nướng vỉ làm sẵn tiện lợi, dễ sử dụng, hương vị thơm ngon, phù hợp cho cả gia đình', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 1),
(204, 'https://cdn.tgdd.vn/Products/Images/8782/222832/bhx/sellingpoint.jpg', 'Sứa cắt sợi Nhất Tâm 350g', 32000.00, 0, 32000.00, NULL, NULL, 96, 'gói', '350g', 5.0, 'Hải sản đông lạnh Nhất Tâm là hãng hải sản đông lạnh với chất lượng tuyệt vời, đa dạng các loại thịt cũng như hải sản tươi ngon. Sứa cắt sợi Nhất Tâm gói 350g với thịt sứa tự nhiên, thơm ngon khó cưỡng, được rất nhiều khách hàng tin dùng và lựa chọn, chế biến nhiều món ăn thơm ngon.', NULL, 0, 1, '2023-11-29 14:33:09', '2023-12-23 08:23:54', NULL, 5, 9),
