(274, 'https://cdn.tgdd.vn/Products/Images/8788/272179/bhx/dua-hau-khong-hat-trai-23kg-tro-len-202309230900547502.png', 'Dưa hấu không hạt trái từ 2.3kg', 53000.00, 0, 53000.00, NULL, NULL, 42, 'trái', '2.3kg', 5.0, '1. Thông tin sản phẩm\r\nDưa hấu không hạt là trái cây giàu nước, vitamin A, vitamin C, khoáng chất cần thiết cho cơ thể như kali, kẽm, canxi, đặc biệt ít calo và chất béo.\r\nDưa hấu được trồng ở Tiền Giang, Long An. Dưa chắc ruột, ít ngọt hơn dưa hấu có hạt và ngọt khi trái tròn đều, cuốn héo, xanh đậm có đầu vàng. \r\nSản phẩm sạch, đạt tiêu chuẩn kiểm nghiệm VS ATTP thực phẩm theo tiêu chuẩn ISO/IEC 17025:2017\r\n\r\nSản phẩm đầu vào của Bách hoá XANH được cung cấp bởi các Nhà cung cấp khác nhau theo từng khu vực. Bách hoá XANH có thể cung cấp giấy kiểm định sản phẩm theo từng khu vực đặt hàng của Khách hàng khi có yêu cầu.\r\n\r\n2. Cam kết Hoàn tiền hoặc Đổi hàng ngay\r\n\r\nBách hóa XANH cam kết hoàn tiền hoặc đổi hàng ngay trong tất cả trường hợp khách nhận sản phẩm không đạt chất lượng gồm dưa dập, nứt, úng bên ngoài, ruột trắng, bị non hoặc vỏ quá dày\r\n\r\nLiên hệ tổng đài 1900.1908 để được hỗ trợ nhanh nhất, hoặc để lại thông tin sản phẩm hư hỏng trên web/app theo hướng dẫn tại đây\r\n\r\n\r\n\r\n3. Món ăn ngon từ dưa hấu không hạt\r\n\r\nDưa hấu giàu các loại axit amin như citrulline và lycopene. Thành phần citrulline có trong vỏ màu trắng bao quanh ruột dưa hấu có tác dụng làm giảm huyết áp và là chất cần thiết có các cơ quan như: thận, phổi, gan, hệ thống miễn dịch,... Ngoài dùng làm trái cây tráng miệng, bạn có thể chế biến dưa hấu thành nhiều món ngon như: \r\n\r\nKem dưa hấu sữa chua mát lạnh\r\n5 cách làm salad dưa hấu ngon và dễ làm\r\nSinh tố dưa hấu sữa tươi mát lạnh \r\nKem dưa hấu kiwi ngon ngấ', NULL, 0, 1, '2023-11-30 03:22:57', '2023-12-23 08:23:54', NULL, 8, 1),
(275, 'https://cdn.tgdd.vn/Products/Images/8788/270325/bhx/dua-hau-do-trai-18kg-tro-len-202308190821225026.png', 'Dưa hấu đỏ trái từ 1.8kg', 36000.00, 14, 30960.00, NULL, NULL, 87, 'trái', '1.8kg', 5.0, '1. Thông tin sản phẩm\r\nDưa hấu đỏ là trái cây rất phổ biến tại Việt Nam và có quanh năm. Đặc điểm trái nhiều nước và vitamin, khoáng chất tốt cho sức khỏe, đặc biệt là ít calo và chất béo. Nước ép Dưa hấu có thể giải khát rất tốt trong mùa nóng nắng. Dưa hấu ngọt khi trái đủ độ chín, có vỏ xanh đậm, cuống héo nhẹ.\r\n\r\n         \r\n\r\nSản phẩm sạch, đạt tiêu chuẩn kiểm nghiệm VS ATTP thực phẩm theo tiêu chuẩn ISO/IEC 17025:2017\r\n         \r\n2. Cam kết Bao đổi trả\r\nBách hóa XANH cam kết hoàn tiền hoặc giao lại ngay sản phẩm dưa trong tất cả trường hợp khách nhận sản phẩm không đạt chất lượng gồm hư hỏng, dập úng, trắng ruột bên trong hoặc nứt vỡ, cấn dập bên ngoài\r\nLiên hệ tổng đài 1900.1908 để được hỗ trợ nhanh nhất, hoặc để lại thông tin sản phẩm hư hỏng trên web/app theo hướng dẫn tại đây\r\n\r\n         \r\n\r\n3. Có thể bạn muốn biết\r\nDưa hấu cuống héo sau thu hoạch 1-2 ngày sẽ đạt độ đường cao nhất, lúc này ăn sẽ rất ngọt\r\nDưa hấu ướp lạnh và chấm kèm muối khi ăn sẽ ngon hơn\r\nDưa hấu ruột đỏ sẽ ngọt hơn dưa hấu không hạt\r\nTrong 100g dưa hấu có khoảng 30.4 kcal, phù hợp với chế độ giảm cân\r\nRất nhiều món ngon từ Dưa hấu mà bạn sẽ muốn thử xem thêm\r\n\r\n        \r\n\r\nLưu ý: Sản phẩm nhận được có thể khác với hình ảnh về màu sắc và số lượng nhưng vẫn đảm bảo về mặt khối lượng và chất lượng.\r\n\r\n ', NULL, 1, 1, '2023-11-30 03:22:57', '2024-01-01 05:40:29', NULL, 8, 1),
(276, 'https://cdn.tgdd.vn/Products/Images/8788/307147/bhx/buoi-nam-roi-ep-nuoc-trai-400g-700g-202306241523364554.jpg', 'Bưởi năm roi ép nước trái 800g', 11000.00, 0, 11000.00, NULL, NULL, 8, 'trái', '800g', 5.0, 'Bưởi năm roi là trái cây có nguồn xuất xứ Miền Tây (Vĩnh Long). Đây là loại bưởi chuyên dùng để ép nước, vỏ bưởi sần sùi, xám nhẹ,... Bưởi có mùi hương thanh mát, ngọt thanh. Bưởi tốt cho sức khoẻ, hệ miễn dịch và phù hợp cho người giảm cân và tiểu đường', NULL, 0, 1, '2023-11-30 03:22:57', '2023-12-23 08:23:54', NULL, 8, 1),
