(281, 'https://cdn.tgdd.vn/Products/Images/8788/226982/bhx/quyt-duong-tui-luoi-1kg-4-6-trai-202301051509545271.jpg', 'Quýt đường 1kg', 46000.00, 0, 46000.00, NULL, NULL, 75, 'túi', '1kg', 5.0, 'Quýt đường có ngọt thanh, chua nhẹ, chứa rất nhiều các chất dinh dưỡng từ thiên nhiên, cùng với đó là một lượng lớn khoáng chất, vitamin, nhiều nhất là vitamin C. Có thể ăn trực tiếp hoặc pha chế các loại đồ uống đều rất ngon.', NULL, 0, 1, '2023-11-30 03:22:57', '2023-12-23 08:23:54', NULL, 8, 1),
(282, 'https://cdn.tgdd.vn/Products/Images/8788/318463/bhx/quyt-mini-tui-1kg-7-10-trai-202311131524391115.jpg', 'Quýt mini 1kg', 39000.00, 10, 35100.00, NULL, NULL, 7, 'túi', '1kg', 5.0, 'Quýt mini là loại trái cây có vị chua ngọt, mọng nước và giàu chất dinh dưỡng, đặc biệt dồi dào vitamin C giúp tăng cường sức đề kháng cho cơ thể khỏe mạnh, ít đường và ít calo không lo tăng cân. Quýt mini có xuất xứ từ Trung Quốc, được tuyển chọn và đóng gói sạch sẽ an toàn, tiện lợi.', NULL, 0, 1, '2023-11-30 03:22:57', '2023-12-23 08:23:54', NULL, 8, 1),
(283, 'https://cdn.tgdd.vn/Products/Images/8788/316290/bhx/-202310190854351564.jpg', 'Cam Cara Úc 1kg (9 - 11 trái)', 89000.00, 0, 89000.00, NULL, NULL, 10, 'túi', '1kg', 5.0, 'Cam Cara nhập khẩu trực tiếp từ Úc, trái cam to, vỏ vàng tươi, ruột cam ngọt thanh và mọng nước. Cam Cara đóng túi 1kg từ 9 - 11 trái, không chỉ phù hợp để sử dụng hằng ngày mà còn có thể dùng tặng người thân, bạn bè.', NULL, 0, 1, '2023-11-30 03:22:57', '2023-12-23 08:23:54', NULL, 8, 1),
(284, 'https://cdn.tgdd.vn/Products/Images/8788/319192/bhx/cam-vang-noi-dia-trung-09-11kg-3-5-trai-202311231403559376.jpg', 'Cam vàng nội địa Trung 0.9-1.1kg (3 - 5 trái)', 59000.00, 0, 59000.00, NULL, NULL, 27, 'túi', '', 5.0, 'Cam Vàng là trái cây nhập khẩu từ Trung Quốc. Đạt tiêu chuẩn xuất khẩu toàn cầu. Cam ngọt thanh, thơm đặc trưng, màu vàng bắt mắt, tép cam mọng nước ít xơ. Cam vàng Trung Quốc chứa nhiều Vitamin C, tốt cho da, chống lão hóa, giảm Cholesterol, phục sức khỏe, tạo hồng huyết cầu, giảm căng thẳng', NULL, 0, 1, '2023-11-30 03:22:57', '2023-12-23 08:23:54', NULL, 8, 1),
(285, 'https://cdn.tgdd.vn/Products/Images/8788/318522/bhx/cam-sanh-tui-09-11kg-6-9-trai-202311131311346717.jpg', '2 túi Cam sành 0.9-1.1kg (6 - 9 trái)', 44000.00, 0, 44000.00, NULL, NULL, 3, 'túi', '', 5.0, 'Cam sành là một nguồn cung cấp chất dinh dưỡng quan trọng, đặc biệt là vitamin C, vitamin A và chất chống oxy hóa. Ngoài ra, 2 túi Cam sành 0.9-1.1kg (6 - 9 trái) cũng cung cấp chất xơ và các khoáng chất quan trọng như kali và folate.', NULL, 0, 1, '2023-11-30 03:22:57', '2023-12-23 08:23:54', NULL, 8, 1),
(286, 'https://cdn.tgdd.vn/Products/Images/8788/310275/bhx/cam-sanh-09-11kg-6-9-trai-202310020858304147.jpg', 'Cam sành 0.9-1.1kg', 22000.00, 23, 16940.00, NULL, NULL, 34, 'túi', '0.9-1.1kg ', 5.0, '1. Thông tin sản phẩm\r\nCam sành là loại trái cây mọng nước, ngon ngọt, giàu vitamin, rất tốt cho sức khỏe và được nhiều người yêu thích. Cam sành có vỏ màu xanh và chuyển vàng khi chín, vỏ sần và dày, tép màu vàng cam đậm, mọng nước, vị ngọt chua và khá nhiều hạt. Thường được sử dụng để vắt lấy nước uống\r\n\r\nĐảm bảo nguồn gốc cam được trồng tại các tỉnh như Tiền Giang, Vĩnh Long,... tuỳ theo mùa vụ\r\n\r\nĐạt chuẩn 100% VS ATTP\r\nSản phẩm sạch, đạt tiêu chuẩn kiểm nghiệm VS ATTP thực phẩm theo tiêu chuẩn ISO/IEC 17025:2017\r\n\r\n2. Cam kết Hoàn tiền hoặc Đổi hàng ngay\r\n\r\nBách hóa XANH cam kết hoàn tiền hoặc đổi hàng ngay trong tất cả trường hợp khách nhận sản phẩm không đạt chất lượng gồm cam sâu vỏ, tép bị sượng, cam bị úng, dập do giao hàng\r\n\r\nLiên hệ tổng đài 1900.1908 để được hỗ trợ nhanh nhất, hoặc để lại thông tin sản phẩm hư hỏng trên web/app theo hướng dẫn tại đây\r\n\r\n3. Thức uống đa dạng từ cam sành\r\nNgoài nước ép cam nguyên chất, bạn có thể ép cam và táo hỗ trợ giảm cân hoặc nước ép cam và cà rốt thanh nhiệt, tăng sức đề kháng cho cơ thể\r\nLưu ý: Sản phẩm nhận được có thể khác với hình ảnh về màu sắc và số lượng nhưng vẫn đảm bảo về mặt khối lượng và chất lượng.', NULL, 0, 1, '2023-11-30 03:22:57', '2023-12-23 08:23:54', NULL, 8, 1),
(287, 'https://cdn.tgdd.vn/Products/Images/8788/302675/bhx/cam-sanh-vat-nuoc-tui-3kg-18-24-trai-202302151633475672.jpg', 'Cam sành vắt nước 2.9-3.1kg', 47000.00, 17, 39010.00, NULL, NULL, 61, 'túi', '2.9-3.1kg', 5.0, 'Cam sành là trái cây rất thông dụng trong đời sống, được ưu tiên chọn mua bởi tác dụng thần kỳ của nó mang lại cho sức khỏe chúng ta. Đặc điểm vỏ cam sành màu xanh đến xanh vàng khi chín, sần và dày, tép màu vàng cam đậm, nhiều nước, vị ngọt chua mùi rất thơm và khá nhiều hạt. Phù hợp để vắt nước.', NULL, 0, 1, '2023-11-30 03:22:57', '2023-12-23 08:23:54', NULL, 8, 1),
(288, 'https://cdn.tgdd.vn/Products/Images/8788/270262/bhx/oi-dai-loan-vi-1kg-4-5-trai-202211040919595039.jpg', 'Ổi Đài Loan 1kg', 20000.00, 25, 15000.00, NULL, NULL, 3, 'túi', '1kg', 5.0, 'Ổi Đài Loan là giống trái cây có vị ngọt man mát, hơi xốp, giòn, thơm nhè nhẹ, đặc biệt rất ít hạt cho cảm giăc ăn vô cùng thích thú. Trong ổi chứa nhiều vitamin giúp tăng cường miễn dịch, đẹp da, giảm cân,...Ổi ngon, giòn nhất khi trái chắc, xanh sáng, cầm nặng tay.', NULL, 0, 1, '2023-11-30 03:22:57', '2023-12-23 08:23:54', NULL, 8, 1),
(289, 'https://cdn.tgdd.vn/Products/Images/8788/286268/bhx/du-du-ruot-do-trai-700g-900g-202211220833178971.jpg', 'Đu đủ ruột đỏ trái 900g', 18000.00, 0, 18000.00, NULL, NULL, 31, 'trái', '900g', 5.0, 'Là giống trái cây nhiệt đới ngon, Quả đu đủ không những là loại quả có hương vị thơm ngon mà còn là phương thuốc quý. Đu đủ tại Bách hoá XANH tươi ngon, ngọt, không chỉ thích hợp cho việc ăn trực tiếp bổ sung dinh dưỡng mà còn có thể chế biến thành nhiều món ăn.', NULL, 0, 1, '2023-11-30 03:22:57', '2023-12-23 08:23:54', NULL, 8, 1),
(290, 'https://cdn.tgdd.vn/Products/Images/8788/270320/bhx/-202310231453481686.jpg', 'Xoài keo 0.9kg - 1.1kg', 25000.00, 0, 25000.00, NULL, NULL, 45, 'túi', '0.9-1.1kg', 5.0, 'Xoài keo có nguồn gốc từ Campuchia, là loại trái cây được ưa chuộng giàu chất xơ, vitamin, khoáng chất thiết yếu và mang lại nhiều lợi ích tuyệt vời cho hệ tiêu hóa, tim mạch, giúp mắt sáng, làm đẹp da. Xoài keo có quả chắc giòn giòn, chua nhẹ thơm ngon được nhiều người ưa thích.', NULL, 0, 1, '2023-11-30 03:22:57', '2023-12-23 08:23:54', NULL, 8, 1),
(298, 'https://cdn.tgdd.vn/Products/Images/8788/202933/bhx/cam-vang-uc-tui-1kg-3-5-trai-202211030940379556.jpg', 'Cam vàng Úc 0.9kg - 1.1kg', 79000.00, 0, 79000.00, NULL, NULL, 30, 'túi', '0.9-1.1kg', 5.0, 'Cam Vàng Úc là trái cây nhập khẩu từ Úc. Đạt tiêu chuẩn xuất khẩu toàn cầu. Cam ngọt thanh, thơm đặc trưng, màu vàng bắt mắt, tép cam mọng nước ít xơ. Cam vàng Úc chứa nhiều Vitamin C, tốt cho da, chống lão hóa, giảm Cholesterol, phục sức khỏe, tạo hồng huyết cầu, giảm căng thẳng', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(299, 'https://cdn.tgdd.vn/Products/Images/8788/270353/bhx/chuoi-su-nai-13kg-tro-len-giao-ngau-nhien-song-hoac-chin-202310031359500128.jpg', 'Chuối sứ nải 1.8kg', 25000.00, 0, 25000.00, NULL, NULL, 15, 'nải', '1.8kg', 5.0, 'Chuối sứ là trái cây chứa rất nhiều chất dinh dưỡng cần thiết cho cơ thể, hương vị bùi bùi ngọn dịu vô cùng hấp dẫn. Ngoài ăn trực tiếp chuối sứ còn có thể dùng chế biến nhiều món ăn ngon hấp dẫn như sinh tố, chè, bánh, kem, sữa,...Chuối ngon nhất khi bắt đầu xuất hiện đốm nâu.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(300, 'https://cdn.tgdd.vn/Products/Images/8788/270354/bhx/chuoi-cau-nai-800g-tro-len-giao-ngau-nhien-song-hoac-chin-202310031358037867.jpg', 'Chuối cau nải 1kg', 25000.00, 0, 25000.00, NULL, NULL, 86, 'nải', '1kg', 5.0, 'Chuối cau là trái cây thân thuộc, được trồng nhiều tại Việt Nam. Trái nhỏ, tròn khi chín có màu vàng ươm đẹp mắt, hương thơm nhẹ đặc trưng, vị ngọi thanh. Chuối cau chứa nhiều chất xơ, vitamin, khoáng chất và ít tinh bột có tác dụng làm đẹp da, chống lão hóa, tốt cho tim mạch, đường huyết, giảm cân', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(301, 'https://cdn.tgdd.vn/Products/Images/8788/312875/bhx/nho-mau-don-noi-dia-trung-500g-202308170900444573.jpg', 'Nho mẫu đơn nội địa Trung 450g - 550g', 89000.00, 0, 89000.00, NULL, NULL, 80, 'hộp', '450-550g', 5.0, 'Nho mẫu đơn là giống nho mọng nước, quả có hình tròn đều, vị ngọt đậm đà và hương thơm nhẹ. Nho mẫu đơn tại Bách hóa XANH được đảm bảo nguồn gốc xuất xứ từ Trung Quốc và được đóng gói trong hộp nhựa sạch sẽ, đảm bảo vệ sinh.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(302, 'https://cdn.tgdd.vn/Products/Images/8788/284397/bhx/nho-do-ninh-thuan-hop-500gr-202210280922312249.jpg', 'Nho đỏ Ninh Thuận 500g', 32000.00, 0, 32000.00, NULL, NULL, 44, 'hộp', '500g', 5.0, 'Nho đỏ có phần thịt dày mọng nước, vị ngọt xen lẫn chua nhẹ hài hoà, là loại trái cây được nhiều người yêu thích vào những ngày hè. Loại nho đỏ Ninh Thuận  mang lại nhiều lợi ích đối với sức khoẻ, nho ngọt khi có vỏ màu đỏ tím, đậm, chín đều, chắc, mọng.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(303, 'https://cdn.tgdd.vn/Products/Images/8788/319523/bhx/combo-le-ma-hong-oi-dai-loan-202311280952114837.jpg', 'Combo 1kg lê má hồng, 1kg ổi Đài Loan', 79000.00, 6, 74260.00, NULL, NULL, 77, 'túi', '', 5.0, 'Combo lê má hồng và ổi Đài Loan gồm có lê má hồng vỏ ngoài mỏng, thịt bên trong màu trắng, nhiều nước nên được ưa chuộng vào màu hè làm thành nhiều món ngon giải khát. Ổi Đài Loan có nhiều vitamin, đặc biệt và vitamin C, giúp giải nhiệt hiệu quả', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(304, 'https://cdn.tgdd.vn/Products/Images/8788/319531/bhx/tao-dazzle-oi-dai-loan-clone-202311281053441362.jpg', 'Combo 1kg táo Gala Mỹ, 1kg ổi Đài Loan', 89000.00, 6, 83660.00, NULL, NULL, 53, 'hộp', '', 5.0, 'Combo táo Gala Mỹ, ổi Đài Loan gồm: Táo gala nhập khẩu từ Mỹ, ngon, ngọt, chất lượng, không bị dập, úng. Ổi Đài Loan có vị ngọt man mát, hơi xốp, giòn, thơm nhè nhẹ, đặc biệt rất ít hạt cho cảm giăc ăn vô cùng thích thú.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(305, 'https://cdn.tgdd.vn/Products/Images/8788/319532/bhx/tao-rockit-oi-dai-loan-202311281103188019.jpg', 'Combo 1kg táo Rockit, 1kg ổi Đài Loan', 75000.00, 10, 67500.00, NULL, NULL, 34, 'túi', '', 5.0, 'Combo táo Rockit, ổi Đài Loan tươi ngon, gồm Táo Rocki quả nhỏ, vỏ ngoài hồng đậm pha chút trắng vàng, thịt và vỏ giòn, thơm ngọt, được nhiều người ưa chuộng. Ổi Đài Loan có vị ngọt man mát, hơi xốp, giòn, thơm nhè nhẹ, đặc biệt rất ít hạt', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(306, 'https://cdn.tgdd.vn/Products/Images/8788/319528/bhx/tao-cripps-red-oi-dai-loan-clone-202311281040347197.jpg', 'Combo 1kg táo Dazzle, 1kg ổi Đài Loan', 105000.00, 5, 99750.00, NULL, NULL, 7, 'túi', '', 5.0, 'Combo táo Dazzle, ổi Đài Loan ổi Đài Loan tươi ngon với Táo Dazzle giòn, ngọt và thơm vô cùng từ New Zealand. Đạt tiêu chuẩn xuất khẩu toàn cầu, được lai tạo giữa 2 giống táo: Sweetie và Scired. Và Ổi Đài Loan hơi xốp, giòn, thơm nhè nhẹ, đặc biệt rất ít hạt.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(307, 'https://cdn.tgdd.vn/Products/Images/8788/319527/bhx/tao-ambrosia-new-zealand-oi-dai-loan-clone-202311281021468372.jpg', 'Combo 1kg táo Cripps Red, 1kg ổi Đài Loan', 79000.00, 6, 74260.00, NULL, NULL, 34, 'túi', '', 5.0, 'Combo táo Cripps Red, ổi Đài Loan ổi Đài Loan tiết kiệm, tươi ngon với Táo Cripps Red là một sản phẩm nhập khẩu từ Nam Phi, giòn ngọt, vị chua nhẹ và Ổi Đài Loan hơi xốp, giòn, thơm nhè nhẹ, đặc biệt rất ít hạt.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(308, 'https://cdn.tgdd.vn/Products/Images/8788/233980/bhx/tao-dazzle-nhap-khau-new-zealand-tui-1kg-5-7-trai-202210280817278819.jpg', 'Táo Dazzle New Zealand 1kg', 85000.00, 0, 85000.00, NULL, NULL, 46, 'túi', '1kg', 5.0, 'Táo Dazzle là trái cây từ New Zealand. Đạt tiêu chuẩn xuất khẩu toàn cầu, được lai tạo giữa 2 giống táo: Sweetie và Scired. Táo chắc, khi ăn giòn, ngọt và thơm vô cùng, chứa nhiều vitamin A, C, canxi, và sắt, cùng với pectin tốt cho sức khỏe. Size táo có kích thước lớn, vỏ sáng bóng, màu đỏ thẩm.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(309, 'https://cdn.tgdd.vn/Products/Images/8788/234962/bhx/tao-fuji-mini-nam-phi-1kg-8-10-trai-202306081530567515.jpg', 'Táo Fuji mini Nam Phi 0.9kg - 1.1kg', 49000.00, 0, 49000.00, NULL, NULL, 30, 'túi', '0.9-1.1kg', 5.0, 'Táo Fuji mini là loại trái cây nhập khẩu từ Nam Phi. Táo Fuji có độ giòn, vị ngọt thanh nhiều nước và có hương thơm đặc trưng quyến rũ. Táo Fuji mini giàu chất xơ, kẽm và vitamin C, B1, B2, tốt cho người muốn cải thiện hệ tiêu hoá.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(310, 'https://cdn.tgdd.vn/Products/Images/8788/319452/bhx/tao-autumn-glory-mini-my-09-11kg-202311241056130003.jpg', 'Táo Autumn Glory mini Mỹ 0.9-1.1kg', 55000.00, 0, 55000.00, NULL, NULL, 9, 'túi', '0.9-1.1kg', 5.0, 'Táo Autumn Glory mini là trái cây nhập khẩu Mỹ, chất lượng an toàn cùng lượng dưỡng chất dồi dào, có vị giòn ngọt và thanh mát. Ngoài ra, nhiều nghiên cứu cho rằng ăn 2 quả táo mỗi ngày có thể giảm nguy cơ đột quỵ hoặc đau tim nếu nguyên nhân xuất phát từ cholesterol làm cứng động mạch.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(311, 'https://cdn.tgdd.vn/Products/Images/8788/319449/bhx/tao-autumn-glory-my-09-11kg-202311301004511968.jpg', 'Táo Autumn Glory Mỹ 0.9-1.1kg', 69000.00, 0, 69000.00, NULL, NULL, 54, 'túi', '0.9-1.1kg', 5.0, 'Táo Autumn Glory là trái cây nhập khẩu từ Mỹ, chất lượng an toàn cùng lượng dưỡng chất dồi dào, có vị giòn ngọt và thanh mát. Ngoài ra, nhiều nghiên cứu cho rằng ăn 2 quả táo mỗi ngày có thể giảm nguy cơ đột quỵ hoặc đau tim nếu nguyên nhân xuất phát từ cholesterol làm cứng động mạch.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(312, 'https://cdn.tgdd.vn/Products/Images/8788/310069/bhx/tao-fuji-nam-phi-09-11kg-5-7-trai-202308180930472857.jpg', 'Táo Fuji Nam Phi 1kg', 49000.00, 0, 49000.00, NULL, NULL, 42, 'túi', '1kg', 5.0, 'Táo Fuji tươi ngon, giòn ngọt vô cùng hấp dẫn. Đây là loại trái cây chứa nhiều dưỡng chất dinh dưỡng, tốt cho sức khỏe, thích hợp là món quà cho bạn bè và người thân.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(313, 'https://cdn.tgdd.vn/Products/Images/8788/311191/bhx/tao-rockit-ong-2-trai-202307271409073380.jpg', 'Táo Rockit ống 2 trái 76g', 55000.00, 5, 52250.00, NULL, NULL, 49, 'ống', '76g', 5.0, 'Táo Rockit là loại trái cây nhập khẩu cao cấp, có hương vị giòn ngọt. Loại trái cây này quả nhỏ, vỏ ngoài hồng đậm pha chút trắng vàng, thịt và vỏ giòn, thơm ngọt, được nhiều người ưa chuộng.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1);
