(314, 'https://cdn.tgdd.vn/Products/Images/8788/213642/bhx/tao-pink-lady-nhap-khau-new-zealand-hop-1kg-5-7-trai-202210241550200635.jpg', 'Táo Pink Lady nhập khẩu Nam Phi 1kg (5-7 trái)', 69000.00, 0, 69000.00, NULL, NULL, 18, 'túi', '1kg', 5.0, 'Táo nhập khẩu 100% từ Nam Phi. Đạt tiêu chuẩn xuất khẩu toàn cầu. Bảo quản tươi ngon đến tận tay khách hàng. Trái vừa ăn, chắc tay, vỏ táo màu hồng xanh đẹp mắt. Táo ngon nhất khi có lớp vỏ màu đỏ đậm, táo còn cứng, không bị dập.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(315, 'https://cdn.tgdd.vn/Products/Images/8788/317968/bhx/tao-gala-mini-phap-tui-09-11kg-202311300955061763.jpg', 'Táo Gala mini pháp 0.9-1.1kg', 55000.00, 11, 48950.00, NULL, NULL, 41, 'túi', '', 5.0, 'Táo gala mini là trái cây nhập khẩu Pháp, với công nghệ trồng và bảo quản hiện đại, luôn giữ được giá trị dinh dưỡng cả khi vận chuyển quảng đường dài. Ăn táo mỗi ngày cấp cấp nhiều chất dinh dưỡng cực tốt cho cơ thể,', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(316, 'https://cdn.tgdd.vn/Products/Images/8788/296883/bhx/tao-gala-my-hop-1kg-5-7-trai-202211231401584270.jpg', 'Táo Gala Mỹ 1kg', 69000.00, 0, 69000.00, NULL, NULL, 49, 'hộp', '1kg', 5.0, 'Táo gala là trái cây nhập khẩu từ Mỹ. Đạt tiêu chuẩn xuất khẩu toàn cầu. Bảo quản tươi ngon đến tận tay khách hàng. Táo gala Mỹ ngon, ngọt, chất lượng, không bị dập, úng.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(317, 'https://cdn.tgdd.vn/Products/Images/8788/261699/bhx/tao-cripps-red-nhap-khau-nam-phi-hop-1kg-5-7-trai-202302201535297037.jpg', 'Táo Cripps Red Nam Phi 0.9- 1.1kg', 59000.00, 0, 59000.00, NULL, NULL, 22, 'túi', '0.9-1.1kg', 5.0, 'Táo Cripps Red là một trong những giống táo nhập khẩu Nam Phi được nhiều người tiêu dùng yêu thích với những đặc điểm riêng biệt. Táo Cripps Red là trái cây nhập khẩu giòn, ngọt có vị chua nhẹ.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(318, 'https://cdn.tgdd.vn/Products/Images/8788/319234/bhx/le-tai-nung-noi-dia-trung-09-11kg-202311231419128816.jpg', 'Lê Tai Nung nội địa Trung Quốc 0.9-1.1kg', 45000.00, 0, 45000.00, NULL, NULL, 64, 'túi', '0.9-1.1kg', 5.0, 'Lê Tai Nung nhập khẩu từ Trung Quốc, với vỏ mỏng, xanh và thịt trắng. Lê Tai Nung là có đặc điểm quả nhỏ, núm ở cuống hơi lõm, thịt trắng, đặc ruột, mọng nước chứa nhiều vitamin C, canxi và sắt. Khi chín có vị ngọt thanh có tác dụng bổ sung chất dinh dưỡng cho cơ thể và phù hợp làm trái cây giải nhiệt.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(319, 'https://cdn.tgdd.vn/Products/Images/8788/223091/bhx/le-duong-tui-1kg-4-6-trai-202211040849060124.jpg', 'Lê đường 1kg', 53000.00, 0, 53000.00, NULL, NULL, 50, 'túi', '1kg', 5.0, 'Lê đường là trái cây có xuất xứ từ những vùng có khí hậu lạnh. Lê đường được nhập khẩu từ Trung Quốc với đầy đủ các tiêu chuẩn chất lượng. Đặc điểm của lê là giòn, ngọt và mọng nước. Lê đường có nhiều dưỡng chất tốt cho sức khỏe; nổi tiếng với món lê hấp đường phèn giảm ho, cải thiện đau rát cổ họng', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(320, 'https://cdn.tgdd.vn/Products/Images/8788/238709/bhx/le-ma-hong-1kg-202311140858132393.jpg', 'Lê má hồng 1kg', 59000.00, 0, 59000.00, NULL, NULL, 59, 'túi', '', 5.0, 'Lê má hồng là loại trái cây có vị ngọt dịu, giòn thơm mát và mọng nước. Lê má hồng có vỏ ngoài mỏng, màu xanh, thịt bên trong màu trắng, nhiều nước nên được ưa chuộng vào màu hè làm thành nhiều món ngon giải khát, giải nhiệt. Sản phẩm tươi ngon, sạch, an toàn cho sức khoẻ người tiêu dùng.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(321, 'https://cdn.tgdd.vn/Products/Images/8788/317826/bhx/le-hoang-kim-09-11kg-202311181140287923.jpg', 'Lê hoàng kim 0.9-1.1kg', 59000.00, 0, 59000.00, NULL, NULL, 42, 'túi', '', 5.0, 'Lê hoàng kim là loại trái cây có thịt bên trong màu trắng, giòn, mọng nước và vị ngọt thanh. Vỏ lê mỏng, thịt ngọt nhẹ, nhiều nước và ít calo, giàu dưỡng chất nên đem lại nhiều lợi ích cho sức khoẻ và làm đẹp. Với vị ngọt tự nhiên, lê hoàng kim có thể làm nguyên liệu cho món bánh, salad hay các loại nước uống giải khát. Và đặc biệt ăn ngon, ngọt hơn khi ướp lạnh.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(322, 'https://cdn.tgdd.vn/Products/Images/8788/317183/bhx/le-hoang-kim-3kg-202310180816478264.jpg', 'Lê hoàng kim 3kg', 199000.00, 0, 199000.00, NULL, NULL, 34, 'hộp', '3kg', 5.0, 'Hộp quà lê hoàng kim 3kg với thiết kế tinh tế, sang trọng chắc chắn sẽ là món quà ý nghĩa, phù hợp cho mọi dịp để dành tặng cho những người thân yêu.\r\nLê hoàng kim là loại trái cây có thịt bên trong màu trắng, giòn, mọng nước và vị ngọt thanh. Vỏ lê mỏng, thịt ngọt nhẹ, mọng nước và ít calo, nhiều dưỡng chất nên đem lại nhiều lợi ích cho sức khoẻ và làm đẹp. Với vị ngọt tự nhiên, lê hoàng kim có thể làm nguyên liệu cho món bánh, salad hay các loại nước uống giải khát.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(323, 'https://cdn.tgdd.vn/Products/Images/8788/301165/bhx/tao-boom-ninh-thuan-hop-500g-7-8-trai-202301110839358104.jpg', 'Táo boom Ninh Thuận 500g', 23500.00, 0, 23500.00, NULL, NULL, 42, 'hộp', '500g', 5.0, 'Là loại trái cây có màu xanh bóng ửng vàng, nhẵn mịn. Táo boom Ninh Thuận giòn ngọt, thanh mát chứa nhiều vitamin và dưỡng chất tốt cho cơ thể như tăng cường sức đề kháng, chống ô xy hóa, tốt cho sức khỏe và làn da.Cam kết giao đúng khối lượng, chất lượng và an toàn.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(324, 'https://cdn.tgdd.vn/Products/Images/8788/302714/bhx/tao-ninh-thuan-hop-500g-12-15-trai-202302160824244968.jpg', 'Táo Ninh Thuận 500g', 21000.00, 0, 21000.00, NULL, NULL, 7, 'túi', '500g', 5.0, 'Táo xanh Ninh Thuận là trái cây đặc sản của vùng đất Phan Rang Ninh Thuận. Táo xanh hay táo ta, táo gai, tên khoa học Ziziphus mauritiana, là cây ăn quả nhiệt đới có nguồn gốc châu Phi. Khi ăn rửa sạch và ăn luôn vỏ, có vị ngọt thanh, giòn tan trong miệng. Quả ngon hơn khi chấm cùng muối ớt/muối tôm', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(325, 'https://cdn.tgdd.vn/Products/Images/8788/292790/bhx/oi-tran-chau-ruot-do-khay-1kg-5-7-trai-202211040917121856.jpg', 'Ổi trân châu ruột đỏ 1kg', 31000.00, 25, 23250.00, NULL, NULL, 9, 'vỉ', '1kg', 5.0, 'Ổi trân châu ruột đỏ giòn ngọt, tươi ngon, trái to, không bị dập. Ổi có ruột màu đỏ hồng vô cùng hấp dẫn, ổi ngọt ngon. Ổi ngon, được đóng gói cẩn thận, tiện lợi, là loại trái cây cung cấp nhiều dưỡng chất cho cơ thể. Ổi ngon, giòn nhất khi trái chắc, xanh sáng, cầm nặng tay.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(326, 'https://cdn.tgdd.vn/Products/Images/8788/292850/bhx/oi-ruby-vi-1kg-3-5-trai-202211071503035148.jpg', 'Ổi Ruby 0.9kg - 1.1kg', 32000.00, 25, 24000.00, NULL, NULL, 21, 'vỉ', '0.9-1.1kg', 5.0, 'Ổi ruby là loại trái cây chất lượng, thơm ngon có lớp vỏ màu xanh lá cây bóng mượt, bên trong có màu đỏ hồng rất bắt mắt và hấp dẫn. Ổi ruby được rất nhiều người ưa chuộng và chọn mua bởi sự giòn, ngọt của nó.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(327, 'https://cdn.tgdd.vn/Products/Images/8788/310664/bhx/man-sua-1kg-5-9-trai-202307150825246284.jpg', 'Mận sữa 1kg', 39000.00, 0, 39000.00, NULL, NULL, 76, 'túi', '1kg', 5.0, 'Mận sữa tươi ngon, chất lượng, có màu trắng của sữa trông rất bắt mắt và hấp dẫn. Mận sữa có vị ngọt thanh, giòn, ăn kèm với muối ớt vô cùng bắt vị. Mận sữa có nguồn gốc từ các tỉnh ở khu vực miền tây: Tiền Giang, Đồng Tháp, Cần Thơ, Vĩnh Long .... (tuỳ theo lô hàng)', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(328, 'https://cdn.tgdd.vn/Products/Images/8788/233526/bhx/coc-lon-tui-1kg-4-6-trai-202205310926390691.jpg', 'Cóc lớn 0.9kg - 1.1kg', 33000.00, 0, 33000.00, NULL, NULL, 18, 'túi', '0.9-1.1kg', 5.0, 'Cóc là loại trái cây nhiệt đới có quả giòn, ngọt dịu, pha ít vị chua nhẹ nhàng dễ chịu, ăn trực tiếp hoặc làm ước ép đều rất thơm ngon và bổ dưỡng. Cóc lớn ngon nhất khi có vỏ trơn láng, xanh đậm, đốm vàng, khi đó cóc sẽ ngọt và giòn ngon. Cam kết bán đúng khối lượng', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(329, 'https://cdn.tgdd.vn/Products/Images/8788/310908/bhx/coc-giong-thai-1kg-202307220950588276.jpg', 'Cóc giống Thái 0.9-1.1kg ', 15000.00, 0, 15000.00, NULL, NULL, 61, 'túi', '0.9-1.1kg', 5.0, 'Cóc giống Thái là loại trái cây có màu xanh lục đẹp mắt, vị chua và giòn, vỏ dày nhưng mềm. Trái cóc Thái khi còn non ăn rất giòn, nhưng khi quả già và chín thì thịt quả mềm, có vị chua ngọt. Cóc tại Bách hóa XANH được đảm bảo nguồn gốc xuất xứ, chất lượng và cam kết bán đúng khối lượng.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(330, 'https://cdn.tgdd.vn/Products/Images/8788/319197/bhx/hong-gion-moc-chau-09-11kg-202311200946296856.jpg', 'Hồng giòn Mộc Châu 0.9-1.1kg', 45000.00, 0, 45000.00, NULL, NULL, 48, 'túi', '', 5.0, 'Hồng giòn Mộc Châu là loại trái cây thơm ngon, thịt quả màu vàng nhạt, vị ngọt thanh dễ chịu. Với vỏ ngoài màu xanh, đáy nhọn và có hạt, cần lưu ý khi sử dụng cho trẻ em. Hồng giòn chứa nhiều dưỡng chất, có thể chế biến thành nhiều món ăn ngon.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(331, 'https://cdn.tgdd.vn/Products/Images/8788/316335/bhx/thanh-long-09-11kg-2-3-trai-202310041030340610.jpg', 'Thanh long 0.9kg - 1.1kg', 18000.00, 0, 18000.00, NULL, NULL, 55, 'túi', '0.9-1.1kg', 5.0, 'Thanh long trắng là loại trái cây có bề ngoài bóng bẩy đẹp mắt, tươi ngon, vị ngọt thanh hấp dẫn. Trong thanh long có chứa hàm lượng lớn vitamin C giúp tăng cường sức đề kháng cho cở thể khỏe mạnh. Thanh long ngon nhất khi vỏ màu đỏ đậm, quả chắc sẽ rất ngọt và mọng nước.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(332, 'https://cdn.tgdd.vn/Products/Images/8788/309813/bhx/vu-sua-bo-hong-1kg-2-4-trai-202306271535381303.jpg', 'Vú sữa bơ hồng 1kg', 69000.00, 0, 69000.00, NULL, NULL, 33, 'túi', '1kg', 5.0, 'Là một trong những loại trái cây đặc sản của Việt Nam. Vú sữa bơ hồng xuất xứ Vĩnh Long, Tiền Giang căng mọng có vị ngọt hương thơm bơ sữa hấp dẫn, quyến rũ. Đặc biệt trong cú sữa có chứa các dưỡng chất như canxi, phốt pho, sắt và magiê rất tốt cho sức khỏe phụ nữa mang thai và thai nhi.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(333, 'https://cdn.tgdd.vn/Products/Images/8788/299803/bhx/vu-sua-tim-tui-1kg-4-5-trai-202212311323249748.jpg', 'Vú sữa tím 1kg', 69000.00, 0, 69000.00, NULL, NULL, 100, 'túi', '1kg', 5.0, 'Vú sữa là loại trái cây chứa nhiều vitamin và chất dinh dưỡng. Vú sữa tím có vị ngọt béo, nhiều nước, mùi thơm thoảng, quả to tròn, thơm ngon, thịt quả màu tím nhạt đẹp mắt, hấp dẫn, ngon ngọt khó chối từ. Vú sữa tím có nguồn gốc từ Sóc Trăng, Hậu Giang, Cần Thơ.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(334, 'https://cdn.tgdd.vn/Products/Images/8788/312807/bhx/chanh-day-450g-550g-4-6-trai-202310101441163351.jpg', 'Chanh dây 450g - 550g', 15000.00, 0, 15000.00, NULL, NULL, 98, 'túi', '450-550g', 5.0, 'Chanh dây (Passiflora) là một loại trái cây nhiệt đới. Chanh chín có vỏ màu tím sang đậm dần. Ruột chanh vàng mọng nước. Có vị chua và mùi thơm được sử dụng nhiều trong pha chế và nấu ăn, chứa chất chống oxy hóa mạnh và nhiều loại vitamin tốt cho hệ tiêu hóa, tim mạch, tăng cường miễn dịch.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(335, 'https://cdn.tgdd.vn/Products/Images/8788/312804/bhx/thom-nu-hoang-12kg-16kg-202309091709231081.jpg', 'Thơm nữ hoàng 900g trở lên', 22000.00, 0, 22000.00, NULL, NULL, 90, 'trái', '900 trở lên', 5.0, 'Thơm nữ hoàng tươi ngon, trái từ 900g trở lên, là dòng thơm nổi tiếng xuất xứ Tiền Giang. Thơm nữ hoàng được đánh giá là giống thơm ngon nhất cả nước, có thể dùng như một loại trái cây giải nhiệt, có thể ép lấy nước, làm sinh tố, làm bánh và chế biến món ăn.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(336, 'https://cdn.tgdd.vn/Products/Images/8788/222969/bhx/sapoche-hop-1kg-5-10-trai-giao-ngau-nhien-trai-song-hoac-chin-202210250914120796.jpg', 'Sapoche 1kg', 33000.00, 0, 33000.00, NULL, NULL, 53, 'túi', '1kg', 5.0, 'Sapoche hay còn còn là hồng xiêm, là loại trái cây nhiệt đới có nguồn gốc từ Trung và Nam Mỹ. Sapoche ngọt nhất khi có vỏ chín màu vàng nâu, nhám nhẹ, khi ấn vào thấy mềm, có thể gọt vỏ ăn trực tiếp hoặc làm thành sinh tố đều rất ngon và giàu chất dinh dưỡng', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(337, 'https://cdn.tgdd.vn/Products/Images/8788/309469/bhx/me-thai-300g-202306210832313781.jpg', 'Me Thái 300g', 42000.00, 0, 42000.00, NULL, NULL, 94, 'hộp', '300g', 5.0, 'Me Thái là một trong những loại trái cây được nhiều người yêu thích bởi vị chua ngọt, thơm ngon, hấp dẫn của nó. Me Thái có thể dùng trực tiếp hoặc chế biến thành các món ăn, thức uống ngon khác cũng rất bắt vị.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(338, 'https://cdn.tgdd.vn/Products/Images/8788/309411/bhx/khe-chua-300g-6-9-trai-202306160903235011.jpg', 'Khế chua 300g', 18000.00, 5, 17100.00, NULL, NULL, 11, 'vỉ', '300g', 5.0, 'Khế chua tươi ngon, chất lượng, vỏ khế thường có màu xanh đậm, vị chua thích hợp để làm gỏi, nấu canh chua,... Ngoài ra khế chua còn là nguồn cung cấp nhiều dưỡng chất và vitamin cần thiết cho cơ thể.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(339, 'https://cdn.tgdd.vn/Products/Images/8788/317676/bhx/hop-qua-trai-cay-tet-an-khang-nk1-202311171559083059.jpg', 'Hộp quà trái cây An Khang NK1', 360000.00, 19, 291600.00, NULL, NULL, 71, 'hộp', '', 5.0, 'Hộp quà trái cây An Khang NK1 là sự kết hợp của các loại trái cây tươi ngon như cam Cara và táo Envy. Vị trái cây tươi ngọt cùng phần bao bì đóng gói đẹp mắt thích hợp để biếu, tặng cho người thân, bạn bè, đồng nghiệp.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
(340, 'https://cdn.tgdd.vn/Products/Images/8788/317677/bhx/hop-qua-trai-cay-tet-thinh-vuong-nk2-202311171613313988.jpg', 'Hộp quà trái cây Thịnh Vượng NK2', 450000.00, 20, 360000.00, NULL, NULL, 21, 'hộp', '', 5.0, 'Hộp quà trái cây Thịnh Vượng NK2 là sự kết hợp của các loại trái cây tươi ngon như táo Dazzle, kiwi, Nho đen nhập khẩu. Vị trái cây tươi ngọt cùng phần bao bì đóng gói đẹp mắt thích hợp để biếu, tặng cho người thân, bạn bè, đồng nghiệp.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
