(342, 'https://cdn.tgdd.vn/Products/Images/8788/317679/bhx/hop-qua-trai-cay-tet-sum-vay-nk3-202311171614317533.jpg', 'Hộp quà trái cây Sum Vầy NK3', 450000.00, 20, 360000.00, NULL, NULL, 91, 'hộp', '', 5.0, 'Hộp quà trái cây Sum Vầy NK3 là sự kết hợp của các loại trái cây tươi ngon như cam Cara, táo Envy, nho xanh không hạt. Vị trái cây tươi ngọt cùng phần bao bì đóng gói đẹp mắt thích hợp để biếu, tặng cho người thân, bạn bè, đồng nghiệp.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 8, 1),
