(346, 'https://cdn.tgdd.vn/Products/Images/12439/306167/bhx/sellingpoint.jpg', 'Rau củ hỗn hợp 400g', 31500.00, 0, 31500.00, NULL, NULL, 12, 'gói', '400g', 5.0, 'Rau củ hỗn hợp gồm cà rốt, khoai lang, khoai tây, khoai môn,.. tươi ngon, được gọt sẵn, cắt thành miếng vừa ăn, thích hợp để nấu canh, nấu nước dùng,... tiết kiệm thời gian cho người bận rộn, lại vô cùng dinh dưỡng, ngọt nước.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 9, 1),
