(391, 'https://cdn.tgdd.vn/Products/Images/8820/227717/bhx/gia-dau-xanh-goi-300g-202205181640375021.jpg', 'Giá đậu xanh 300g', 8800.00, 0, 8800.00, NULL, NULL, 84, 'gói', '300g', 5.0, 'Giá đậu xanh được nuôi trồng và đóng gói theo những tiêu chuẩn nghiêm ngặt, bảo đảm các tiêu chuẩn xanh - sạch, chất lượng và an toàn với người dùng. Giá giòn, ngọt thường được dùng làm rau ăn kèm cho các món có nước như bún, phở hoặc nấu canh chua, xào với thịt.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 11, 1),
