(393, 'https://cdn.tgdd.vn/Products/Images/8820/319260/bhx/cai-thia-450g-550g-dau-hao-chay-maggi-nam-huong-chai-350g-202311210827597379.jpg', 'Cải thìa 450g - 550g & Dầu hào chay Maggi chai 350g', 43000.00, 14, 36980.00, NULL, NULL, 52, 'chai', '', 5.0, NULL, NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 11, 1),
(394, 'https://cdn.tgdd.vn/Products/Images/8820/319261/bhx/cai-ngot-baby-300g-dau-hao-chay-maggi-nam-huong-chai-150g-202311210849549096.jpg', 'Cải ngọt baby 300g & Dầu hào chay Maggi chai 150g', 26500.00, 34, 17490.00, NULL, NULL, 15, 'chai', '', 5.0, NULL, NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 11, 1),
(395, 'https://cdn.tgdd.vn/Products/Images/8820/271493/bhx/ngo-gai-rau-om-goi-100g-202205181700183410.jpg', 'Ngò gai, rau om 100g', 6000.00, 0, 6000.00, NULL, NULL, 19, 'gói', '100g', 5.0, 'Ngò gai, rau om loại rau thường gặp trong các món canh chua, canh khoai mỡ,... nếu các món canh này mà thiếu đi loại rau này thì sẽ giảm mất độ ngon đi khá nhiều. Ngoài ngò gai, rau om còn làm gia vị cho các món ăn và còn có thể giúp điều trị một số loại bệnh một cách hiệu quá.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 11, 1),
(396, 'https://cdn.tgdd.vn/Products/Images/8820/299258/bhx/rau-diep-ca-goi-100g-202212090834251743.jpg', 'Rau diếp cá 100g', 6000.00, 6, 5640.00, NULL, NULL, 48, 'gói', '100g', 5.0, 'Rau diếp cá là loại rau thường được ăn sống để chấm thịt kho, cuốn bánh tráng,... Ngoài làm thực phẩm thì diếp cá còn là một vị thuốc đông y cực tốt để chữ trị một số bệnh nhẹ như táo bón, trĩ, hạ sốt,... Đặc biệt, diếp cá còn có thể giúp làm đẹp hiệu quả như: trị mụn, đẹp da,..', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 11, 1),
(397, 'https://cdn.tgdd.vn/Products/Images/8820/299257/bhx/rau-hung-cay-goi-100g-202212090837579754.jpg', 'Rau húng cây 100g', 7000.00, 0, 7000.00, NULL, NULL, 85, 'gói', '100g', 5.0, 'Rau húng cây có mùi thơm rất dễ chịu, đặc trưng và thường kết hợp với húng quế làm thành \"bộ đôi rau nêm\" góp mặt trong nhiều bữa ăn của gia đình Việt như: Phở bò, bò kho, hủ tiếu, tiết canh, các món luộc, nướng,... Ngoài ra, rau húng cây còn có thể dùng để hỗ trợ một số bệnh nhẹ như: cảm, ho,...', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 11, 1),
(398, 'https://cdn.tgdd.vn/Products/Images/8820/299256/bhx/rau-hung-que-goi-100g-202212090839472632.jpg', 'Rau húng quế 100g', 7000.00, 0, 7000.00, NULL, NULL, 77, 'gói', '100g', 5.0, 'Rau húng quế có mùi thơm rất dễ chịu, đặc trưng và thường kết hợp với húng cây làm thành \"bộ đôi rau nêm\" góp mặt trong nhiều bữa ăn của gia đình Việt như: Phở bò, bò kho, hủ tiếu, tiết canh, các món luộc, nướng,... Ngoài ra, húng quế còn có thể dùng để hỗ trợ một số bệnh nhẹ như: cảm mạo, ho,...', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 11, 1),
(399, 'https://cdn.tgdd.vn/Products/Images/8820/299254/bhx/bac-ha-khay-200g-202212090824224176.jpg', 'Bạc hà 200g', 6800.00, 0, 6800.00, NULL, NULL, 28, 'vỉ', '200g', 5.0, 'Môn to, dọc mùng, ráy dọc mùng là những tên gọi khác của môn bạc hà, một loại cây rau gia vị không thể thiếu trong những bát canh chua đậm vị, thơm ngon. Vị ngọt, giòn giòn, tính mát của bạc hà giúp tạo cảm giác ngon miệng, kích thích vị giác người ăn.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 11, 1),
(400, 'https://cdn.tgdd.vn/Products/Images/8820/299255/bhx/tia-to-goi-100g-202212090844259068.jpg', 'Tía tô 100g', 7000.00, 0, 7000.00, NULL, NULL, 9, 'gói', '100g', 5.0, 'Tía tô là một loại rau ăn kèm với các món ăn của người Việt. Vị cay cay, chát nhẹ của loại rau này được rất nhiều người yêu thích. Ngoài là một loại thực phẩm thì tía tô còn có thể hỗ trợ điều vị một số bệnh như: giúp đầu óc tỉnh táo, giảm stress, giảm đau kháng viêm....', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 11, 1),
(401, 'https://cdn.tgdd.vn/Products/Images/8820/271499/bhx/rau-can-tau-can-ta-200g-202205181637381939.jpg', 'Rau cần tàu (cần ta) 200g', 10000.00, 0, 10000.00, NULL, NULL, 61, 'gói', '200g', 5.0, 'Rau cần tàu (cần ta) gói 200g là một loại rau xanh phổ biến được rất nhiều người yêu thích bởi vì hương vị vô cùng đặc trưng, thân cây còn mềm xốp, khi ăn có vị ngọt ngon vô cùng.  Bạn có thể mua rau cần tàu về làm nguyên liệu cho nhiều món như rau cần xào mực, rau cần nấu cà chua,...', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 11, 1),
(402, 'https://cdn.tgdd.vn/Products/Images/8820/271503/bhx/rau-ram-goi-100g-202205190838444360.jpg', 'Rau răm 100g', 5500.00, 5, 5225.00, NULL, NULL, 75, 'gói', '100g', 5.0, 'Rau răm là một loại rau có vị cay, tính ấm và mùi thơm đặc trưng, thường ăn kèm với các món có tính hàn, giúp bụng của bạn tốt hơn. Rau răm thường dùng ăn kèm với hột vịt lộn, làm món đậu hũ kèm rau răm hay làm tăng gia vị cho các món kho, món gỏi,..', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 11, 1),
(403, 'https://cdn.tgdd.vn/Products/Images/8820/271485/bhx/xa-lach-lo-lo-xanh-goi-500g-202205181607134610.jpg', 'Xà lách lô lô xanh 500g', 21000.00, 0, 21000.00, NULL, NULL, 92, 'gói', '500g', 5.0, 'Rau xà lách lô lô xanh của Bách hóa Xanh được trồng tại Lâm Đồng và đóng gói theo những tiêu chuẩn nghiêm ngặt, bảo đảm các tiêu chuẩn xanh - sach. Xà lách lô lô nhiều chất xơ, hàm lượng dinh dưỡng cao, vị ngọt, giòn nên thường dùng làm rau ăn kèm cho các món cuốn', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 11, 1),
(404, 'https://cdn.tgdd.vn/Products/Images/8820/310085/bhx/xa-lach-lo-lo-xanh-500gr-202307041031480281.jpg', 'Xà lách lô lô xanh 450g - 550g', 21000.00, 0, 21000.00, NULL, NULL, 35, 'túi', ' 450-550g', 5.0, 'Rau xà lách lô lô xanh của Bách hóa Xanh được trồng tại Lâm Đồng và đóng gói theo những tiêu chuẩn nghiêm ngặt, bảo đảm các tiêu chuẩn xanh - sach. Xà lách lô lô nhiều chất xơ, hàm lượng dinh dưỡng cao, vị ngọt, giòn nên thường dùng làm rau ăn kèm cho các món cuốn', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 11, 1),
(405, 'https://cdn.tgdd.vn/Products/Images/8820/271482/bhx/xa-lach-bup-mo-goi-500g-202205181605016122.jpg', 'Xà lách búp mỡ 500g', 23000.00, 0, 23000.00, NULL, NULL, 98, 'gói', '500g', 5.0, 'Rau xà lách búp mỡ của Bách hóa Xanh được nuôi trồng tại Lâm Đồng và đóng gói theo những tiêu chuẩn nghiêm ngặt, bảo đảm các tiêu chuẩn xanh - sach, chất lượng và an toàn với người dùng. Xà lách mỡ giòn, thơm, tươi mát nên rất thích hợp làm rau ăn kèm cho các món cuốn.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 11, 1),
(406, 'https://cdn.tgdd.vn/Products/Images/8820/315536/bhx/xa-lach-carol-500g-202309281333237457.jpg', 'Xà lách carol 500g', 19500.00, 5, 18525.00, NULL, NULL, 84, 'gói', '500g', 5.0, 'Xà lách carol được đảm bảo xuất xứ Đà Lạt, là loại xà lách xoăn tròn, màu xanh tươi, có vị ngọt nhẹ, lá cứng và giòn hơn các loại khác. Xà lách carol được nhiều người yêu thích và lựa chọn cho các món cuốn, salad quen thuộc.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 11, 1),
(407, 'https://cdn.tgdd.vn/Products/Images/8820/303372/bhx/rau-thi-la-goi-100g-202303020859456110.jpg', 'Rau thì là 100g', 9500.00, 0, 9500.00, NULL, NULL, 23, 'gói', '100g', 5.0, 'Rau thì là gói 100g sạch, tươi, xanh ngon và tốt cho sức khỏe. Là loại rau gia vị thơm ngon, giúp các món ăn thêm bắt vị, kích thích vị giác tốt, còn chứa nhiều dưỡng chất thiết yếu cần thiết cho cơ thể.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 11, 1),
(408, 'https://cdn.tgdd.vn/Products/Images/8820/281516/bhx/rau-muong-nuoc-bo-la-goi-300g-202205201036026428.jpg', 'Rau muống nước bỏ lá 300g', 10000.00, 0, 10000.00, NULL, NULL, 64, 'gói', '300g', 5.0, 'Rau muống nước bỏ lá tươi ngon, xanh, sạch chứa nhiều dưỡng chất. Rau muống giòn, có thể chế biến thành nhiều món ăn ngon như rau muốn xào tỏi, rau muống trộn gỏi,... Rau muống được đảm bảo chất lượng, đạt tiêu chuẩn.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 11, 1),
(409, 'https://cdn.tgdd.vn/Products/Images/8820/271527/bhx/rau-muong-hat-500gr-202310201705212197.jpg', 'Rau muống hạt 500g', 14000.00, 0, 14000.00, NULL, NULL, 50, 'gói', '500g', 5.0, 'Rau muống hạt của Bách hóa Xanh được nuôi trồng và đóng gói theo những tiêu chuẩn nghiêm ngặt, bảo đảm các tiêu chuẩn xanh - sach, chất lượng và an toàn với người dùng. Vị ngọt, tính mát, chứa một lượng lớn vitamin, sắt nên thường được dùng trong các bữa ăn hàng ngày như xào hoặc nấu canh.', NULL, 0, 1, '2023-11-30 03:22:58', '2023-12-23 08:23:54', NULL, 11, 1);
