(503, 'https://cdn.tgdd.vn/Products/Images/8779/228921/bhx/nam-dui-ga-200g-202308291057428388.jpg', 'Nấm đùi gà 200g', 30000.00, 0, 30000.00, NULL, NULL, 43, 'vỉ', '200g', 5.0, 'Nấm được nuôi trồng và đóng gói theo những tiêu chuẩn nghiêm ngặt, bảo đảm các tiêu chuẩn xanh - sạch, chất lượng và an toàn với người dùng. Nấm đùi gà giòn dai, ngọt thịt, nhiều dinh dưỡng thường được dùng cho các món xào, chiên giòn hoặc nướng ăn kèm với các loại xốt chấm.', NULL, 0, 1, '2023-11-30 03:22:59', '2023-12-23 08:23:54', NULL, 13, 1),
(504, 'https://cdn.tgdd.vn/Products/Images/8779/301601/bhx/nam-dui-ga-baby-200g-202308291110519443.jpg', 'Nấm đùi gà baby 200g', 30000.00, 0, 30000.00, NULL, NULL, 96, 'vỉ', '200g', 5.0, 'Nấm được nuôi trồng và đóng gói theo những tiêu chuẩn nghiêm ngặt, bảo đảm các tiêu chuẩn xanh - sạch, chất lượng và an toàn với người dùng. Nấm đùi gà baby giòn dai, ngọt thịt, nhiều dinh dưỡng thường được dùng cho các món xào, chiên giòn hoặc nướng ăn kèm với các loại xốt chấm.', NULL, 0, 1, '2023-11-30 03:22:59', '2023-12-23 08:23:54', NULL, 13, 1),
(505, 'https://cdn.tgdd.vn/Products/Images/8779/226955/bhx/nam-bao-ngu-trang-goi-300g-202212021331213771.jpg', 'Nấm bào ngư trắng 300g', 20000.00, 0, 20000.00, NULL, NULL, 50, 'bịch', '300g', 5.0, 'Nấm bào ngư trắng gói 300g là một lọai nấm thơm ngon, dễ ăn, được rất nhiều người ưa chuộng. Nấm bào ngư trắng là một nguyên liệu quen thuộc cho các bữa cơm trong gia đình với nhiều món ăn ngon như nấm bào ngư xào sả ớt, nấm bào ngư xào thịt,...', NULL, 0, 1, '2023-11-30 03:22:59', '2023-12-23 08:23:54', NULL, 13, 1),
(506, 'https://cdn.tgdd.vn/Products/Images/2286/79387/bhx/dau-thuc-vat-tuong-an-cooking-oil-can-2-lit-202301271722083809.jpg', 'Dầu thực vật Tường An 2 lít', 118000.00, 0, 118000.00, NULL, NULL, 58, 'chai', '2 lít', 5.0, 'Là dầu ăn chiết xuất dầu olein nguyên chất, giàu Omega 3,6,9 và Vitamin A, E có lợi cho cơ thể, dầu thực vật Tường An Cooking Oil can 2 lít được áp dụng công nghệ tinh luyện của dầu ăn Tường An kết hợp với phương pháp tinh luyện vật lý trên các dây chuyền sản xuất hiện đại.', NULL, 0, 1, '2023-12-01 08:11:37', '2023-12-23 08:23:54', NULL, 14, 17),
(507, 'https://cdn.tgdd.vn/Products/Images/2286/231260/bhx/dau-dau-nanh-tuong-an-marvela-can-2-lit-202308081919321485.jpg', 'Dầu đậu nành Tường An Marvela 2 lít', 140000.00, 0, 140000.00, NULL, NULL, 42, 'chai', '2 lít', 5.0, 'Dầu ăn Tường An Marvela được tinh chế từ các hạt đậu nành tự nhiên chọn lọc, là sản phẩm dầu ăn bổ dưỡng, an toàn cho sức khỏe. Dầu đậu nành Tường An Marvela can 2 lít vừa đủ cho gia đình đông người, giúp tiết kiệm hơn.', NULL, 0, 1, '2023-12-01 08:11:37', '2023-12-23 08:23:54', NULL, 14, 17),
(508, 'https://cdn.tgdd.vn/Products/Images/2286/314806/bhx/dau-hat-cai-tuong-an-nguyen-chat-100-chai-1-lit-202310161504518185.jpg', 'Dầu hạt cải Tường An 1 lít', 85000.00, 0, 85000.00, NULL, NULL, 33, 'chai', '1lít', 5.0, 'Dầu hạt cải Tường An nguyên chất 100% chai 1 lít loại bỏ tạp chất có hại cho sức khỏe, giàu Vitamin A, E, Omega 3, 6, 9. Dầu ăn Tường An là nhãn hiệu dầu ăn không chứa cholesterol, không chứa chất bảo quản, đạt tiêu chuẩn an toàn vệ sinh thực phẩm.', NULL, 1, 1, '2023-12-01 08:11:37', '2023-12-23 08:23:54', NULL, 14, 17),
(509, 'https://cdn.tgdd.vn/Products/Images/2286/281583/bhx/dau-gao-lut-light-5-duong-chat-tuong-an-chai-1-lit-202302211653116963.jpg', 'Dầu gạo lứt Light 5 Tường An 1 lít', 79500.00, 0, 79500.00, NULL, NULL, 40, 'chai', '1 lít', 5.0, 'Dầu gạo lứt Light 5 dưỡng chất Tường An được kết hợp từ các loại dầu hạt tự nhiên cao cấp gồm dầu gạo lứt, dầu hạt cải, dầu đậu nành. Dầu gạo lứt Light 5 dưỡng chất Tường An 1 lít là dòng dầu ăn cao cấp tốt cho sức khỏe tim mạch và vóc dáng được các chị em nội trợ tin dùng.', NULL, 0, 1, '2023-12-01 08:11:37', '2023-12-23 08:23:54', NULL, 14, 17),
(510, 'https://cdn.tgdd.vn/Products/Images/2286/228303/bhx/dau-me-thom-tuong-an-chai-250ml-202308172253347684.jpg', 'Dầu mè thơm Tường An 250ml', 75500.00, 0, 75500.00, NULL, NULL, 99, 'chai', '', 5.0, 'Dầu mè thơm Tường An chai 250ml là sản phẩm dầu mè chất lượng, được rang ép từ 100% hạt mè tự nhiên, chứa nhiều dinh dưỡng tốt cho sức khỏe: Chất béo no không bão hòa, axit béo Omega 3, 6, canxi, vitamin E, B,... của thương hiệu dầu ăn Tường An.', NULL, 0, 1, '2023-12-01 08:11:37', '2023-12-23 08:23:54', NULL, 14, 17),
