(582, 'https://cdn.tgdd.vn/Products/Images/2804/275661/bhx/sellingpoint.jpg', 'Đường phèn nguyên chất Anh Đăng gói 1kg', 61900.00, 0, 61900.00, NULL, NULL, 41, 'túi', '1kg', 5.0, 'Đường phèn Anh Đăng là loại đường phèn được sản xuất từ giống mía tốt nhất thông qua quá trình kết tinh tự nhiên với tiêu chuẩn cao nhất. Đường phèn nguyên chất Anh Đăng gói 1kg  với 100% siro đường mía nguyên chất, an toàn, thích hợp cho món ăn hàng ngày, mì, hủ tiếu, cà phê, nước chấm và làm bánh.', NULL, 0, 1, '2023-12-01 08:11:37', '2023-12-23 08:23:54', NULL, 17, 31),
(583, 'https://cdn.tgdd.vn/Products/Images/2804/275659/bhx/sellingpoint.jpg', 'Đường thốt nốt nguyên chất Anh Đăng hộp 300g', 54900.00, 0, 54900.00, NULL, NULL, 44, 'hộp', '300g', 5.0, 'Đường thốt nốt là một sản phẩm được rất nhiều người yêu thích bởi được chứng minh rất tốt cho sức khỏe. Đường thốt nốt Anh Đăng hộp 300g mang đến cho bạn sự tự nhiên hoàn toàn từ dung dịch chiết xuất từ hoa cây thốt nốt đực. Chọn mua đường thốt nốt Anh Đăng cho những món ăn thêm ngon bạn nhé.', NULL, 0, 1, '2023-12-01 08:11:37', '2023-12-23 08:23:54', NULL, 17, 31),
(584, 'https://cdn.tgdd.vn/Products/Images/2804/275657/bhx/sellingpoint.jpg', 'Đường phèn nâu Anh Đăng gói 500g', 39900.00, 0, 39900.00, NULL, NULL, 96, 'túi', '500g', 5.0, 'Đường được sử dụng nhiều cho cả nấu ăn và pha chế hằng ngày trong mỗi gia đình. Đường phèn nâu Anh Đăng gói 500g sử dụng nguyên liệu đường thô nguyên chất có vị ngọt thanh mát và không chứa các hóa chất độc hại. Đường Anh Đăng cung cấp các sản phẩm đường đảm bảo an toàn cho sức khỏe người dùng.', NULL, 0, 1, '2023-12-01 08:11:37', '2023-12-23 08:23:54', NULL, 17, 31),
(585, 'https://cdn.tgdd.vn/Products/Images/2804/77181/bhx/sellingpoint.jpg', 'Đường phèn bột Anh Đăng gói 500g', 33300.00, 0, 33300.00, NULL, NULL, 47, 'gói', '500g', 5.0, 'Chiết xuất từ những cây mía nguyên chất, an toàn với người sử dụng. Sản phẩm có màu trắng, hương vị đặc trưng. Sản phẩm không có chất phụ gia, không hóa chất tẩy trắng, không chất bảo quản, chính vì thế khi ăn bạn vẫn cảm nhận được vị mát, ngọt thanh và không gây chua miệng sau khi sử dụng.', NULL, 0, 1, '2023-12-01 08:11:37', '2023-12-23 08:23:54', NULL, 17, 31),
(586, 'https://cdn.tgdd.vn/Products/Images/2804/77184/bhx/sellingpoint.jpg', 'Đường phèn hạt Anh Đăng gói 500g', 29900.00, 0, 29900.00, NULL, NULL, 45, 'gói', '500g', 5.0, 'Chiết xuất từ những cây mía nguyên chất, an toàn với người sử dụng. Sản phẩm có màu trắng tinh, hương vị đặc trưng, không có chất phụ gia, chất tẩy trắng, chất bảo quản, chính vì thế khi ăn bạn vẫn cảm nhận được vị mát, ngọt thanh và không gây chua miệng sau khi sử dụng, hạt nhỏ dễ hoà tan.', NULL, 0, 1, '2023-12-01 08:11:37', '2023-12-23 08:23:54', NULL, 17, 31),
(587, 'https://cdn.tgdd.vn/Products/Images/2804/207731/bhx/sellingpoint.jpg', 'Đường thốt nốt Moun7ains gói 500g', 31500.00, 0, 31500.00, NULL, NULL, 84, 'gói', '500g', 5.0, 'Đường thốt nốt không chỉ thay thế cho các chất tạo ngọt khác trong các bữa ăn mà còn mang đến nhiều lợi ích về sức khỏe đến từ đường Moun7ains. Đường thốt nốt dạng viên Moun7ains gói 500g mang đến hương vị đặc trưng, thơm ngon, khó cưỡng cho mọi món ăn của bạn.', NULL, 0, 1, '2023-12-01 08:11:37', '2023-12-23 08:23:54', NULL, 17, 32),
