(592, 'https://cdn.tgdd.vn/Products/Images/2806/82259/bhx/hat-nem-vi-heo-aji-ngon-goi-400g-202303281033540192.jpg', 'Hạt nêm vị heo Aji-ngon 400g', 33000.00, 0, 33000.00, NULL, NULL, 14, 'gói', '', 5.0, 'Sản phẩm được làm từ nước dùng của xương và thịt heo cùng với một lượng cân đối các loại gia vị khác. Hạt nêm vị heo Aji-ngon 400g là đến từ loại hạt nêm mang lại hương vị thơm ngon tự nhiên cho món ăn của gia đình bạn. Hạt nêm Aji-ngon gói nhỏ phù hợp nhu cầu sử dụng gia đình và dễ mang đi.', NULL, 0, 1, '2023-12-01 08:11:37', '2023-12-23 08:23:54', NULL, 18, 33);
