(596, 'https://cdn.tgdd.vn/Products/Images/2806/203953/bhx/bot-ngot-hat-lon-vedan-goi-1kg-202202121347183629.jpg', 'Bột ngọt hạt lớn Vedan 1kg', 67000.00, 0, 67000.00, NULL, NULL, 60, 'gói', '', 5.0, 'Là loại bột ngọt được sản xuất bằng phương pháp lên men từ nguồn nguyên liệu chất lượng, bột ngọt hạt lớn Vedan gói 1kg góp phần làm nên bữa ăn ngon của gia đình Việt đến từ thương hiệu bột ngọt Vedan. Đóng gói lớn thích hợp trong chế biến món ăn tại gia, giúp người dùng tiết kiệm\r\n', NULL, 0, 1, '2023-12-01 08:11:37', '2023-12-23 08:23:54', NULL, 18, 34),
(597, 'https://cdn.tgdd.vn/Products/Images/2806/103186/bhx/bot-ngot-hat-nho-vedan-goi-1kg-202202121346216590.jpg', 'Bột ngọt hạt nhỏ Vedan 1kg', 65000.00, 0, 65000.00, NULL, NULL, 42, 'gói', '', 5.0, 'Là loại bột ngọt hạt nhỏ được sản xuất bằng phương pháp lên men từ nguồn nguyên liệu chất lượng. Bột ngọt hạt nhỏ Vedan gói 1kg góp phần làm nên bữa ăn ngon của gia đình Việt đến từ bột ngọt hạt nhỏ Vedan. Thích hợp dùng cho nhà hàng và trong công nghiệp giúp chế biến nhanh hơn, tiết kiệm hơn.', NULL, 0, 1, '2023-12-01 08:11:37', '2023-12-23 08:23:54', NULL, 18, 34),
(598, 'https://cdn.tgdd.vn/Products/Images/2806/193202/bhx/hat-nem-thit-heo-vedan-goi-1kg-202203161521290963.jpg', 'Hạt nêm thịt heo Vedan 1kg', 66500.00, 0, 66500.00, NULL, NULL, 31, 'gói', '', 5.0, 'Là sự kết hợp tinh tế giữa hỗn hợp gia vị gồm có: đường, tinh bột biến tính, nước tương, bột thịt heo chiết xuất, hương thịt, hương hành, bột hành… giúp giữ trọn hương vị của nguyên liệu và phù hợp với tất cả các món ăn. Sản phẩm đã được đóng gói kín đáo, dày dặn và hợp vệ sinh.', NULL, 0, 1, '2023-12-01 08:11:37', '2023-12-23 08:23:54', NULL, 18, 34),
