(677, 'https://cdn.tgdd.vn/Products/Images/2567/76915/bhx/tuong-hot-cholimex-hu-250g-202203181505330415.jpg', 'Tương hột Cholimex 250g', 11300.00, 0, 11300.00, NULL, NULL, 99, 'hũ', '', 5.0, 'Sản phẩm tương hột của thương hiệu tương đen, tương hột Cholimex có độ sánh và ánh vàng tạo sự ngon miệng. Tương hột Cholimex hũ 250g với hạt đậu nành mềm, béo, có thơm bùi đặc trưng. Dùng ăn liền hoặc chế biến các món chay và mặn: cá chưng tương, tương gỏi cuốn,...', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 19, 43),
(678, 'https://cdn.tgdd.vn/Products/Images/2567/76914/bhx/tuong-den-cholimex-chai-230g-202209101109467075.png', 'Tương đen Cholimex 230g', 10000.00, 0, 10000.00, NULL, NULL, 6, 'chai', '', 5.0, 'Tương đen Cholimex được làm từ các hạt đậu nành nguyên chất, thông qua qui trình lên men được kiểm nghiệm nghiêm ngặt. Tương đen Cholimex chai 230g dung tích nhỏ, thích hợp với nhu cầu gia đình ít người. Tương đen cũng thích hợp chấm kèm với nhiều món ăn, đặc biệt là phở.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 19, 43),
(679, 'https://cdn.tgdd.vn/Products/Images/2567/82710/bhx/tuong-den-pho-cholimex-chai-230g-202202161417415934.jpg', 'Tương đen phở Cholimex 230g', 9000.00, 0, 9000.00, NULL, NULL, 32, 'chai', '', 5.0, 'Tương đen Cholimex được làm từ các hạt đậu nành nguyên chất, thông qua quy trình lên men được kiểm nghiệm nghiêm ngặt. Tương đen rất thích hợp chấm kèm với nhiều món ăn thịt nướng, vịt quay Bắc Kinh, xá xíu... Tương đen phở Cholimex chai 230g đặc biệt ngon khi dùng với phở.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 19, 43),
(680, 'https://cdn.tgdd.vn/Products/Images/2567/96201/bhx/tuong-ot-cholimex-chai-130g-202203172141011659.jpg', 'Tương ớt Cholimex 130g', 8000.00, 0, 8000.00, NULL, NULL, 40, 'chai', '', 5.0, 'Tương ớt Cholimex sản xuất bằng công nghệ thanh trùng chân không, giữ lại hương vị, màu sắc tự nhiên của tương ớt, mà vẫn đảm bảo vệ sinh an toàn thực phẩm. Tương ớt Cholimex chai 130g với vị thơm cay tự nhiên, cho món ăn thêm đậm đà, hấp dẫn, chai nhỏ dễ dàng mang đi.\r\n', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 19, 43),
(681, 'https://cdn.tgdd.vn/Products/Images/2567/287294/bhx/tuong-ot-tron-5-vi-cay-dam-knorr-chai-450g-202209010838155563.jpg', 'Tương ớt cay đậm Knorr 450g', 25000.00, 0, 25000.00, NULL, NULL, 4, 'chai', '', 5.0, 'Tương ớt tròn 5 vị là dòng sản phẩm mới của thương hiệu tương ớt Knorr. Tương ớt tròn 5 vị cay đậm Knorr chai 450g tạo nên từ những nguyên liệu được chọn lọc theo TỈ LỆ VÀNG ĐỘC ĐÁO của Knorr cho vị cay đậm đà, đã chấm là phải mê.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 19, 35),
(682, 'https://cdn.tgdd.vn/Products/Images/2567/229139/bhx/tuong-ot-tron-5-vi-cay-dam-knorr-chai-220g-202209201011246058.jpg', 'Tương ớt cay đậm Knorr 220g', 16000.00, 0, 16000.00, NULL, NULL, 99, 'chai', '', 5.0, 'Tương ớt Knorr là sản phẩm tương ớt được phối trộn theo công thức tỷ lệ vàng độc đáo. Tương ớt tròn 5 vị cay đậm Knorr chai 220g tạo nên từ ớt tươi lên men tự nhiên, tỏi ngâm giấm, hành phi, muối biển và đường mía cho ra vị cay đậm đà, ngon khó cưỡng.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 19, 35),
(683, 'https://cdn.tgdd.vn/Products/Images/2567/229140/bhx/tuong-ot-tron-5-vi-cay-vua-knorr-chai-220g-202209200947455898.jpg', 'Tương ớt cay tê tê Knorr 220g', 16000.00, 0, 16000.00, NULL, NULL, 81, 'chai', '', 5.0, 'Tương ớt Knorr là sản phẩm tương ớt được phối trộn theo công thức tỷ lệ vàng độc đáo cho vị cay ngon tê tê ngay đầu lưỡi đầy hấp dẫn, thích hợp cho mọi món ăn. Tương ớt tròn 5 vị cay vừa Knorr chai 220g với độ mặn, ngọt, chua, hài hòa vị cay vừa phải, càng chấm lại càng thấy ngon.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 19, 35),
(684, 'https://cdn.tgdd.vn/Products/Images/2567/113233/bhx/xot-mayonnaise-ajinomoto-vi-chua-beo-chai-260g-202308091620330952.jpg', 'Xốt mayonnaise Ajinomoto 260g', 37000.00, 19, 29970.00, NULL, NULL, 7, 'chai', '', 5.0, 'Xốt mayonnaise của thương hiệu xốt mayonnaise Ajinomoto được sản xuất theo công nghệ của Nhật Bản. Sản phẩm Xốt mayonnaise Ajinomoto vị nguyên bản chai 260g làm từ trứng gà tươi và dầu thực vật với hương vị chua béo kích thích vị giác, phù hợp với nhiều món ăn khác nhau.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 19, 36),
(685, 'https://cdn.tgdd.vn/Products/Images/2567/76378/bhx/xot-mayonnaise-ajinomoto-aji-mayo-chua-beo-chai-130g-202308091622459388.jpg', 'Xốt mayonnaise Ajinomoto 130g', 21500.00, 0, 21500.00, NULL, NULL, 90, 'gói', '', 5.0, 'Là xốt gia vị đa năng phù hợp với nhiều món ăn, đặc biệt là các món chấm và trộn salad. Vị chua béo hài hòa của sản phẩm không những hợp khẩu vị người Việt mà còn mang đến vị ngon tuyệt vời cho các món rau, giúp con bạn ăn thật nhiều rau mỗi ngày.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 19, 36),
(687, 'https://cdn.tgdd.vn/Products/Images/2567/224531/bhx/tuong-ot-nam-duong-horeca-chai-800g-202203172314358211.jpg', 'Tương ớt Nam Dương Horeca 800g', 21000.00, 0, 21000.00, NULL, NULL, 31, 'chai', '', 5.0, 'Được chế biến từ tỏi, ớt nguyên chất, có hương vị đặc biệt thơm ngon, màu sắc bắt mắt từ tương ớt Nam Dương. Tương ớt Nam Dương Horeca chai 800g mùi thơm dịu độc đáo và hương vị cay ngon hấp dẫn, là loại tương ớt dùng chấm trực tiếp hoặc tẩm ướp thức ăn.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 19, 29);
