(688, 'https://cdn.tgdd.vn/Products/Images/2567/209453/bhx/sellingpoint.jpg', 'Tương ớt Nam Dương 470g', 16700.00, 0, 16700.00, NULL, NULL, 83, 'chai', '', 5.0, 'Được chế biến từ tỏi, ớt nguyên chất, có hương vị đặc biệt thơm ngon, màu sắc bắt mắt đến từ thương hiệu tương ớt Nam Dương. Tương ớt Nam Dương 470g mùi thơm dịu độc đáo và hương vị cay ngon hấp dẫn, là loại tương ớt dùng chấm trực tiếp hoặc tẩm ướp thức ăn, giúp tăng thêm hương vị cho món ăn.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 19, 29),
(689, 'https://cdn.tgdd.vn/Products/Images/2567/224822/bhx/tuong-ca-nam-duong-chai-500g-202203172258382526.jpg', 'Tương cà Nam Dương 500g', 19000.00, 0, 19000.00, NULL, NULL, 20, 'chai', '', 5.0, 'Tương cà của thương hiệu tương cà Nam Dương là loại tương thiết yếu trong tủ bếp của mỗi gia đình. Tương cà Nam Dương 500g rất an toàn, không có đường hóa học hay hóa chất độc hại, dùng kèm với món nướng, chiên, rán như hải sản nướng, cá chiên, gà rán,...', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 19, 29),
(690, 'https://cdn.tgdd.vn/Products/Images/2567/224529/bhx/tuong-den-nam-duong-chai-255g-202308091626274507.jpg', 'Tương đen Nam Dương 255g', 12000.00, 0, 12000.00, NULL, NULL, 52, 'chai', '', 5.0, 'Tương đen của thương hiệu tương đen Nam Dương được làm từ hạt đậu nành nguyên chất, thông qua qui trình lên men được kiểm nghiệm nghiêm ngặt. Sản phẩm tương đen Nam Dương chai 250g thích hợp với nhu cầu gia đình ít người, rất ngon khi dùng để chấm kèm với món ăn, đặc biệt là phở.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 19, 29),
(691, 'https://cdn.tgdd.vn/Products/Images/2567/174515/bhx/tuong-ot-cay-dac-biet-nam-duong-chai-250g-202203172205140361.jpg', 'Tương ớt cay Nam Dương 250g', 11700.00, 0, 11700.00, NULL, NULL, 98, 'chai', '', 5.0, 'Được chế biến từ tỏi, ớt nguyên chất, có hương vị đặc biệt thơm ngon, màu sắc bắt mắt đến từ tương ớt Nam Dương. Tương ớt Nam Dương cay đặc biệt chai 250g với màu đỏ của tương ớt tự nhiên mịn màng, mùi thơm dịu độc đáo và hương vị cay ngon hấp dẫn, tuyệt đối không sử dụng vị cay nhân tạo.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 19, 29),
(692, 'https://cdn.tgdd.vn/Products/Images/2567/209459/bhx/tuong-ca-nam-duong-chai-265g-202203172311005417.jpg', 'Tương cà Nam Dương 265g', 11500.00, 0, 11500.00, NULL, NULL, 31, 'chai', '', 5.0, 'Tương cà Nam Dương là loại tương cà không sử dụng màu tổng hợp, an toàn cho sức khỏe. Tương cà Nam Dương 265g làm từ cà chua tươi sạch được chọn lọc kỹ lưỡng, rất ngon khi dùng với các món nướng, chiên hoặc làm gia vị tẩm ướp thực phẩm.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 19, 29),
(693, 'https://cdn.tgdd.vn/Products/Images/2567/283101/bhx/tuong-ot-cay-vua-nam-duong-chai-255g-202207081046071974.png', 'Tương ớt Nam Dương 255g', 10800.00, 0, 10800.00, NULL, NULL, 63, 'chai', '', 5.0, 'Tương ớt cay vừa Nam Dương chai 255g là loại tương ớt với thành phần 100% ớt được chọn lọc kĩ lưỡng, với hương thơm từ tỏi, cà chua cùng những loại gia vị khác khiến cho tương ớt Nam Dương có một hương vị thơm ngon, đậm đà hơn khi dùng làm nước chấm, hoặc chế biến cùng các món ăn khác.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 19, 29),
(694, 'https://cdn.tgdd.vn/Products/Images/2567/208213/bhx/tuong-ot-xanh-ong-cha-va-chai-210g-202203172332301557.jpg', 'Tương ớt xanh Ông Chà Và 210g', 16500.00, 0, 16500.00, NULL, NULL, 19, 'chai', '', 5.0, 'Tương ớt Ông Chà Và giúp các món ăn thêm đậm đà và mang đến cho bạn những bữa ăn ngon miệng. Tương ớt xanh Ông Chà Và chai 210g được làm từ những nguyên liệu hoàn toàn tự nhiên với vị ớt xanh bùng vị cay hít hà, kích thích vị giác. Tương ớt dùng để chấm, nêm, tẩm ướt cho các món ăn.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 19, 44),
(695, 'https://cdn.tgdd.vn/Products/Images/2567/76920/bhx/tuong-ot-chai-dep-ong-cha-va-250g-202310111618075868.jpg', 'Tương ớt Ông Chà Và 280g', 11000.00, 0, 11000.00, NULL, NULL, 7, 'chai', '', 5.0, 'Tương ớt Ông Chà Và giúp các món ăn thêm đậm đà và mang đến cho bạn những bữa ăn ngon miệng. Tương ớt Ông Chà Và chai 280g được làm từ những nguyên liệu hoàn toàn tự nhiên, bùng vị cay hít hà, kích thích vị giác. Tương ớt dùng để chấm, nêm, tẩm ướt cho các món ăn.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 19, 44),
(696, 'https://cdn.tgdd.vn/Products/Images/2567/231101/bhx/sot-mayonnaise-simply-chai-230g-202202162304124110.jpg', 'Xốt mayonnaise Simply 230g', 37000.00, 0, 37000.00, NULL, NULL, 75, 'chai', '', 5.0, 'Xốt mayonnaise Simply 230g là loại xốt mayonnaise cao cấp tuyệt hảo với thành phần dầu gạo lứt tốt cho sức khoẻ tim mạch, đặc biệt không chứa chất tạo màu. Xốt mayonnaise Simply đa dụng có thể dùng để chấm trực tiếp, trộn salad hoặc ăn kèm với các món như bánh mì, sandwich,...', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 19, 19),
(697, 'https://cdn.tgdd.vn/Products/Images/2567/231104/bhx/sot-mayonnaise-simply-huong-gao-rang-chai-230g-202203101326532196.jpg', 'Xốt mayonnaise gạo Simply 230g', 37000.00, 0, 37000.00, NULL, NULL, 55, 'chai', '', 5.0, 'Xốt mayonnaise Simply là loại xốt mayonnaise dùng để chấm trực tiếp, trộn salad hoặc ăn kèm với các món như bánh mì, sandwich,... Xốt mayonnaise hương gạo rang Simply chai 230g với thành phần dầu gạo lứt tốt cho tim mạch cùng vị chua nhẹ và mùi thơm từ gạo rang, không chứa chất tạo màu.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 19, 19),
(698, 'https://cdn.tgdd.vn/Products/Images/2567/219585/bhx/xot-mayonnaise-golden-farm-chai-250g-202308091625027067.jpg', 'Xốt mayonnaise Golden Farm chai 250g', 39500.00, 0, 39500.00, NULL, NULL, 47, 'chai', '', 5.0, 'Xốt mayonnaise của thương hiệu xốt Mayonnaise Golden Farm là loại xốt ngon đậm đặc, chuẩn vị Âu. Xốt mayonnaise Golden Farm chai 250g với chất lượng tuyệt hảo, dùng để trộn rau salad hoặc làm nước chấm cho các món chiên, nướng.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 19, 45),
(699, 'https://cdn.tgdd.vn/Products/Images/7779/219586/bhx/sellingpoint.jpg', 'Xốt salad mè Golden Farm 250ml', 49500.00, 0, 49500.00, NULL, NULL, 70, 'chai', '250ml', 5.0, 'Là loại nước chấm thơm ngon tuyệt hảo đến từ thương hiệu nước chấm Golden Farm. Xốt salad mè rang Golden Farm chai 250ml mang đến vị ngon tươi mới, hậu chua thanh, mặn ngọt vừa phải, nổi bật với hương vị tinh tế của ẩm thực Việt, được căn chỉnh hoài hòa theo khẩu vị và sở thích của người Việt.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 19, 45),
