(770, 'https://cdn.tgdd.vn/Products/Images/8271/91389/bhx/nuoc-dung-co-dac-lau-thai-sg-food-goi-180g-202209081046384729.jpg', 'Nước nấu lẩu Thái SG Food 180g', 22000.00, 0, 22000.00, NULL, NULL, 19, 'gói', '', 5.0, 'Dạng sốt gia vị nêm sẵn của thương hiệu gia vị nêm sẵn SG Food được xem là trợ thủ đắc lực cho mọi nhà trong những ngày bận rộn. Nước dùng cô đặc lẩu thái SG Food gói 180g giúp tiết kiệm thời gian trong khâu sơ chế, chế biến mang đến món lẩu Thái thơm ngon và đầy đủ chất dinh dưỡng.', NULL, 1, 1, '2023-12-01 08:11:38', '2024-01-01 05:39:50', NULL, 21, 16),
(771, 'https://cdn.tgdd.vn/Products/Images/8271/311419/bhx/sot-ca-chua-co-dac-ong-cha-va-hop-210g-202308210912160754.jpg', 'Sốt cà chua cô đặc Ông Chà Và 210g', 20000.00, 0, 20000.00, NULL, NULL, 32, 'lon', '', 5.0, 'Sốt cà chua cô đặc Ông Chà Và hộp 210g được làm từ những trái cà chua tươi sạch, chất lượng. Gia vị nêm sẵn Ông Chà Và nhãn hiệu được nhiều người biết đến với các sản phẩm gia vị nêm sẵn chất lượng, không chất bảo quản, không phẩm màu an toàn cho sức khỏe.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 21, 44),
(772, 'https://cdn.tgdd.vn/Products/Images/8271/311440/bhx/cot-nau-pho-bo-ong-cha-va-goi-90g-202308172223365926.jpg', 'Cốt nấu phở bò Ông Chà Và 90g', 14900.00, 0, 14900.00, NULL, NULL, 1, 'gói', '', 5.0, 'Cốt phở bò Ông Chà Và gói 90g là sản phẩm gia vị nêm sẵn nấu từ nước xương hầm và cô đặc theo công nghệ hiện đại giúp cho việc nấu phở trở nên nhanh chóng hơn. Gia vị nêm sẵn Ông Chà Và mang đến hương vị phở bò thơm ngon hấp dẫn mà không tốn nhiều thời gian vào bếp.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 21, 44),
(773, 'https://cdn.tgdd.vn/Products/Images/8271/311437/bhx/cot-bun-rieu-cua-ong-cha-va-goi-90g-202308172222036804.jpg', 'Cốt bún riêu cua Ông Chà Và 90g', 14900.00, 0, 14900.00, NULL, NULL, 11, 'gói', '', 5.0, 'Cốt bún riêu cua Ông Chà Và gói 90g là sản phẩm gia vị nêm sẵn tiện lợi, dễ dàng chế biến và sử dụng, dùng nấu nước lèo bún riêu, bún riêu cua, canh bún,…Gia vị nêm sẵn Ông Chà Và chiết xuất từ nguyên liệu tự nhiên, đảm bảo an toàn vệ sinh thực phẩm.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 21, 44),
(774, 'https://cdn.tgdd.vn/Products/Images/8271/311436/bhx/cot-hu-tieu-nam-vang-ong-cha-va-goi-90g-202308172227195111.jpg', 'Cốt hủ tiếu Nam Vang Ông Chà Và 90g', 14900.00, 0, 14900.00, NULL, NULL, 51, 'gói', '', 5.0, 'Cốt hủ tiếu Nam Vang Ông Chà Và gói 90g là sản phẩm gia vị nêm sẵn nấu hủ tiếu chiết xuất từ cốt thịt heo và nguyên liệu thiên nhiên không hoá chất, mang đến hương vị hủ tiếu Nam Vang thơm ngon, đúng chuẩn. Gia vị nêm sẵn Ông Chà Và mang tính tiện dụng, dễ dàng chế biến và thưởng thức.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 21, 44),
(775, 'https://cdn.tgdd.vn/Products/Images/8271/311439/bhx/cot-pho-ga-ong-cha-va-goi-90g-202308172222493958.jpg', 'Cốt phở gà Ông Chà Và 90g', 14900.00, 0, 14900.00, NULL, NULL, 19, 'gói', '', 5.0, 'Cốt phở gà Ông Chà Và gói 90g là sản phẩm gia vị nêm sẵn làm từ những nguyên liệu tự nhiên, mang đến hương vị phở gà thơm ngon hấp dẫn mà không tốn nhiều thời gian vào bếp. Gia vị nêm sẵn Ông Chà Và đảm bảo vệ sinh thực phẩm, an toàn cho sức khỏe người sử dụng.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 21, 44),
(776, 'https://cdn.tgdd.vn/Products/Images/8271/311438/bhx/cot-nau-bun-bo-hue-ong-cha-va-goi-90g-202308172226369185.jpg', 'Cốt nấu bún bò Huế Ông Chà Và 90g', 14900.00, 0, 14900.00, NULL, NULL, 43, 'gói', '', 5.0, 'Cốt nấu bún bò Huế Ông Chà Và gói 90g là sản phẩm gia vị nêm sẵn chiết xuất từ xương bò và nguyên liệu thiên nhiên không hoá chất, tiện lợi, dễ dàng chế biến và sử dụng. Gia vị nêm sẵn Ông Chà Và mang lại hương vị thơm ngon đúng chuẩn cho món ăn, an toàn cho sức khỏe.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 21, 44),
(777, 'https://cdn.tgdd.vn/Products/Images/8271/311442/bhx/sot-nau-canh-chua-ong-cha-va-goi-90g-202308172224021666.jpg', 'Sốt nấu canh chua Ông Chà Và 90g', 10900.00, 0, 10900.00, NULL, NULL, 56, 'gói', '', 5.0, 'Sốt nấu canh chua Ông Chà Và gói 90g là sản phẩm gia vị nêm sẵn làm từ nguyên liệu tự nhiên, dùng được cho cả món chay và mặn. Gia vị nêm sẵn Ông Chà Và giúp cho việc nấu nướng trở nên dễ dàng và nhanh chóng hơn mà vẫn đảm bảo hương vị thơm ngon đúng chuẩn cho món ăn.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 21, 44);
