(779, 'https://cdn.tgdd.vn/Products/Images/8271/311446/bhx/sot-suon-xao-chua-ngot-ong-cha-va-goi-90g-202308172225411427.jpg', 'Sốt sườn xào chua ngọt Ông Chà Và 90g', 10900.00, 0, 10900.00, NULL, NULL, 77, 'gói', '', 5.0, 'Sốt sườn xào chua ngọt Ông Chà Và gói 90g là sản phẩm gia vị nêm sẵn dùng để nấu sườn xào chua ngọt, cánh gà chua ngọt, đậu hũ nhồi thịt sốt cà chua... mang đến hương vị chua ngọt ngon khó cưỡng. Gia vị nêm sẵn Ông Chà Và đảm bảo vệ sinh thực phẩm, an toàn cho sức khỏe.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 21, 44),
(780, 'https://cdn.tgdd.vn/Products/Images/8271/309447/bhx/vien-gia-vi-hu-tieu-chay-nam-vang-ong-cha-va-hop-75g-202308091541365527.jpg', 'Viên nấu hủ tiếu chay Ông Chà Và 75g', 8000.00, 0, 8000.00, NULL, NULL, 35, 'hộp', '', 5.0, 'Viên gia vị hủ tiếu chay Nam Vang Ông Chà Và hộp 75g mang đến hương vị hủ tiếu chay Nam Vang thơm ngon đúng chuẩn. Đây là loại gia vị nêm sẵn dạng viên của thương hiệu gia vị nêm sẵn Ông Chà Và giúp tiết kiệm thời gian chế biến, nhưng vẫn mang đến món ăn thơm ngon, an toàn.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 21, 44),
(781, 'https://cdn.tgdd.vn/Products/Images/8271/309448/bhx/vien-gia-vi-sup-chay-ong-cha-va-hop-75g-202308091542068978.jpg', 'Viên nấu súp chay Ông Chà Và 75g', 8000.00, 0, 8000.00, NULL, NULL, 46, 'hộp', '', 5.0, 'Viên gia vị súp chay Ông Chà Và hộp 75g  là sản phẩm gia vị nêm sẵn dạng viên nổi tiếng của gia vị nêm sẵn Ông Chà Và. Không những mang đến hương vị súp chay thơm ngon, an toàn cho sức khỏe mà còn giúp tiết kiệm thời gian chế biến.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 21, 44),
(782, 'https://cdn.tgdd.vn/Products/Images/8271/309446/bhx/vien-gia-vi-bun-rieu-chay-ong-cha-va-hop-75g-202308091538410878.jpg', 'Viên nấu bún riêu chay Ông Chà Và 75g', 8000.00, 0, 8000.00, NULL, NULL, 25, 'hộp', '', 5.0, 'Viên gia vị bún riêu chay Ông Chà Và hộp 75g là loại gia vị nêm sẵn dạng viên rất được ưa chuộng của thương hiệu gia vị nêm sẵn Ông Chà Và. Viên gia vị giúp tiết kiệm thời gian chế biến mà vẫn mang đến cho người dùng hương vị bún riêu chay thơm ngon.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 21, 44),
(783, 'https://cdn.tgdd.vn/Products/Images/8271/225395/bhx/sot-uop-thit-bbq-dh-food-hu-200g-202203111724041118.png', 'Sốt ướp thịt BBQ DH Foods 200g', 27000.00, 0, 27000.00, NULL, NULL, 83, 'hũ', '', 5.0, 'Là loại gia vị nêm sẵn mang lại sự tiện lợi, tiết kiệm thời gian nấu nướng của thương hiệu gia vị nêm sẵn Dh Foods. Sốt ướp thịt BBQ ướp thịt nướng DH Foods 200g với vị chua ngọt tuyệt vời của tương cà chua và hương khói đặc trưng của món nướng cho bữa tiệc nướng trở nên dễ dàng hơn bao giờ hết.', NULL, 1, 1, '2023-12-01 08:11:38', '2024-01-01 05:40:03', NULL, 21, 40),
(784, 'https://cdn.tgdd.vn/Products/Images/8271/216083/bhx/gia-vi-nau-pho-bo-ha-noi-dh-food-natural-goi-24g-202203111610018218.jpg', 'Gia vị phở bò Hà Nội DH Foods 24g', 15600.00, 0, 15600.00, NULL, NULL, 38, 'gói', '', 5.0, 'Là loại gia vị nêm sẵn cần thiết cho mọi món ăn trong gia đình đến từ thương hiệu gia vị nêm sẵn Dh Foods. Gia vị nấu phở bò Hà Nội DH Foods Natural gói 24g là sự tích hợp các gia vị tự nhiên cùng túi lọc tiện dụng, giúp ai cũng có thể tự tay vào bếp chiêu đãi cả nhà món phở bò.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 21, 40),
(785, 'https://cdn.tgdd.vn/Products/Images/8271/216086/bhx/gia-vi-nau-pho-bo-sai-gon-dh-food-natural-goi-25g-202203110803253879.jpg', 'Gia vị phở bò Sài Gòn DH Foods 25g', 15600.00, 0, 15600.00, NULL, NULL, 41, 'gói', '', 5.0, 'Là loại gia vị nêm sẵn cần thiết cho mọi món ăn trong gia đình đến từ thương hiệu gia vị nêm sẵn Dh Foods. Gia vị nấu phở bò Sài Gòn DH Foods Natural gói 25g làm từ các gia vị tự nhiên cùng túi lọc tiện dụng, giúp các bạn trẻ cũng có thể tự tay vào bếp chiêu đãi cả nhà.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 21, 40),
(786, 'https://cdn.tgdd.vn/Products/Images/8271/239122/bhx/gia-vi-nau-bun-bo-hue-dh-food-goi-25g-202203111143389805.jpg', 'Gia vị bún bò Huế DH Food 25g', 15000.00, 0, 15000.00, NULL, NULL, 91, 'gói', '', 5.0, 'Là loại gia vị nêm sẵn cần thiết cho mọi món ăn trong gia đình đến từ thương hiệu gia vị Dh Foods. Gia vị nấu bún bò Huế DH Food gói 25g được chế biến với “tỉ lệ vàng”, mang đến nước dùng đậm đà, mùi thơm từ sả, vị cay từ ớt và màu sắc bắt từ hạt điều màu, cực kì kích thích vị giác người dùng.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 21, 40),
(787, 'https://cdn.tgdd.vn/Products/Images/8271/216089/bhx/gia-vi-pho-ga-dh-food-natural-goi-20g-202203110850280318.jpg', 'Gia vị phở gà DH Foods 20g', 15000.00, 0, 15000.00, NULL, NULL, 29, 'gói', '', 5.0, 'Là loại gia vị nêm sẵn cần thiết cho mọi món ăn trong gia đình đến từ thương hiệu gia vị nêm sẵn Dh Foods. Gia vị nấu phở gà DH Foods Natural gói 20g kết hợp các gia vị theo công thức chuẩn, vừa ngon vừa tự nhiên, mang đến tô phở gà với nước dùng trong veo, thanh ngọt hấp dẫn.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 21, 40),
(788, 'https://cdn.tgdd.vn/Products/Images/8271/225136/bhx/gia-vi-uop-thit-nuong-dh-food-goi-10g-202203111613191594.jpeg', 'Gia vị ướp thịt nướng Dh Foods 10g', 9600.00, 0, 9600.00, NULL, NULL, 71, 'gói', '', 5.0, 'Là loại gia vị nêm sẵn không chứa bột ngọt hay màu tổng hợp đến từ thương hiệu gia vị Dh Foods. Gia vị ướp thịt nướng Dh Foods gói 10g là sự kết hợp đầy mới lạ, mang đậm nét giao thoa ẩm thực Việt Nam và thế giới, giúp cho món thịt nướng thơm hơn và mùi vị đặc biệt hơn.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 21, 40),
(789, 'https://cdn.tgdd.vn/Products/Images/8271/225138/bhx/gia-vi-nau-bo-kho-dh-food-natural-goi-10g-202203110929475167.jpg', 'Gia vị bò kho Dh Foods 10g', 6400.00, 0, 6400.00, NULL, NULL, 68, 'gói', '', 5.0, 'Đây được xem là xốt nấu bò kho thần thánh, giúp các bà nội trợ có thể chế biến nhanh chóng mà vẫn thơm ngon đúng điệu đến từ gia vị nêm sẵn Dh Foods. Gia vị nấu bò kho Dh Foods Natural gói 10g là sự kết hợp các loại gia vị theo “tỉ lệ vàng” giúp nổi bật vị đậm đà và mùi thơm đặc trưng.', NULL, 0, 1, '2023-12-01 08:11:38', '2023-12-23 08:23:54', NULL, 21, 40),
