(872, 'https://cdn.tgdd.vn/Products/Images/7462/250179/bhx/sellingpoint.jpg', 'Sữa chua dẻo phô mai phúc bồn tử Merino gói 50g', 6000.00, 0, 6000.00, NULL, NULL, 78, 'bịch', '', 5.0, 'Dòng sản phẩm kem Merino ăn liền không còn xa lạ với những ai yêu thích hương vị chua ngọt của yourt tự nhiên. Sữa chua dẻo phô mai phúc bồn tử Merino gói 50g mang đến món kem vị sữa chua dẻo, cùng vị phô mai phúc bồn tử thơm ngon.', NULL, 0, 1, '2023-12-02 05:36:43', '2023-12-23 08:23:54', NULL, 25, 56),
