(1038, 'https://cdn.tgdd.vn/Products/Images/7169/200148/bhx/ba-roi-xong-khoi-xat-lat-le-gourmet-goi-200g-202310110849464167.jpg', 'Ba rọi xông khói xắt lát Le Gourmet gói 200g', 64000.00, 0, 64000.00, NULL, NULL, 40, 'gói', '200g', 5.0, 'Là loại sản phẩm cao cấp đến từ thương hiệu thịt nguội Le Gourmet quen thuộc. Ba rọi xông khói xắt lát Le Gourmet gói 200g được chế biến từ thịt heo ba rọi tươi ngon. Thịt nguội là lựa chọn hàng đầu khi không có quá nhiều thời gian chế biến cho bữa ăn gia đình.', NULL, 1, 1, '2023-12-02 05:36:44', '2024-01-01 05:40:16', NULL, 28, 69),
