(1040, 'https://cdn.tgdd.vn/Products/Images/7169/258065/bhx/sellingpoint.jpg', 'Giò lụa đặc biệt Vissan cây 500g', 119000.00, 0, 119000.00, NULL, NULL, 66, 'cây', '', 5.0, 'Giò lụa Vissan được đông đảo người tiêu dùng yêu thích bởi chất lượng đảm bảo và an toàn. Giò lụa đặc biệt Vissan cây 500g với nguồn nguyên liệu tươi sạch, đảm bảo an toàn vệ sinh thực phẩm cùng hương vị thơm ngon. Bạn có thể dùng trực tiếp giò lụa hoặc chế biến thành nhiều món ăn khác đều rất ngon.', NULL, 1, 1, '2023-12-02 05:36:44', '2024-01-01 05:40:06', NULL, 28, 68),
