(1133, 'https://cdn.tgdd.vn/Products/Images/8400/244643/bhx/ca-hoi-phi-le-sg-food-khay-200g-202302081034475715.jpg', 'Cá hồi phi lê đông lạnh SG Food 200g', 110000.00, 0, 110000.00, NULL, NULL, 79, 'khay', '', 5.0, 'Được tuyển chọn từ những con cá hồi nhập khẩu từ Nhật Bản giữ nguyên vị tươi ngon chắc thịt, Cá hồi phi lê SG Food khay 200g là một trong những lựa chọn tuyệt vời cho khách hàng đến từ cá đông lạnh SG Food. Đây là loại cá đông lạnh mang đến hương vị thơm ngon và cung cấp dinh dưỡng dồi dào.', NULL, 0, 1, '2023-12-02 05:36:44', '2023-12-23 08:23:54', NULL, 32, 16),
(1134, 'https://cdn.tgdd.vn/Products/Images/8400/240011/bhx/sellingpoint.jpg', 'Cá trứng một nắng đông lạnh SG Food 410g', 100000.00, 0, 100000.00, NULL, NULL, 62, 'khay', '410g', 5.0, 'Cá đông lạnh chất lượng từ cá đông lạnh SG Food mang đến cho bạn những bữa ăn ngon mỗi ngày. Sản phẩm cá trứng không tẩm SG Food khay 250g từ nguồn nguyên liệu cá trứng tươi ngon, bên trong chứa đầy ắp trứng có hương vị thơm ngọt, bùi béo và dinh dưỡng chất lượng.', NULL, 0, 1, '2023-12-02 05:36:44', '2023-12-23 08:23:54', NULL, 32, 16),
(1135, 'https://cdn.tgdd.vn/Products/Images/8791/244636/bhx/sellingpoint.jpg', 'Cá hồi phi lê tiêu xanh SG Food 300g', 117000.00, 0, 117000.00, NULL, NULL, 69, 'khay', '300g', 5.0, 'Được tuyển chọn từ những con cá hồi nhập khẩu từ Nhật Bản kết hợp với xốt tiêu xanh, cá hồi phi lê xốt tiêu xanh SG Food khay 300g là một trong những lựa chọn tuyệt vời cho khách hàng đến từ thực phẩm tẩm ướp SG Food. Đây là loại thực phẩm làm sẵn mang đến hương vị thơm ngon và cung cấp dinh dưỡng dồi dào.', NULL, 0, 1, '2023-12-02 05:36:44', '2023-12-23 08:23:54', NULL, 32, 16),
(1136, 'https://cdn.tgdd.vn/Products/Images/8791/244644/bhx/-202210121054325504.jpg', 'Cá saba na uy tẩm muối ớt SG Food 400g', 83500.00, 0, 83500.00, NULL, NULL, 60, 'gói', '', 5.0, 'Với nguồn nguyên liệu được đánh bắt từ vùng biển lạnh Na Uy, cá saba Na Uy tẩm muối ớt SG Food gói 400g có phần thịt trắng mềm béo kết hợp với vị muối ớt đặc trưng làm tăng thêm vị thơm ngon, đến từ thương hiệu thực phẩm tẩm ướp SG Food. Loại thực phẩm làm sẵn này cung cấp nguồn dinh dưỡng dồi dào.', NULL, 0, 1, '2023-12-02 05:36:44', '2023-12-23 08:23:54', NULL, 32, 16),
(1137, 'https://cdn.tgdd.vn/Products/Images/8791/222393/bhx/sellingpoint.jpg', 'Cá saba tiêu xanh SG Food 500g', 76000.00, 0, 76000.00, NULL, NULL, 90, 'gói', '500g', 5.0, 'Là sản phẩm thực phẩm chế biến sẵn vô cùng tiện lợi và thơm ngon đến từ thương hiệu thực phẩm tẩm ướp SG Food quen thuộc với người dùng. Cá saba tẩm tiêu xanh SG Food gói 500g được làm từ cá saba nguyên con được tẩm ướp tiêu xanh thơm nồng đậm đà, giúp người dùng chế biến nhanh chóng.\r\n', NULL, 0, 1, '2023-12-02 05:36:44', '2023-12-23 08:23:54', NULL, 32, 16),
(1138, 'https://cdn.tgdd.vn/Products/Images/8791/240006/bhx/sellingpoint.jpg', 'Cá trứng tẩm gia vị SG Food 250g', 51000.00, 0, 51000.00, NULL, NULL, 72, 'gói', '250g', 5.0, 'Hải sản tẩm ướp chất lượng từ thực phẩm tẩm ướp SG Food. Cá trứng tẩm gia vị SG Food khay 250g từ nguồn nguyên liệu nhập khẩu chất lượng, với hương vị thơm ngọt, bùi béo và dinh dưỡng, được tẩm ướp sẵn cùng các loại gia vị thích hợp có thể chế biến ra nhiều món ăn thơm khó cưỡng', NULL, 0, 1, '2023-12-02 05:36:44', '2023-12-23 08:23:54', NULL, 32, 16),
(1139, 'https://cdn.tgdd.vn/Products/Images/8791/222894/bhx/ca-saba-tam-sa-te-sg-food-goi-600g-202210121044287081.jpg', 'Cá saba tẩm sa tế SG Food gói 600g', 92000.00, 30, 64400.00, NULL, NULL, 86, 'gói', '', 5.0, 'Là sản phẩm thực phẩm chế biến sẵn vô cùng tiện lợi và thơm ngon đến từ thương hiệu thực phẩm làm sẵn SG Food quen thuộc với người dùng. Cá saba tẩm sa tế SG Food gói 600g được làm từ cá saba nguyên con được tẩm ướp sa tế cay thơm, đậm đà, giúp người dùng chế biến nhanh chóng.', NULL, 0, 1, '2023-12-02 05:36:44', '2023-12-23 08:23:54', NULL, 32, 16),
(1140, 'https://cdn.tgdd.vn/Products/Images/8400/212203/bhx/que-surimi-huong-vi-cua-akira-3n-foods-goi-250g-202203182245025430.jpg', 'Thanh surimi vị cua 3N Akira 250g', 60000.00, 30, 42000.00, NULL, NULL, 13, 'gói', '250g', 5.0, 'Hải sản đông lạnh thương hiệu 3N Food gồm surimi, tinh bột khoai mì, lòng trắng trứng, chiết xuất cua, hương cua tổng hợp, dầu thực vật, chất điều vị, màu thực phẩm tổng hợp. Que surimi hương cua 3N Foods Arika gói 250g có thể dùng để làm món cơm chiên, mì xào, lẩu, sushi,...vô cùng thơm ngon', NULL, 0, 1, '2023-12-02 05:36:44', '2023-12-23 08:23:54', NULL, 32, 80),
(1141, 'https://cdn.tgdd.vn/Products/Images/12538/200125/bhx/lau-hai-san-thap-cam-sg-food-goi-500g-202202171139526815.jpg', 'Lẩu hải sản thập cẩm SG Food 500g', 86000.00, 0, 86000.00, NULL, NULL, 5, 'gói', '500g', 5.0, 'Đây là sản phẩm lẩu làm sẵn, thích hợp sử dụng trong những ngày bận rộn. Lẩu hải sản thập cẩm SG Food gói 500g bao gồm những phần nguyên liệu tươi ngon từ thịt cá, cá viên, chạo ốc,... cùng với gói sốt đậm đà hương vị lẩu hải sản đến từ thương hiệu thực phẩm làm sẵn SG Food quen thuộc với người dùng.', NULL, 0, 1, '2023-12-02 05:36:44', '2023-12-23 08:23:54', NULL, 33, 16),
(1142, 'https://cdn.tgdd.vn/Products/Images/12538/200145/bhx/lau-thai-sg-food-goi-500g-202202171052206476.jpg', 'Lẩu thái SG Food 500g', 86000.00, 0, 86000.00, NULL, NULL, 85, 'khay', '500g', 5.0, 'Đây là sản phẩm lẩu làm sẵn, thích hợp sử dụng trong những ngày bận rộn. Lẩu thái SG Food gói 500g bao gồm những phần nguyên liệu tươi ngon từ thịt cá, cá viên, chạo ốc,... cùng với gói sốt đậm đà hương vị lẩu Thái đến từ thương hiệu thực phẩm làm sẵn SG Food quen thuộc với người dùng.', NULL, 0, 1, '2023-12-02 05:36:44', '2023-12-23 08:23:54', NULL, 33, 16),
(1143, 'https://cdn.tgdd.vn/Products/Images/12538/244592/bhx/lau-thai-chay-sg-food-khay-500g-202310300853584486.jpg', 'Lẩu thái chay SG Food 500g', 65000.00, 0, 65000.00, NULL, NULL, 9, 'khay', '', 5.0, 'Được làm từ các loại thực phẩm chay an toàn cho sức khoẻ cho người dùng. Lẩu thái chay SG Food khay 500g không chỉ là loại thực phẩm làm sẵn chế biến nhanh chóng, tiện lợi mà còn mang đến hương vị thơm ngon, đầy kích thích đến từ thương hiệu thực phẩm tẩm ướp SG Food.', NULL, 0, 1, '2023-12-02 05:36:44', '2023-12-23 08:23:54', NULL, 33, 16),
(1144, 'https://cdn.tgdd.vn/Products/Images/12538/312853/bhx/lau-thai-chua-cay-deli-sg-food-goi-500g-202308080942271559.jpg', 'Lẩu Thái chua cay Deli SG Food 500g', 61500.00, 0, 61500.00, NULL, NULL, 91, 'gói', '', 5.0, 'Đây là sản phẩm lẩu làm sẵn, thích hợp sử dụng trong những ngày bận rộn. Lẩu Thái chua cay Deli SG Food gói 500g bao gồm những phần nguyên liệu tươi ngon từ vây cá, hải sản,... cùng với gói lẩu cô đặc chua cay đậm đà đến từ thương hiệu thực phẩm làm sẵn SG Food quen thuộc với người dùng.', NULL, 0, 1, '2023-12-02 05:36:44', '2023-12-23 08:23:54', NULL, 33, 16),
(1147, 'https://cdn.tgdd.vn/Products/Images/12538/298755/bhx/sellingpoint.jpg', 'Súp kim chi Hàn Quốc Cầu Tre 325g', 54000.00, 0, 54000.00, NULL, NULL, 26, 'gói', '325g', 5.0, 'Lẩu làm sẵn Cầu Tre là dạng thực phẩm làm sẵn tiện dụng, đóng gói và bảo quản đông lạnh được nhiều khách hàng tin dùng. Súp kim chi kiểu Hàn Quốc Cầu Tre gói 325g với xốt kim chi đậm đà, topping kèm theo hấp dẫn chuẩn vị ngon ăn kèm với cơm là hết sẩy.', NULL, 0, 1, '2023-12-02 05:36:44', '2023-12-23 08:23:54', NULL, 33, 74),
(1148, 'https://cdn.tgdd.vn/Products/Images/12538/298756/bhx/sellingpoint.jpg', 'Súp chả cá Hàn Quốc Cầu Tre 305g', 54000.00, 0, 54000.00, NULL, NULL, 55, 'gói', '305g', 5.0, 'Lẩu làm sẵn Cầu Tre là dạng thực phẩm làm sẵn tiện dụng, đóng gói và bảo quản đông lạnh được nhiều khách hàng tin dùng. Súp chả cá kiểu Hàn Quốc Cầu Tre gói 305g nước súp đậm đà, chả cá mềm bùi cực ngon, chế biến lại nhanh chóng, dễ dàng.', NULL, 0, 1, '2023-12-02 05:36:44', '2023-12-23 08:23:54', NULL, 33, 74),
(1149, 'https://cdn.tgdd.vn/Products/Images/12538/228972/bhx/lau-tha-long-cung-cau-tre-300g-202211030906380819.jpg', 'Lẩu thả long cung Cầu Tre 300g', 54000.00, 0, 54000.00, NULL, NULL, 95, 'gói', '', 5.0, 'Viên thả lẩu hơm ngon, dinh dưỡng lại vô cùng đậm đà gia vị. Lẩu thả long cung Cầu tre khay 300g được làm từ những nguyên liệu chế biến sẵn tươi ngon. Viên thả lẩu Cầu Tre luôn mang đến những sản phẩm chất lượng, an toàn, ngon miệng, kích thích vị giác', NULL, 0, 1, '2023-12-02 05:36:44', '2023-12-23 08:23:54', NULL, 33, 74);
