(1151, 'https://cdn.tgdd.vn/Products/Images/12538/289985/bhx/lau-rieu-cua-bap-bo-orifood-hop-13kg-202212280948023973.jpg', 'Lẩu riêu cua bắp bò Orifood 1.3kg', 355000.00, 0, 355000.00, NULL, NULL, 68, 'hộp', '1.3kg', 5.0, 'Thực phẩm tẩm ướp Orifood là thương hiệu cung cấp các sản phẩm làm sẵn tiện dụng, mua về chỉ cần nấu chín là có thể dùng ngay cho bữa ăn nhanh chóng, tiện lợi. Lẩu riêu cua bắp bò Orifood hộp 1.3kg với thịt bò, heo chất lượng cao cùng với nước cốt lẩu đậm đặc cực ấn tượng, ăn là ghiền.', NULL, 0, 1, '2023-12-02 05:36:44', '2023-12-23 08:23:54', NULL, 33, 81),
