(1154, 'https://cdn.tgdd.vn/Products/Images/12538/239264/bhx/sellingpoint.jpg', 'Viên thả lẩu trứng cá La Cusina 500g', 79000.00, 30, 55300.00, NULL, NULL, 23, 'gói', '', 5.0, 'Viên thả lẩu là sản phẩm vô cùng tiện lợi, rất được giới trẻ yêu thích đến từ thương hiệu viên thả lẩu La Cusina. Viên thả lẩu trứng cá La Cusina gói 500g dai dai mềm mềm cùng phần nhân trứng cá căng mọng, đậm đà. Là loại viên thả lẩu thích hợp ăn kèm với nhiều món ăn khác nhau.', NULL, 0, 1, '2023-12-02 05:36:44', '2023-12-23 08:23:54', NULL, 33, 64),
