(1156, 'https://cdn.tgdd.vn/Products/Images/12538/285259/bhx/sellingpoint.jpg', 'Lẩu tiềm chay Trần Gia 500g', 66500.00, 0, 66500.00, NULL, NULL, 11, 'khay', '500g', 5.0, 'Thực phẩm tẩm ướp Trần Gia là hãng thực phẩm sơ chế, tẩm ướp rất có tiếng tại Việt Nam với các sản phẩm chất lượng cao, an toàn. Lẩu tiềm chay Trần Gia khay 500g với nguyên liệu tự nhiên, dinh dưỡng cho món lẩu chay nhanh chóng, tiện dụng hơn bao giờ hết.', NULL, 0, 1, '2023-12-02 05:36:44', '2023-12-23 08:23:54', NULL, 33, 15),
